(6764, 'A0200RO', 'Cable para Monitor Manhattan  SVGA 8mm, VGA (D-Sub) Macho - VGA (D-Sub) Macho, 15 Metros, Negro MONITOR PANTALLA', 0, 'pending', 'hidden', 0, 0.22, 0.22, 0.22, 'Conexiones confiables para una calidad de señal superior. _x000D_\nLos cables SVGA de Manhattan conectan fácilmente un monitor con una computadora de escritorio o portátil. Ideales para usar con divisores de video, conmutadores KVM y cualquier pantalla, computadora o dispositivo equipado con HD15, los cables SVGA de Manhattan están diseñados y fabricados con materiales de calidad para brindar transmisiones confiables en aplicaciones de video. El blindaje trenzado y de lámina completa, las botas moldeadas con alivio de tensión y mini-coaxial (RGB) y la construcción de cables de video emparejados ayudan a proporcionar la máxima conductividad e imágenes claras y nítidas con menor interferencia EMI y distorsión en distancias extendidas.', 446, 494, NULL, 0),
