(6844, 'A0200XA', 'Extensor de Línea USB Manhattan , USB A y RJ45 Macho/Hembra, hasta 60m 60M VIA RJ45                    .', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Conecte dispositivos USB a largos alcancesEl Extensor de Línea USB MANHATTAN facilita la comunicación en distancias largas entre un dispositivo USB y la computadora sin pérdidas en la señal. Las unidades local y remota con su chipset UNIQUE UIC 4102 y un cable UTP Cat5e (no incluido) pueden conectar, procesar y repetir las señales USB. Las unidades local y remota pueden también ser usadas con cables de diversas longitudes de hasta 60 m.Ofrece flexibilidad para conectar cualquier dispositivo USBUse el Extensor de Línea USB MANHATTAN para romper la restricción en distancia USB y expandir las ubicaciones entre dispositivos y la PC, otorgando mayor productividad y organización en su oficina. El el Extensor de Línea USB MANHATTAN le puede ayudar a extender los cables de un teclado o ratón durante una presentación, operar una lectora de código de barras en un punto de venta, acceder a una impresora en otro cuarto o hacer otras conexiones USB sin perder los niveles de señal o ser afectada por otras interferencias. Fácil de instalar y de transportarSu tamaño, peso ligero y portabilidad sin necesidad de conectar fuentes de alimentación externas, lo hacen ideal para viajes y ser usado donde sea. Su capacidad Plug and Play y compatibilidad con Windows y Macintosh hacen de su instalación fácil y rápida.1. El voltaje de salida es estándar por USB de 4.75 a 5.25V. 2. Entrada máxima de voltaje 5.3V. 3. No es posible colocar un adaptador de energía externo.\n', 446, 494, NULL, 0),
(6845, 'A0200XB', 'Cable HDMI Manhattan de Alta Velocidad con Canal Ethernet, HDMI Macho - micro HMDI, 2 Metros, Negro 2M+ETHERNET', 0, 'pending', 'hidden', 0, 0.12, 0.12, 0.12, 'Cables de Alta Velocidad entregan un desempeño de Alta DefiniciónHDMI se ha convertido en el estándar digital para conexiones de audio y vídeo de Alta Calidad sobre un solo cable. Los Cables HDMI de Alta Velocidad MANHATTAN están diseñados y cuidadosamente construidos para cubrir las necesidades de la Alta Definicón que el mercado requiere. Los Cables HDMI de Alta Velocidad MANHATTAN proporcionan la más alta resolución posible a 4K x 2K, canal de retorno de audio y un ancho de banda de 10.2 Gbit/sec a 340 MHz. Estos cables de alta calidad proporiconan una Alta Definción en vídeo y audio digital en multicanal con características de desempeño mejoradas y mejor precisión. No importa si requiere cables para dispositivo, de extensión o conexiones Mini o Micro MANHATTAN tiene su cable HDMI de Alta Velocidad.\n\n', 446, 494, NULL, 0),
