(6898, 'A0201EJ', 'SWITCH HUB HDMI 4K 3D 3 PUERTOS INCLUYE CONTROL ALIMENTACION USB', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'Conecta fácilmente múltiples fuentes HDMI a una sola pantallaEl Switch Manhattan HDMI de 3 puertos le permite a los entusiastas de los medios conectar hasta tres fuentes de video Ultra HD - incluyendo consolas de videojuegos, reproductores Blu-ray, receptores satelitales, grabadoras digitales, decodificadores y otros dispositivos - a una pantalla UHD 4K.Una solución flexible para muchas aplicaciones 4KCon el creciente número de dispositivos Ultra HD, el Switch Manhattan HDMI de 3 puertos expande las opciones de conectividad de tu pantalla 4K HDTV, pantalla plana, o video proyectores. El Switch detecta automáticamente y selecciona la fuente HDMI activa y envía la señal a tu pantalla. Cuando más de un dispositivo UHD está encendido al mismo tiempo, el control remoto incluido te permitirá seleccionar remotamente una fuente, o la podrás seleccionar manualmente con el botón integrado.La mejor calidad de imágen posibleSu completa compatibilidad con HDMI, HDCP 1.3 y DVI 1.0 asegura que el Switch Manhattan HDMI de 3 puertos pueda brindar un largo servicio y un rendimiento confiable. Brinda una resolución cinematográfica 4K y soporta video 3D, Color Profundo, así como LPCM, DTS y sonido Dolby TrueHD.\n', 446, 467, NULL, 0),
