(6900, 'A0201HG', 'Cable USB Manhattan  2.0 Macho - RS-232 Macho, 0.45 Metros, Negro USB A 2 PUERTOS SERIAL DB9 RS232', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, 'Conecte fácilmente dispositivos seriales a través de un puerto USB.\nLa mayoría de los ordenadores y portátiles modernos no tienen puertos RS232 (DB9), lo que hace que el uso de periféricos heredados y dispositivos de alta tecnología que se conectan con puertos COM sea casi imposible. El convertidor de USB a serie de Manhattan, con sus puertos serie RS232 (DB9) y el chipset Prolific PL-2303RA, expande fácilmente un solo puerto USB para conectar y admitir módems en serie, lectores de códigos de barras, cámaras digitales, lectores de tarjetas, radios de radioaficionado / aficionado, GPS , Máquinas CNC, telescopios, máquinas de bordar, controladores de inyección de combustible, PDU, conmutadores de red y otros dispositivos.\n\nConstrucción de calidad y fácil instalación\nLos contactos enchapados en oro y la construcción resistente se combinan para ofrecer una conexión confiable entre la computadora y los periféricos en serie para un rendimiento constante y sin problemas. La compatibilidad de Windows con la instalación plug-and-play y la capacidad de intercambio en caliente ayudan a proporcionar un uso perfecto sin conflictos de dispositivos inconvenientes y frustrantes.', 446, 494, NULL, 0),
