(6903, 'A0201HS', 'Cable Manhattan  HDMI Macho - HDMI Macho, 5 Metros, Negro/Blanco  3D 4K M-M VELOCIDAD 2.0 NEG/BLA', 0, 'pending', 'hidden', 0, 0.19, 0.19, 0.19, 'Los cables de alta velocidad brindan un rendimiento de alta definición sin enredos. La tecnología HDMI se ha convertido en la conexión digital estándar, brindando la más alta calidad en audio y video a través de un solo cable. Con un forro textil, resistente a enredos, contactos chapados en oro, y una cubierta PVC, los Cables HDMI de Alta Velocidad con Ethernet y Cubierta Textil de MANHATTAN están fabricados cuidadosamente para satisfacer las necesidades del mercado de alta definición. Los Cables HDMI de Alta Velocidad con Ethernet y Cubierta Textil de MANHATTAN brindan la más alta resolución posible a 4K x 2K, un canal de retorno de audio y un ancho de banda de 18 Gbps a 600 MHz. Estos cables de alta calidad brindan un video de ultra alta definición y un sonido digital multicanal con elevadas características de rendimiento y una precisión increíble. Sus características ampliadas incluyen conectividad de Internet para dispositivos de entretenimiento en el hogar utilizando un solo cable. Además, el diseño único de este cable lo hace fácil de enrollarse sin preocuparse por que se enrede o que haya nudos, mientras resiste cortes y rasguños.\n', 446, 496, NULL, 0),
