(6913, 'A0201KV', 'Video Splitter Manhattan HDMI, 8 Puertos, Negro PTOS DIVISOR DUPLICADOR DE SENAL', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Distribuya fácilmente una única señal de ultra alta definición (UHD) a varias pantallas.\n\nEl divisor HDMI 4K de 8 puertos de Manhattan con amplificador incorporado transmite una señal HDMI 4K desde una sola fuente UHD a hasta ocho pantallas UHD.\n\nLa mejor calidad de imagen posible y una instalación sencilla\nEl cumplimiento total de HDMI y HDCP 1.4 garantiza que el divisor HDMI 4K de 8 puertos de Manhattan proporcione un rendimiento y una confiabilidad de alta calidad. Ofrece una resolución cinematográfica de 4K y admite vídeo 3D y Deep Color, así como audio LPCM, DTS y Dolby TrueHD. Conecte rápidamente los cables HDMI (no incluidos) y la fuente de alimentación para completar esta solución 4 K rentable: no se requiere configuración de software / hardware ni configuraciones complicadas.', 446, 496, NULL, 0),
(6914, 'A0201KW', 'Manhattan Adaptador Mini DisplayPort Macho - HDMI Hembra, Negro MINI DISPLAYPORT A HDMI 4K M-H', 0, 'pending', 'hidden', 0, 0.18, 0.18, 0.18, 'Conecta fácilmente una fuente mini-DisplayPort a un cable HDMI. Los Adaptadores Pasivos Mini-DisplayPort a HDMI Manhattan establecen una conexión rápida y cómoda entre una fuente de medios equipada con mini-DisplayPort y un cable de monitor HDMI. Este adaptador activo supera las limítaciones de no contar con una tarjeta de video/gráfica DP++ (de modo dual) y convierte la señal para proyectar. Es ideal para videojuegos en multi-pantallas, señalización digital en pantallas de retail, mercado financiero y otras aplicaciones. Sus contactos con baño de níquel y su blindaje ayudan a que los Adaptadores mini DisplayPort a HDMI MANHATTAN proporcionen transmisiones de vídeo HD claras y estables en aplicaciones multimedia en la casa y oficina. Sus cubiertas resistentes de PVC y botas moldeadas con alivio de tensión, ayudan a asegurar que las conexiones se mantengan ininterrumpidas y estables.', 446, 494, NULL, 0),
