(6947, 'A0201MZ', 'Cable Manhattan  USB C Macho - HDMI Macho, 1 Metro, Negro USB-C 3.1 A HDMI 1.0M 4K M-M', 0, 'pending', 'hidden', 0, 0.24, 0.24, 0.24, 'El cable adaptador de USB-C a HDMI de Manhattan transmite una señal de audio / video USB a un proyector HDMI, pantalla plana, televisión o dispositivo similar. Los circuitos integrados permiten a los entusiastas de los medios digitales disfrutar fácilmente del contenido multimedia basado en USB en una pantalla de ultra alta definición (UHD) mientras mantienen la recepción A / V simultánea en la fuente. Su capacidad UHD admite hasta 3840x2160 30Hz y 4K para ofrecer una amplia gama de resoluciones en muchos dispositivos y aplicaciones UHD, incluidas configuraciones de capacitación, venta minorista y ferias comerciales. Su dispositivo fuente debe admitir el modo DP Alt. No se requiere ninguna configuración adicional. Entrega sin esfuerzo contenido digital que se almacena en un teléfono inteligente, tableta, Ultrabook o computadora portátil a una pantalla con capacidades de entrada HDMI.', 446, 494, NULL, 0),
