(6950, 'A0201M4', 'Manhattan Cable USB C Macho - Serial Macho, 45cm, Gris/Negro USB-C A SERIAL DB9 RS232 45CM M-M', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Conecta fácilmente dispositivos seriales a través de un puerto USB.La mayoría de las computadoras modernas y computadoras portátiles no tienen puertos RS232 (DB9), haciendo que el uso de periféricos antiguos y dispositivos de alta tecnología que se conectan con puertos COM sea casi imposible. El convertidor USB a Serial de Manhattan - con su puerto serial RS232 (DB9) y chipset Prolific PL-2303RA - expande fácilmente un solo puerto USB para conectar y soportar modems seriales, lectores de códigos de barras, cámaras digitales, lectores de tarjetas, radios Ham/Amateurs, GPS, maquinas CNC, telescopios, máquinas de bordado, controladores de inyección de combustible, PDUs, switches de red y otros dispositivos. Calidad de construcción y fácil instalaciónContactos chapados en oro y construcción rígida se combinan para ofrecer una conexión confiable entre la computadora y periféricos seriales para un desempeño consistente y libre de problemas. Compatible con Windows e instalacion \"plug and play\" y \"hot-swappability\" que ayuda a proveer uso fluido sin inconvenientes y conflictos frustrantes de dispositivos.', 446, 494, NULL, 0),
