(6959, 'A0201QI', 'Divisor de Video Manhattan  HDMI, 2 Puertos 2 ENTRADAS : 1 SALIDA', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, 'Conecte fácilmente varias fuentes HDMI a una sola pantalla.El conmutador HDMI de 2 puertos 1080p Manhattan conecta dos fuentes de video HDMI, incluidas consolas de juegos, reproductores de Blu-ray, receptores de satélite, grabadoras digitales, decodificadores y otros dispositivos, a una sola Pantalla de alta definición Solución flexible para muchas aplicaciones HD Con el mayor número de dispositivos multimedia de alta definición disponibles, el conmutador HDMI de 2 puertos 1080p Manhattan amplía las opciones de conectividad para su HDTV, monitor de pantalla plana o proyector de video. El interruptor detecta y selecciona automáticamente la fuente HDMI activa y enruta la señal a su pantalla. Además, su botón de selección manual permite a los usuarios seleccionar fuentes cuando más de una fuente de video HD está encendida al mismo tiempo. La mejor calidad de imagen posible El cumplimiento total con HDMI y HDCP 1.0 y 1.1 asegura que el conmutador HDMI de 2 puertos 1080p Manhattan proporciona alta calidad. rendimiento de calidad y fiabilidad. Ofrece imágenes con resolución completa de 1080p y admite video 3D, así como audio LPCM, DTS y Dolby TrueHD.\n\nConecta dos fuentes de video HD a una sola pantalla HDMI\nAdmite un ancho de banda de amplificador de video de hasta 250 MHz y 2.5 Gbps por canal (7.5 Gbps en total) para pantallas de 1080p\nAdmite Deep Color de 36 bits (12 bits por canal), submuestreo de croma 4: 4: 4\nAdmite cambio automático (cuando se detecta una señal HD) y cambio manual (entre fuentes con solo presionar un botón)\nAdmite LPCM, DTS Digital, DTS-HD Master Audio y Dolby TrueHD audio\nAdmite video 3D y color profundo de 8 bits (24 bits en total)\nAdmite un ancho de banda de amplificador de video de hasta 2.5 Gbps para una pantalla de 1080p\nFunciona con sistemas de juego PlayStation y Xbox, reproductores de Blu-ray, decodificadores, receptores de satélite y más\nCompatible con HDCP\nPlug and play: sin requisitos especiales de configuración, alimentación o control remoto\nContactos chapados en oro para conexiones libres de corrosión\nGarantía de tres años', 446, 467, NULL, 0),
