(6969, 'A0201Q2', 'Maletín de Poliéster Manhattan  London para Laptop 14.1\", Negro .', 0, 'pending', 'hidden', 0, 0.35, 0.35, 0.35, 'Diseño adecuado con una buena protección para su computadora El maletín \"London\" para computadora portátil de Manhattan es una solución práctica con un estilo aerodinámico y tradicional que se desplaza fácilmente y se adapta a casi cualquier lugar, debajo de los asientos de las aerolíneas, en los compartimientos superiores y en las piezas de equipaje más grandes. Un solo bolsillo frontal ancho y profundo mantiene tus artículos vitales, papeles y accesorios seguros pero al alcance de la mano. Su solapa asegurada con cierre protege los contenidos almacenados. Las asas de doble correa con costuras reforzadas y una correa de hombro ajustable y extraíble brindan a los profesionales múltiples opciones de transporte. Almacenamiento básico y funcional Su interior con compartimento acolchado para computadora se adapta a la mayoría de las computadoras portátiles con pantallas de hasta 14.1\". El diseño de acceso por la parte superior permite guardar más rápido y que las inspecciones en el aeropuerto sean más sencillas. Hay espacio suficiente en el interior para guardar archivos, papeles y revistas. Diseño hermoso para trabajar El interior y exterior están cuidadosamente construidos con materiales ligeros, durables y de fácil mantenimiento que resisten el agua y el desgaste. Materiales de uso pesado ? incluyendo los cierres con ganchos resistentes ? aseguran la operación con menos atascos. Los Maletines para Computadora Portátil MANHATTAN combinan una protección superior para la PC y un estilo atractivo con comodidad y conveniencia cuando son llevadas en la ciudad, los países y a todo el mundo..\n', 446, 511, NULL, 0),
