(6988, 'A0201SB', 'Hub Manhattan  USB 3.0 de Supervelocidad, 3x USB A, 5000 Mbit/s - sin Fuente MAS LECTOR TARJETAS', 0, 'pending', 'hidden', 0, 0.21, 0.21, 0.21, '\nRendimiento potente y rápido SuperSpeed ??USB 3.0 en un concentrador multipuerto y lector / escritor de tarjetas. El concentrador y lector / grabador de tarjetas USB 3.0 SuperSpeed ??de Manhattan expande fácilmente el acceso USB para el escritorio y el uso móvil para conectar más periféricos, dispositivos móviles y tarjetas de memoria. Cree más conexiones para dispositivos SuperSpeed ??USB 3.0, como dispositivos de almacenamiento USB y cámaras web, y administre contenido digital a través de la función de lectura / escritura de tarjetas. Es compatible con versiones anteriores de los estándares USB, lo que brinda versatilidad para los dispositivos conectados. Plug-and-play con capacidades de intercambio en caliente, compatibilidad con Windows y Mac y velocidades de transferencia de datos de hasta 5 Gbps ayudan al concentrador y lector / grabador de tarjetas Manhattan SuperSpeed ??USB 3.0 a consolidar numerosos concentradores menos capaces en una sola solución USB.', 446, 467, NULL, 0),
