(6991, 'A0201SH', 'Divisor de Video Manhattan  HDMI, 2x HDMI, Negro HZ  1 IN : 2  OUT   AC', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'Distribuya una señal individual de Ultra Alta Definición (UHD) a múltiples pantallas.El repartidor Manhattan 4K 2-Port HDMI con intensificador integrado transmite una señal de 4K HDMI de una única fuente UHD a hasta dos pantallas UHD. Una solución flexible para muchas aplicaciones de audio/vídeoIdeal para aplicaciones para ferias, aulas, videoconferencias y para comercios pequeños, el repartidor Manhattan 4K 2-Port cuenta con un intensificador (booster) integrado para una señal aún más fuerte. Además, es la solución ideal para repartir y distribuir una señal individual a diferentes pantallas HDMI de 4K cuando el equipo base esté guardado en un cuarto seguro u oficina. Los usuarios pueden organizar en cascada unidades múltiples en hasta tres niveles, con salidas HDMI de audio/vídeo a pantallas adicionales en las aplicaciones ampliamente distribuidas. La mejor calidad y fácil instalaciónLa compatibilidad absoluta con HDMI, HDCP 1.4 y DVI 1.0 garantiza un rendimiento de alta calidad y fiabilidad del repartidor Manhattan 4K 2-Port HDMI. Conecte rápidamente todos los cables HDMI (no incluidos) y el adaptador AC y esta buenísima solución HDMI estará lista para usar: sin configuraciones complicadas del software o del hardware.\n', 446, 494, NULL, 0),
