(6993, 'A0201SY', 'Cable Manhattan  DisplayPort Macho - HDMI Macho, 1 Metro, Negro 1080P  1.0M', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Un complemento indispensable para su computadora portátil o de escritorio con conexión DisplayPort Para la instalación más simple y discreta, este cable de DisplayPort a HDMI conecta su fuente de video DisplayPort a una pantalla con puerto HDMI. No necesita una fuente de alimentación, a diferencia de algunos convertidores que requieren alimentación activa y cables de video voluminosos adicionales. Este cable le permite disfrutar de películas en una pantalla grande HD, extender su escritorio a un segundo monitor (hasta 1080p) para un espacio de trabajo ampliado, o mostrar presentaciones en un proyector en la escuela o el trabajo sin necesidad de ningún otro adaptador o convertidor. p>\n', 446, 494, NULL, 0),
