(7000, 'A0201TE', 'Cable Manhattan  HDMI Plenum, HDMI Macho - HDMI Macho, 30 Metros, Negro 30.0M', 0, 'pending', 'hidden', 0, 0.24, 0.24, 0.24, 'Disfrute de un rendimiento de Ultra Alta Definición (UHD) sin interferencias. El Cable Óptico Activo HDMI (AOC) con clasificación Plénum de Manhattan es la solución perfecta para enviar una señal HDMI a un lugar deseado, como un aula, una sala de conferencias, un centro de salud, una feria comercial u otro entorno comercial. La tecnología AOC ofrece varias ventajas sobre los cables HDMI estándar. Su diámetro de cable más pequeño garantiza una mayor flexibilidad y maniobrabilidad durante la instalación en espacios reducidos como tuberías o paredes, y su construcción a partir de hilos de fibra elimina el riesgo de interferencias electromagnéticas / de radiofrecuencia para brindar el mejor rendimiento, estabilidad y confiabilidad cuando se usa. El AOC es una excelente opción para entornos de alta interferencia, como centros de datos, quirófanos, eventos de DJ o instalaciones de fabricación donde la alta resolución y la visualización constante son fundamentales. El cable óptico activo HDMI con clasificación Plénum de Manhattan es Plug and Play, que consume energía del dispositivo fuente HDMI, por lo que no se requiere una fuente de alimentación externa.\n', 446, 496, NULL, 0),
