(7023, 'A0201UM', 'Cargador de Pared Manhattan, 5V, 2x USB, Blanco TOTAL (2 CEL O 1 TABLET)', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, '\nMantenga sus dispositivos portátiles completamente cargados.\nLos dispositivos electrónicos portátiles USB imponen una gran demanda de energía a sus baterías, pero Manhattan PopCharge Home puede ayudar a mantener sus tabletas, teléfonos móviles, cámaras digitales y otros dispositivos cargados y listos para usar. El PopCharge Home se conecta a cualquier tomacorriente de pared estándar y ofrece una carga rápida para sus dispositivos portátiles a través de dos puertos de carga USB (1 amperio por puerto cuando dos dispositivos se están cargando; 2.1 amperios cuando un dispositivo se está cargando). Los circuitos integrados avanzados ayudan a evitar la sobrecarga y los cortocircuitos que pueden dañar y reducir la vida útil de las baterías y los dispositivos. Además, un LED brillante le indica cuándo su dispositivo está completamente cargado y listo para usar.\n\nCargador de pared USB enchufable para tabletas, teléfonos móviles y otros dispositivos portátiles\nCuenta con dos puertos de carga USB\nSe carga a 1 amperio por puerto cuando dos dispositivos se están cargando o 2.1 amperios cuando un dispositivo se está cargando\nLos circuitos avanzados ayudan a prevenir la sobrecarga y los cortocircuitos\nRobusto, compacto y ligero para viajar\nGarantía de tres años\n', 446, 507, NULL, 0),
