(7042, 'A02012V', 'Mini Adaptador Manhattan  HDMI - mini DisplayPort, 17cm, Blanco MINI DISPLAYPORT A HDMI 1080P M-H', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Los Adaptadores Mini-DisplayPort a HDMI Manhattan ayudana a establecer una conexión rápida y conveniente entre un dispositivo equipado con mini-DisplayPort y un cable de monitor HDMI. Ideal para presentaciones, display para retail y otros usos, esta solución de cable único mantienen las instalaciones y los espacios ordenados y organizados sin necesidad de instalar fuentes de alimentación externas o de configuraciones complicadas. Sus contactos con baño de níquel y su blindaje ayudan a que los Adaptadores Mini-DisplayPort Manhattan proporcionen transmisiones de vídeo claras y estables en la casa y oficina en aplicaciones multimedia. Su forro blanco durable de PVC y sus terminales moldeadas a prueba de tensiones complementan los sistemas Macintosh y ayudan a que las conexiones se mantengan ininterrumpidamente.\n', 446, 496, NULL, 0),
