(7045, 'A02018M', 'Manhattan Convertidor USB - Serie 4x RS-232 9-pin, Plata SERIAL DB9 RS232 4PUERTOS', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'Conecte fácilmente dispositivos serie a través de un puerto USBLas computadoras modernas regularmente no vienen equipadas con puertos RS232, haciendo el uso de dispositivos periféricos y de comunicación más difícil. El Convertidor USB a Serie MANHATTAN con puertos RS232 expande con facilidad un puerto USB para conectar y soportar hasta cuatro dispositivos serie; por ejemplo Módems, lectores de códigos de barras, cámaras digitales, lectores de tarjetas y otros dispositivos.Construcción de calidad y de fácil instalaciónSus contactos con baño de oro y construcción robusta se combinan para ofrecer conexiones confiables entre la computadora y los dispositivos serie para brindar un desempeño consistente y libre de fallos. Compatible con Windows en su instalación plug and play y capacidad hot swap proporcionan un uso perfecto sin conflictos inconvenientes y frustrantes con otros dispositivos.\n', 446, 494, NULL, 0),
(7046, 'A02018O', 'Manhattan Cable Micro USB 5-pin - HDMI, con USB A para Alimentación, Negro ALIMENTACION USB DISPOSITIVOS A TV', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'El Enlace de Alta Definición Móvil (MHL, en inglés por Mobile High-Definition Link) permite\na tablets y smartphones transmitir señales de video y audio digital a través de su conector\nMicro USB para ser vistas en una televisión de HD.\nEl cable MHL HDTV te permite conectar un smartphone o tablet con MHL de 5 pines (Sony\nXperia Z y recientes; HTC One y recientes; Samsung Galaxy S2, Note, Nexus y otros\ndispositivos disponibles con MHL) a una televisión de HD, monitor o proyector a través de\nsi conexión HDMI. Brinda un video cristalino con resolución de hasta 1080p y 8 canales de\naudio digital para disfrutar de una multimedia óptima, además tiene un conector USB\nadicional para cargar simultáneamente tu dispositivo móvil.\nPara utilizarlo, simplemente conecta el conector USB del cable MHL en un cargador USB\nde pared y conéctalos en una fuente de energía.\nLuego, conecta ls entrada HDMI del cable MHL HDTV a tu televisión HD, monitor o\nproyector. Finalmente, conecta la entraba Micro USB en tu smartphone o tablet y disfruta*.\n¿No estás seguro de que tu smartphone soporta la tecnología MHL? Sigue este link para\nconsultarlo: http://meetmhl.com/DoIHaveMhl.aspx.\n*Utiliza el adaptador Manhattan MHL de 5 a 11 pines, modelo 151481, para aplicaciones\nde 11 pines (Galaxy S3, Note 2, Mega y recientes)', 446, 494, NULL, 0),
