(7054, 'A02019F', 'Manhattan 177672 Lector de Códigos de Barras CCD - incluye Cable USB 50CM USB NE.', 0, 'pending', 'hidden', 0, 0.24, 0.24, 0.24, 'Velocidad, precisión y productividad mejoradasEl Lector de Código de Barras CCD de Largo Alcance entrega lecturas básicas de alta calidad para un amplio rango de recolección de datos para mejorar las tareas rutinarias de transacción, automatización de procesos por papeleo e incrementa la productividad. El dispositivo CCD (Dispositivo de Cargas Acopladas) de lectura no presenta partes móviles y con esto brinda años de servicio en la lectura de los códigos de barras más populares, incluyendo UPC, EAN, ASCII, MSI/PLESSEY, GS1 DataBar y más. Fácil de implementar y de usar, el decodificador envía los datos hacia un aplicación activa en donde aparecen como si fueren tecleados directamente a la computadora. Su cable versátil conmutable USB a PS/2 se integra a la mayoría de las PC sin necesidad de conectarle una fuente de alimentación externa. Con una tasa de lectura de 500 por segundo y a una distancia máxima de 50 cm, este modelo ofrece una solución de lectura efectiva y eficiente para uso diario en los puntos de venta, oficinas y otros ambientes de poca iluminación para minimizar los errores en el ingreso de datos de manera veloz.', 446, 494, NULL, 0),
