INSERT INTO `tbl_productos` (`id`, `sku`, `nombre`, `price`, `status`, `catalog_visibility`, `quantity`, `length`, `width`, `height`, `short_description`, `id_marca`, `id_categoria`, `id_ficha`, `utilidad_Product`) VALUES
(7068, 'A0400HN', 'Adaptador de Corriente Apple MAGSA de 85 Vatios P/MACBOOK Pro Retina DE 85 VATIOS P/MACBK PRO RETINA 15', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'Descripción\nEl adaptador de corriente MagSafe de 85 vatios cuenta con un conector de CD magnético (corriente directa) que desconecta el cable de corriente en caso de experimentar alguna tensión excesiva, y también ayuda a evitar que los cables se deshilachen o se debiliten con el paso del tiempo. Además, el CD magnético ayuda al conector a encontrar su posición correcta, para lograr una conexión segura y rápida.\n\nCuando la conexión es segura, un indicador LED ubicado en la parte superior del conector de CD se encenderá; una luz ámbar te permite saber que la batería se está cargando, mientras que una luz verde indica carga completa. El adaptador incluye un cable de CA para aprovechar al máximo la extensión del cable, mientras que el adaptador de CA de pared (también proporcionado), presenta a los usuarios un modo incluso más simple y compacto de viajar.\n\nDiseñado para ser el compañero de viaje perfecto, el adaptador tiene un diseño ingenioso, que le permite al cable CD enrollarse sin problemas y así guardarlo fácilmente.\n\nEste adaptador de corriente recarga la batería de polímero de litio, mientras el sistema está apagado, encendido o en modo de descanso. También le brinda corriente al sistema si eliges operar sin una batería.\n\nCompatible con la MacBook Pro de 15 o 17 pulgadas.', 419, 511, NULL, 0),
(7069, 'A0400OA', 'Apple SuperDrive USB 2.0, DVD±R/RW, Plata SUPERDRIVE USB', 0, 'pending', 'hidden', 0, 0.18, 0.18, 0.18, 'El SuperDrive USB de Apple es compacto y conveniente: se conecta a tu MacBook Pro con pantalla Retina, MacBook Air o Mac mini con un solo cable USB que cabe fácilmente en un bolso de viaje. Te permite instalar software, ejecutar y grabar tanto CD como DVD, incluyendo DVD de doble capa. Todo lo que necesitas en un disco óptico. Si estás en la oficina o de viaje, puedes jugar y grabar CD y DVD con el SuperDrive USB de Apple. Es perfecto para cuando quieres ver una película en DVD, instalar software, crear discos con copias de seguridad y más. Llévalo a todas partes. El SuperDrive USB de Apple, un poco más grande que una caja de CD, cabe fácilmente en tu bolso cuando sales, y ocupa poco espacio en el escritorio o la mesita de comer mientras trabajas. La esencia de la sencillez. Con el SuperDrive USB de Apple nunca tendrás que preocuparte por perder cables. Se conecta a tu MacBook Pro con pantalla Retina, MacBook Air, o Mac mini con un simple cable USB integrado en el SuperDrive. El adaptador de corriente no está separado, y funciona sin importar si tu Mac está conectada o funcionando con la batería.', 419, 500, NULL, 0),
