(7072, 'A0400O8', 'Adaptador Apple  de Thunderbolt a Gigabit Ethernet, RJ-45, 10/100/1000Mbit/s GIGABIT ETHERNET', 0, 'pending', 'hidden', 0, 0.06, 0.06, 0.06, 'El adaptador de Thunderbolt a Gigabit Ethernet de Apple te permite conectarte fácilmente a una red Gigabit Ethernet de alto rendimiento. Pequeño y compacto, se conecta al puerto Thunderbolt en tu computadora Mac y cuenta con un puerto RJ-45 compatible con redes 10/100/1000BASE-T.\n\n', 419, 496, NULL, 0),
(7073, 'A0400O9', 'Adaptador de Corriente Apple MagSafe 2, 45W, para MacBook Air 2 DE 45 VATIOS DE APPLE P/MACBOOK A', 0, 'pending', 'hidden', 0, 0.12, 0.12, 0.12, 'Utiliza un adaptador adicional para tu casa o trabajo. El adaptador de corriente MagSafe 2 de 45 W de Apple está diseñado especialmente para tu MacBook Air. El cable de corriente se sujeta magnéticamente, de modo que si alguien se tropieza con él, el cable se desconecta sin causar daño, y tu notebook seguirá en su lugar. El adaptador de corriente MagSafe 2 de 45 W de Apple tiene un conector magnético de CD, de modo que si alguien se tropieza con él, el cable se desconecta sin causar daño, y tu MacBook Air seguirá en su lugar. También ayuda a evitar que los cables se deshilachen o se debiliten con el paso del tiempo. Además, la CD magnética ayuda al conector a encontrar su posición correcta, para lograr una conexión segura y rápida. Cuando la conexión es segura, un indicador LED ubicado en la parte superior del conector de CD se encenderá; una luz ámbar te permitirá saber que la batería se está cargando, mientras que una luz verde indicará carga completa. El adaptador incluye un cable de CA para aprovechar al máximo la extensión del cable, mientras que el adaptador de CA de pared (también incluido) le da a los usuarios un modo más simple y compacto de viajar. El adaptador fue diseñado para ser el compañero de viaje ideal. Tiene un diseño inteligente que permite que el cable de CD se enrolle con orden para guardarlo fácilmente. Este adaptador de corriente recarga la batería de polímero de litio mientras el sistema está apagado, encendido, o en modo reposo. También le brinda corriente al sistema, si escoges operar sin una batería. Compatible únicamente con la MacBook Air con entrada de corriente MagSafe 2.\n', 419, 511, NULL, 0),
