(7077, 'A0400V2', 'Adaptador De Corriente Apple MAGSA 2 De 60 W  P/MACBOOK Pro Retina 2 DE 60 W DE APPLE P/MACBK PRO RETI', 0, 'pending', 'hidden', 0, 0.12, 0.12, 0.12, 'Descripción\nEl adaptador de corriente MagSafe 2 de 60 W cuenta con un conector CD magnético, de modo que si alguien se tropieza con él, el cable se desconectará sin causar daño, y tu MacBook Pro seguirá en su lugar en forma segura. También ayuda a prevenir el desgaste y el debilitamiento de los cables con el tiempo. Además, el CD magnético ayuda al conector a encontrar su posición correcta, para lograr una conexión segura y rápida.\n\nEspecificaciones técnicas\nDescripción de la Alimentación\nAlimentación Salida de Altavoz	60W\nInformación Técnica\nDispositivo Compatible	Portátil\n\narios\nCompatibilidad	\nApple - Portátil Pantalla Retina MacBook Pro 13\"\n\nInformación General\nTipo de Producto	Adaptador CA\nCódigo de Fabricante	MD565E/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Adaptador de CA MagSafe\nLínea de Producto	MagSafe\nNombre de Marca	Apple\n', 419, 511, NULL, 0),
(7078, 'A04006G', 'Adaptador De Corriente Apple MAGSA De 60 Vatios para MACBOOK PRO 13 DE 60 VATIOS P/MACBOOK PRO 13', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'Descripción\nEl adaptador de corriente de 60 vatios MagSafe cuenta con un conector DC magnético que se asegura de desconectar el cable de corriente si experimenta alguna tensión excesiva, y también ayuda a evitar que se deshilachen o se debiliten los cables con el pasar del tiempo. Además, el CD magnético ayuda al conector a encontrar su posición correcta, para lograr una conexión segura y rápida.\n\nEspecificaciones técnicas\nInformación Técnica\nDispositivo Compatible	Portátil\nInformación General\nTipo de Producto	Adaptador CA\nCódigo de Fabricante	MC461E/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Adaptador de CA MagSafe\nLínea de Producto	MagSafe\nNombre de Marca	Apple\n\nVarios\nCompatibilidad	\nPortátiles de Apple:\n\nMacbook\nMacbook Pro\nDescripción de la Alimentación\nVoltaje de Entrada	220V AC\n110V AC\nFrecuencia	50Hz\n60Hz\nRango de Voltaje de Entrada	100V AC a 240V AC\nAlimentación Salida de Altavoz	60W', 419, 511, NULL, 0),
(7079, 'A0401H3', 'Apple Cable Thunderbolt Macho - Macho, 50cm, Blanco BLANCO', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'Descripción\nLa tecnología Thunderbolt permite transferencias de datos ultrarrápidas con dos canales independientes de 10 Gbps cada uno. Además, la tecnología Thunderbolt 2 puede unir los dos canales para lograr 20 Gbps superrápidos. Utiliza este cable para conectar dispositivos compatibles con Thunderbolt al puerto Thunderbolt o Thunderbolt 2 de tu Mac.\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Cable de transferencia de datos\nCódigo de Fabricante	MD862BE/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Marca	Apple\nInformación Técnica\nLongitud del Cable	50cm\nConductor	Cobre\nDispositivo Compatible	iMac\nMacBook Air\nMacBook Pro\nMac mini\nConector Uno	1 x Macho Thunderbolt\nConector Dos	1 x Macho Thunderbolt\nTipo de Cable	Thunderbolt', 419, 468, NULL, 0),
(7080, 'A04011M', 'Cable Thunderbolt Apple 2.0 Macho , 2 Metros, Blanco .', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'Descripción\nLa tecnología Thunderbolt soporta una transferencia de datos ultrarrápida, con dos canales independientes de hasta 10 Gbps cada uno. Utiliza el cable Thunderbolt de Apple para conectar tus periféricos equipados con Thunderbolt a tu iMac, Mac mini, MacBook Pro o MacBook Air.\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Cable de transferencia de datos\nCódigo de Fabricante	MD861BE/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Marca	Apple\nInformación Técnica\nLongitud del Cable	2m\nConductor	Cobre\nDispositivo Compatible	Mac mini\nMacBook Pro\niMac\nMacBook Air\nConector Uno	1 x Macho Thunderbolt\nConector Dos	1 x Macho Thunderbolt\nTipo de Cable	Thunderbolt\n', 419, 496, NULL, 0),
(7081, 'A04013C', 'Cable  Apple  USB A Macho - 30-pin Macho, Blanco, para iPod/iPhone/iPad .', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Este cable USB 2.0 conecta tu iPhone, iPad o iPod, directamente o mediante una base dock, al puerto USB de tu computadora para que puedas sincronizar y cargarlo de forma más eficiente, o al Adaptador de corriente USB de Apple para cargarlo desde un enchufe de pared. - Acceso a todos los controles y al conector para base dock; - Fabricación ajustable a la forma; - Se carga mientras está en la funda.\n', 419, 511, NULL, 0),
(7082, 'A0402CJ', 'Adaptador Multipuerto Apple USB-C - VGA, Blanco VGA', 0, 'pending', 'hidden', 0, 0.18, 0.18, 0.18, 'Descripción\nEl adaptador multipuerto de USB-C a VGA te permite conectar tu MacBook con puerto USB-C a una pantalla VGA, además de un dispositivo USB estándar y un cable de carga USB-C. El adaptador multipuerto de USB-C a VGA te permite reproducir la pantalla de tu MacBook en tu TV con VGA o pantalla HD de hasta 1080p. También reproduce contenidos como películas y videos. Simplemente conecta el adaptador al puerto USB-C de tu MacBook y luego a tu TV o proyector con un cable VGA (se vende por separado).\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Cable de Transferencia de Vídeo/Datos\nCódigo de Fabricante	MJ1L2AM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Marca	Apple\nInformación Técnica\nDispositivo Compatible	iPhone\nMacBook\nProyector\nTV\niPod\niPad\nConector Uno	1 x 24-clavijas Tipo C Macho USB\nConector Dos	1 x 24-clavijas Tipo C Hembra USB 3.1 USB\n1 x 9-clavijas Tipo A Hembra USB\n1 x 15 clavijas HD-15 Hembra VGA\nTipo de Cable	USB/VGA\nResolución Soportada	1920 x 1080', 419, 511, NULL, 0),
(7083, 'A0402CM', 'Cable  Apple USB C Macho - USB 3.1 Hembra, Blanco MACBOOK 12', 0, 'pending', 'hidden', 0, 0.18, 0.18, 0.18, 'Usa el adaptador de USB-C a USB para conectar tus dispositivos iOS y varios de tus accesorios USB estándar a una MacBook con puerto USB-C. Conecta el extremo USB-C del adaptador en el puerto USB-C de tu MacBook y luego conecta tu flash drive, cámara u otro dispositivo USB estándar. También puedes conectar un cable USB para sincronizar y cargar tu iPhone, iPad o iPod.\n\n', 419, 511, NULL, 0),
