(7085, 'A0402V1', 'Cable Apple USB 2.0 A Macho - Lightning, 50cm, Blanco BLANCO', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Descripción\nEste cable USB 2.0 conecta tu iPhone, iPad o iPod con conector Lightning al puerto USB de tu computadora para sincronizarlos y cargarlos. También puedes conectar tu dispositivo al adaptador de corriente USB de Apple para cargarlo desde una toma de corriente.\n\nEspecificaciones técnicas\nVarios\nCompatibilidad	\nApple - Modelos iPhone:\n\niPhone 5\niPhone 5c\niPhone 5S\niPhone 6\niPhone 6 Plus\nApple - iPad Modelos:\n\nIpad con pantalla Retina\niPad Mini\niPad Mini 2\niPad Air\niPad Air 2\niPad Mini 3\nApple iPod Modelos:\niPod nano 7G\niPod touch 5G 32GB/64GB\niPod touch 5G 16GB\n\nInformación Técnica\nLongitud del Cable	50cm\nDispositivo Compatible	iPod\niPhone\niPad\nConector Uno	1 x Iluminación Macho Conector Propio Original\nConector Dos	1 x Tipo A Macho USB 2.0 USB\nTipo de Cable	Lightning/USB\n\nInformación General\nTipo de Producto	Cable de transferencia de datos\nCódigo de Fabricante	ME291AM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Cable de transferencia de datos ME291AM/A\nNombre de Marca	Apple\n', 419, 511, NULL, 0),
(7086, 'A0402V3', 'Cable Apple Lightning - USB, 2 Metros, Blanco BLANCO', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Descripción\nEste cable USB 2.0 de 2 metros conecta tu iPhone, iPad o iPod con conector Lightning al puerto USB de tu computadora para sincronizarlos y cargarlos. También puedes conectar tu dispositivo al adaptador de corriente USB de Apple para cargarlo desde una toma de corriente.\n\nEspecificaciones técnicas\nVarios\nCompatibilidad	Apple:\niPhone 5\niPhone 5S\niPhone 5c\niPhone 6\niPhone 6 Plus\niPod Touch 5th\niPod nano 7th\nIpad con pantalla Retina\niPad Mini\niPad 4G\niPad Mini 3\niPad Mini 2\niPad Air 2\niPad Air\n\nInformación Técnica\nLongitud del Cable	2m\nDispositivo Compatible	iPod\niPad\niPhone\nConector Uno	1 x Iluminación Conector Propio Original\nConector Dos	1 x Tipo A Macho USB 2.0 USB\nTipo de Cable	Lightning/USB\n\nInformación General\nTipo de Producto	Cable de transferencia de datos\nCódigo de Fabricante	MD819AM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Cable de transferencia de datos MD819AM/A\nNombre de Marca	Apple\n', 419, 511, NULL, 0),
(7087, 'A0402ZU', 'Adaptador Apple Lightning Macho - VGA Hembra, Blanco A VGA', 0, 'pending', 'hidden', 0, 0.06, 0.06, 0.06, 'Descripción\nUsa el adaptador de Lightning a VGA con tu iPhone, iPad o iPod con conector Lightning. El adaptador de Lightning a VGA permite duplicar lo que aparece en la pantalla de tu dispositivo, como apps, presentaciones, sitios web, presentaciones de diapositivas y mucho más, en tu pantalla, proyector, TV con entrada VGA u otra pantalla compatible en HD de hasta 1080p.\n\nEspecificaciones técnicas\nInformación Técnica\nConector Uno	Iluminación Conector Propio Original\nConector Dos	15 clavijas HD-15 VGA\nResolución Máxima Soportada	1920 x 1080\nTipo de Adaptador	Proprietary/VGA\nInformación General\nTipo de Producto	Adaptador de vídeo\nCódigo de Fabricante	MD825AM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Adaptador de vídeo VGA/Propiedad\nNombre de Marca	Apple', 419, 511, NULL, 0),
(7088, 'A0403QI', 'Adaptador Apple  USB 3.0 Hembra - Lightning Macho, Blanco PARA CAMARA', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Con el Adaptador de conector Lightning a USB 3 para cámaras, descargar fotos y vídeos desde una cámara digital de alta resolución a tu iPad Pro es muy fácil. Conéctalo y el iPad Pro abrirá automáticamente la app Fotos para que elijas las imágenes y los vídeos que quieras importar y organizar en álbumes. Utiliza el Adaptador de conector Lightning a USB 3 para cámaras con un Adaptador de corriente USB si quieres que tu iPad Pro sea aún más versátil. Así puedes conectar periféricos USB como hubs, adaptadores de Ethernet, interfaces de audio/MIDI y lectores de tarjeta para CompactFlash, SD y microSD. El Adaptador de conector Lightning a USB 3 para cámaras admite formatos fotográficos estándar como JPEG y RAW, además de formatos de vídeo SD y HD como H.264 y MPEG-4. El iPad Pro de 12,9 pulgadas transmite datos por USB 3, mientras que el de 9,7 pulgadas utiliza USB 2.\n', 419, 494, NULL, 0),
(7089, 'A0403YB', 'Adaptador Apple Thunderbolt 3 Macho - Thunderbolt 2 Hembra, Blanco (USB-C) A THUNDERBOLT 2', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Descripción\nEl adaptador de Thunderbolt 3 (USB-C) a Thunderbolt 2 te permite conectar dispositivos con puertos Thunderbolt y Thunderbolt 2 -por ejemplo, discos duros externos y docks Thunderbolt- a cualquiera de los puertos Thunderbolt 3 (USB-C) de tu MacBook Pro.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nColor	Blanco\nInformación Técnica\nDispositivo Compatible	Disco Duro\nMacBook Pro\nConector Uno	1 x USB Tipo C Macho Thunderbolt 3\nConector Dos	1 x Hembra Thunderbolt 2\nTipo de Cable	Thunderbolt 2/Thunderbolt 3\n\nInformación General\nTipo de Producto	Cable de transferencia de datos\nCódigo de Fabricante	MMEL2AM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Cable de transferencia de datos MMEL2AM/A\nNombre de Marca	Apple\n\n', 419, 511, NULL, 0),
(7090, 'A040362', 'Lápiz Apple Digital Pencil para iPad Pro, Blanco PARA EL IPAD PRO', 0, 'pending', 'hidden', 0, 0.18, 0.18, 0.18, 'El Apple Pencil incrementa el poder del iPad Pro y abre posibilidades para nuevas creaciones. Es sensible a la presión y a la inclinación para que fácilmente puedas regular el grosor de la línea, crear sombras sutiles y producir una amplia variedad de efectos artísticos; como con un lápiz convencional, pero con una perfecta precisión de pixeles.\n\n', 419, 507, NULL, 0),
(7091, 'A0404AF', 'Audífonos Apple EarPods con Control Remoto, Alámbrico, 3.5mm, Blanco .', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Descripción\nA diferencia de los audífonos circulares tradicionales, el diseño de los EarPods está definido por la geometría del oído. Esto los hace más cómodos de usar que cualquier otro audífono similar.\n\nLas bocinas del interior de los EarPods han sido diseñadas para mejorar la calidad del sonido y minimizar su pérdida. ¿El resultado? Un audio de alta calidad.\n\nLos EarPods también incluyen un control remoto integrado que te permite ajustar el volumen, controlar la reproducción de música y videos, y responder o finalizar llamadas con sólo tocar el cable.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nFormato	Oído Externo\nInformación General\nTipo de Producto	Auricular\nCódigo de Fabricante	MNHF2AM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Auricular EarPods MNHF2AM/A\nLínea de Producto	EarPods\nNombre de Marca	Apple\n\n\nInterfaces/Puertos\nInterfaz de host	Mini-phone (3.5mm)\nMicrófono\nDiseño de micrófono	En Cable\nAuricular\nDiseño de auricular	Auricular\nTipo de auricular	Binaural\nInformación Técnica\nModo de sonido	Estéreo\nTecnología de Conectividad	Cableado', 419, 495, NULL, 0),
(7092, 'A0404EI', 'Teclado Magic Apple  Q052LZ/A, Bluetooth, Inalámbrico, Blanco (Inglés) NUMERICO INGLES', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Teclado Apple Magic - Inalámbrico Conectividad - Iluminación Interfaz - Inglés (EEUU) - QWERTY Diseño - Blanco - Tijeras Llave de contacto - Bluetooth - Mac OS, iOS\n', 419, 473, NULL, 0),
(7093, 'A0404E3', 'Teclado Magic Apple  MQ052E/A, Bluetooth, Blanco (Español) NUMERICO ESPANOL', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'El Magic Keyboard con teclado numérico tiene un diseño ampliado que incluye controles de navegación de documentos para desplazarte rápidamente y teclas de flecha de tamaño completo. El mecanismo de tijera debajo de cada tecla le da una mayor estabilidad, mientras que la pulsación optimizada y su estructura más baja brindan una experiencia de escritura cómoda y precisa. El teclado numérico también es ideal para hojas de cálculo y aplicaciones de finanzas. Además, la batería es increíblemente duradera y hará que tu teclado funcione durante un mes o más con una única carga.\n\n', 419, 473, NULL, 0),
