(7097, 'A04040E', 'Adaptador Apple De Lightning Macho - 3.5mm Hembra Audífonos 3.5MM PARA AUDIFONOS', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Descripción\nEste adaptador te permite conectar dispositivos que tienen un conector de audio de 3.5 mm a tus dispositivos con Lightning.\n\n\nCompatibilidad	\nDispositivo de Apple:\n\niPhone 5\niPhone 5c\niPhone 5S\nIPhone SE\niPhone 6\niPhone 6 Plus\niPhone 6S\niPhone 6S Plus\niPhone 7\niPhone 7 Plus\nIpad con pantalla Retina\niPad mini 2\niPad Air\niPad Air 2\niPad mini 3\niPad mini 4\niPad Pro (9,7\")\niPad Pro (12,9\")\niPod touch 6th G\n\nInformación Técnica\nDispositivo Compatible	Auricular\niPod\niPhone\niPad\nConector Uno	1 x 8-clavijas Iluminación Macho Conector Propio Original\nConector Dos	1 x Minifono Hembra Audio estéreo\nTipo de Cable	Lightning/Mini-phone\n\n\nInformación General\nTipo de Producto	Cable de audio\nCódigo de Fabricante	MMX62AM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Marca	Apple', 419, 511, NULL, 0),
