(7100, 'A0406SV', 'Auriculares Beats by Dr. Dre EP Cableado Sobre la cabeza Estéreo - Negro - Supra-aural - Cancelación de ruido - Mini-phone (3.5mm) NEGRO', 0, 'pending', 'hidden', 0, 0.18, 0.18, 0.18, 'Descripción\nLos audífonos en oído Beats EP ofrecen un sonido increíblemente optimizado. Su diseño sin batería ofrece reproducción ilimitada, y su estructura elegante y resistente está reforzada con acero inoxidable ligero. Beats EP es la opción perfecta para que los amantes de la música descubran Beats y vivan una experiencia de sonido dinámica.\n\n\nEspecificaciones técnicas\nInterfaces/Puertos\nInterfaz de host	Mini-phone (3.5mm)\nMicrófono\nDiseño de micrófono	En Cable\nInformación General\nTipo de Producto	Auriculares\nCódigo de Fabricante	ML992BE/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Auriculares EP\nLínea de Producto	EP\nNombre de Marca	Beats by Dr. Dre\n\nAuricular\nDiseño de auricular	Sobre la cabeza\nTipo de auricular	Binaural\nCaracterísticas Físicas\nPeso (Aproximado)	230g\nColor	Negro\nFormato	Supra-aural\nInformación Técnica\nModo de sonido	Estéreo\nTecnología de Conectividad	Cableado\nCancelación de ruido	Sí\n\n', 419, 495, NULL, 0),
(7101, 'A0406TE', 'Adaptador Apple  USB C Macho - HDMI/USB Hembra, Blanco A AV DIGITAL', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, 'El adaptador multipuerto AV digital USB-C le permite conectar su Mac o iPad Pro con USB-C a una pantalla HDMI, al mismo tiempo que conecta un dispositivo USB estándar y un cable de carga USB-C.\n\nEste adaptador le permite reflejar la pantalla de su Mac en su televisor o pantalla con HDMI.\n\n3840x2160 a 60Hz en:\n\niPad Pro de 11 pulgadas, iPad Pro de 12,9 pulgadas (3.a generación), MacBook Pro (15 pulgadas, 2017 y posteriores), iMac (Retina 5K, 27 pulgadas, 2017 y posteriores), iMac (Retina 4K, 21,5 pulgadas , 2017 y posteriores) e iMac Pro (2018)\n\n1080p a 60 Hz o UHD (3840 por 2160) a 30 Hz en:\n\nMacBook Pro (13 pulgadas, 2016 y posterior), MacBook Pro (15 pulgadas, 2016), iMac (sin Retina, 21,5 pulgadas, 2017) y Mac mini (2018)\n\nSimplemente conecte el adaptador a un puerto USB-C o Thunderbolt 3 (USB-C) en su Mac o iPad Pro y luego a su televisor o proyector mediante un cable HDMI (se vende por separado).\n\nUtilice el puerto USB estándar para conectar dispositivos como su unidad flash o cámara o un cable USB para sincronizar y cargar sus dispositivos iOS. También puede conectar un cable de carga al puerto USB-C para cargar su Mac o iPad Pro.', 419, 511, NULL, 0),
(7102, 'A04066P', ' Lápiz Digital Apple Pencil 2da Generación para iPad Pro, Blanco (SEGUNDA GENERACION)', 0, 'pending', 'hidden', 0, 0.21, 0.21, 0.21, 'El nuevo Apple Pencil tiene una precisión increíble y la latencia más baja de la industria. Es la herramienta ideal para dibujar, bocetar, colorear, tomar notas, hacer marcaciones en emails y más. Además, es tan fácil de usar como un lápiz común.\n\nEl nuevo Apple Pencil tiene una superficie táctil muy intuitiva que te permite cambiar de herramienta cuando tocas dos veces. Ahora puedes escribir y dibujar sin necesidad de soltarlo de tu mano.\n\nEstá especialmente diseñado para el iPad Pro de 11 pulgadas y el iPad Pro de 12.9 pulgadas (tercera generación), y viene con un borde plano que te permite conectarlo magnéticamente al dispositivo para enlazarlo y cargarlo automáticamente.', 419, 511, NULL, 0),
(7103, 'A0407AM', 'Adaptador de Corriente Apple  96W, Blanco 96 WATTS', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'El adaptador de corriente USB-C de 96 W te permite cargar tu dispositivo de manera rápida y eficiente en casa, en la oficina o donde estés. Aunque el adaptador de corriente es compatible con cualquier dispositivo que tenga USB-C, Apple recomienda usarlo con la MacBook Pro de 16 pulgadas para obtener una carga óptima.\n\n', 419, 511, NULL, 0),
