(7105, 'A0407EX', 'Smart Keyboard Apple  Folio para iPad Pro 11\", Negro 11  3A GENERACION ESP', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'El Smart Keyboard Folio para el iPad Pro de 11 pulgadas es un teclado completo cuando lo necesitas, una elegante funda que lo protege por ambos lados cuando no lo estás usando y te permite colocar el iPad Pro en dos ángulos de visión diferentes. Como no necesita cargarse ni enlazarse, sólo tienes que conectarlo para empezar a escribir.\n\n', 419, 473, NULL, 0),
(7106, 'A0407FG', 'Teclado Apple Magic Keyboard - 11\" - USB-C - para iPad Pro (2da Gen) 11 PULGADAS 2DA GENERACIóN ESP (MX)', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'El nuevo Magic Keyboard es el accesorio ideal para el iPad Pro: es lo más cómodo para escribir en un iPad. Además, el trackpad integrado expande las posibilidades de hacer cosas con iPadOS. El Magic Keyboard también trae un puerto USB-C y protege el iPad Pro por ambos lados. El Magic Keyboard se adhiere magnéticamente al iPad Pro en una estructura de diseño flotante donde puedes ajustar el ángulo de la pantalla fácilmente.\n\n', 419, 473, NULL, 0),
