(7112, 'A0407GI', 'Funda Apple Smart - Piel - Negro - Para iPad Pro 10.5\" 7A GEN - IPAD AIR 3A GEN NEGRO', 0, 'pending', 'hidden', 0, 0.19, 0.19, 0.19, 'Esta hermosa Smart Cover, hecha de cuero fino, protege la pantalla de su iPad Pro. Ábrelo y tu iPad Pro se activará. Ciérralo y se va a dormir. Disponible en una variedad de colores que combinan con sus otros accesorios de Apple.', 419, 511, NULL, 0),
(7113, 'A0407GK', 'Funda Apple Smart Keyboard MX3L2E/A, Negro, para iPad 10.5\" GENERACION - IPAD AIR 3A GEN', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'Descripción\nEl Smart Keyboard combina tecnologías avanzadas para crear un teclado único. Es un teclado ultraportátil de tamaño completo que se conecta al nuevo iPad y al iPad Air con el Smart Connector. Simplemente conéctalo y empieza a escribir. Cuando termines, pliégalo para convertirlo en una cubierta ligera y delgada.\n\nEspecificaciones técnicas\nInformación del Producto\nTamaño máximo de pantalla admitido	26.7cm (10.5\")\nInformación General\nTipo de Producto	Estuche de teclado/cubierta\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Estuche de teclado/cubierta Smart\nLínea de Producto	Smart\nNombre de Marca	Apple\n\nVarios\nAplicación/Uso	Tableta\nCompatibilidad	Apple - iPad Air (tercera generación), iPad (séptima generación) , iPad Pro\nMarca compatible	Apple\nModelo de tableta compatible	iPad Pro\niPad Air (3ra. generación)\niPad (7S generación)', 419, 473, NULL, 0),
(7114, 'A0407GM', 'Funda Apple Smart Cover para el iPad (7.ª generación) y el iPad Air (3.ª generación) - Negro 8A GEN - IPAD AIR 3A GEN NEGRO', 0, 'pending', 'hidden', 0, 0.19, 0.19, 0.19, 'Descripción\nLa funda Smart Cover está fabricada con una única pieza de poliuretano para proteger la parte delantera de tu iPad. También lo activa cuando la abres y lo pone en reposo cuando la cierras. Puedes plegar la Smart Cover en distintas posiciones y convertirla en el soporte perfecto para leer, escribir, ver películas o hacer llamadas con FaceTime. Y es tan fácil de quitar como de poner.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nMaterial	Poliuretano\nColor	Negro\nInformación General\nTipo de Producto	Funda\nCódigo de Fabricante	MX4U2ZM/A\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Funda Smart Cover\nLínea de Producto	Smart Cover\nNombre de Marca	Apple\n\nnformación del Producto\nTamaño mínimo de pantalla admitido	25.9cm (10.2\")\nTamaño máximo de pantalla admitido	26.7cm (10.5\")\nVarios\nAplicación/Uso	Tableta\nCompatibilidad	Apple - iPad Air (tercera generación), iPad (séptima generación), iPad Pro\nMarca compatible	Apple\nModelo de tableta compatible	iPad Pro\niPad Air (3ra. generación)\niPad (7S generación)\n', 419, 511, NULL, 0),
