(7116, 'A0407G3', 'Apple Mac mini MXNG2LZ/A, Intel Core i5 3GHz, 8GB, 512GB SSD (Marzo 2020) 8VA GEN TURBO BOOST HASTA 4 1G', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'Computadora de escritorio Apple Mac mini MXNG2LZ/A - Intel Core i5 8th Gen 3GHz - 8GB RAM DDR4 SDRAM - 512GB SSD - Mini PC - Gris - macOS Catalina - Intel UHD Graphics 630 - IEEE 802.11ac - 150W\n\nEl Mac mini es más que un excelente computador de escritorio. Está listo para cualquier desafío: desde la automatización de tu casa hasta el manejo de enormes granjas de renderización. Y con los procesadores Intel de octava generación de 4 y 6 núcleos e Intel UHD Graphics 630, tiene una capacidad de procesamiento aún mayor para las tareas más grandes. Ya sea para probar tu última app de iOS o iPadOS, o controlar el sonido de un concierto en vivo, el Mac mini es la mejor forma de pasar de una gran idea a un gran resultado.', 419, 492, NULL, 0),
(7117, 'A0407G4', 'Apple Watch Series 3 (GPS) con caja de 38 mm de aluminio en plata y correa deportiva blanca 38 MM CORREA DEPORTIVA BLANCA', 0, 'pending', 'hidden', 0, 0.32, 0.32, 0.32, 'Descripción\nApple presentó hoy el Apple Watch Series 3, incorporando conexión celular integrada al reloj número uno del mundo. Ya sea que los usuarios salgan a correr, o estén en la alberca, o solo traten de estar de estar más activos durante el día, el Apple Watch Series 3 con conexión celular les permite estar conectados, hacer llamadas, recibir textos y más, incluso sin la compañía de un iPhone cerca. La tercera generación de Apple Watch es una maravillosa compañía para la salud y el fitness con funciones inteligentes de coaching, resistencia al agua de hasta 50 metros1 y un nuevo altímetro barométrico que mide la elevación relativa. El Apple Watch Series 3 se presenta en dos modelos: uno con GPS y conexión celular, y el otro con GPS, ambos cuentan con un procesador de doble núcleo que es 70 por ciento más rápido y un nuevo chip inalámbrico de Apple.\n\nEspecificaciones técnicas\nInformación de Baterías\nDuración útil de Batería (máx.)	18Hora(s)\nMemoria\nMemoria Instalada	8GB\nPantalla y gráficos\nPantalla Táctil	Sí\nProcesador / Chipset\nNúcleo del Procesador	Dual-core (2 núcleos)\nSoftware\nSistema Operativo	watchOS 5\nRedes y Comunicaciones\nBluetooth	Sí\nLAN inalámbrica	Sí\nEstádar LAN sin Cable	IEEE 802.11b/g/n\nEstándar Bluetooth	Bluetooth 4.2\nGPS	Sí\nInformación Técnica\nFunciones	Reproductor de música\nMensajes de texto\nTipo de Sensor	Acelerómetro\nAltímetro\nSensor Gyro\nSensor óptico de pulso cardíaco\nBarómetro\nUbicación	Muñeca\nIndicadores corporales medidos	Pulso cardíaco\nCalidad de sueño\n\nInformación General\nTipo de Producto	Smart Watch\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Smart Watch Series 3 MTEY2CL/A\nLínea de Producto	Watch Series 3\nNombre de Marca	Apple\n\n\nAplicación/Uso	Salud & Ejercicio