(7126, 'A040741', 'Cable de alimentación Apple  1m  Para Adaptador de alimentación, iPad, iPhone, iMac, iPod, AirPod, MacBook - USB Tipo C / Iluminación .', 0, 'pending', 'hidden', 0, 0.07, 0.07, 0.07, 'Descripción\nConecta tu iPhone, iPad o iPod con conector Lightning a tu Mac con puerto USB-C o Thunderbolt 3 (USB-C) para sincronizarlos y cargarlos.\n\nTambién puedes usar este cable con tu adaptador de corriente USB-C de 29 W, 30 W, 61 W u 87 W de Apple para cargar tu dispositivo iOS, e incluso aprovechar la funcionalidad de carga rápida del iPhone 8, el iPhone 8 Plus, el iPhone X, el iPhone XS, el iPhone XS Max, el iPhone XR y algunos modelos del iPad Pro.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nLongitud de cable	1m\nInformación Técnica\nDispositivo Compatible	iMac\niPad\nMacBook\nAdaptador de alimentación\nAirPod\niPhone\niPod\nConector Uno	1 x USB Tipo C\nConector Dos	1 x Iluminación\n\nInformación General\nTipo de Producto	Cable de alimentación\nDirección Web de Fabricante	http://www.apple.com/mx/\nFabricante	Apple, Inc\nNombre de Producto	Cable de alimentación MX0K2AM/A\nNombre de Marca	Apple\n\nCompatibilidad	\nApple:\n\niPhone 11 Pro\niPhone 11 Pro Max\niPhone 11\niPhone XS\niPhone XS Max\niPhone XR\niPhone X\niPhone 8\niPhone 8 Plus\niPhone 7\niPhone 7 Plus\niPhone 6s\niPhone 6s Plus\niPhone 6\niPhone 6 Plus\nIPhone SE\niPhone 5S\niPhone 5c\niPhone 5\niPad Air (3ra. generación)\niPad mini (5ta. generación)\nPro 11\" de iPad\nPro 12,9\" (3ra generación) de iPad\niPad Pro 10.5\"\niPad (7S generación)\niPad (6thG)\niPad (5thG)\niPad Pro 12.9-inch (2G)\niPad Pro 12.9-inch (1G)\niPad Pro 9.7\"\niPad mini 4\niPad mini 3\niPad mini 2\niPad Mini (1G)\niPad Air 2\niPad Air (1G)\nMacbook (Retina, 12\" , Early 2015 - 2017)\nMacBook Air (Retina, 13\" , 2018)\nMacbook Pro (13\" , 2016)\nMacBook Pro (15\" , 2016 - 2019)\nMacBook Pro (16\" , 2019)\niMac (Retina 4K, 21,5 pulgadas, 2019)\niMac (Retina 4K, 21,5 pulgadas, 2017)\niMac (Retina 5K, 27 pulgadas, 20