(7268, 'A6400E7', 'Teclado numérico Targus 19 Teclas USB USB  HUB 2PTOS USB 2.0 WINDOWS/MAC', 0, 'pending', 'hidden', 0, 0.22, 0.22, 0.22, '\"El teclado numérico Targus con concentrador USB brinda comodidad para los usuarios móviles con su diseño delgado y compacto. Las teclas adicionales \"000\" y \"Back Space\" permiten una productividad mejorada y una escritura más eficiente. Las teclas cóncavas de tamaño completo están diseñadas para brindar comodidad y precisión, y requieren poca o ninguna curva de aprendizaje. Los dos puertos USB en la parte superior de este teclado proporcionan conectividad adicional para otros dispositivos como un mouse o una unidad flash. Este teclado de precio económico es perfecto para usar cuando se trabaja en hojas de cálculo, aplicaciones contables o financieras.\n', 456, 473, NULL, 0),
