(7273, 'A6400IX', 'Docking Station Targus DOCK310USZ - USB 3.1 - Ethernet - HDMI 3.1 TYPE-C DV4K 65W', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, 'Cree una estación de trabajo conveniente y productiva con la estación de acoplamiento universal USB-C DV4K con suministro de energía de 65 W. Elegante y potente, esta base incluye los puertos necesarios y la energía que necesita en una base. Diseñado para admitir una amplia variedad de marcas de computadoras portátiles y sistemas operativos, incluidos Windows, MacOS, Ubuntu, Android y Chrome.\n\nDisfrute de video 4K nítido y claro mientras admite una conexión de hasta dos monitores. Con dos puertos HDMI 2.0, puede admitir dos monitores (3840x2160 p60). Además, conecte todos sus accesorios favoritos con una combinación de USB-A (3 puertos USB 3.2 Gen 1 Tipo A) y USB-C (1x 3.2 Gen 1 Tipo C), además de puertos Ethernet y de audio.\n\nDiseñada para la estación de trabajo moderna, la base viene equipada con una provisión de montaje de soporte VESA, que permite el uso del soporte de montaje VESA de Targus (ACX003GLZ, se vende por separado) para sujetar la base detrás de la pantalla para ahorrar aún más espacio.\n\nAdmite dos monitores HDMI\n\nAcceda a la última tecnología de visualización con dos puertos HDMI 2.0 que crean una experiencia de visualización rica en ultra alta definición.\n\nUSB 3.2 integrado para carga y periféricos avanzados\n\nTres puertos USB 3.2 Gen 1 Tipo-A y 1 puerto USB 3.2 Gen 1 Tipo-C facilitan la adición de los últimos teclados, discos duros exteriores y otros periféricos para personalizar la experiencia del espacio de trabajo.\n\nDiseño innovador\n\nCompacta y elegante, esta base es perfecta para escritorios encogidos y espacios reducidos. La base también está equipada con una provisión de montaje de soporte VESA, que permite el uso del soporte de montaje VESA de Targus (ACX003GLZ, se vende por separado) para sujetar la base detrás de la pantalla para ahorrar aún más espacio.', 456, 467, NULL, 0),
