(7284, 'A64004P', 'Mochila Targus  Ascend de Nílon/Poliéster 16\' Negro (TSB710US) PARA LAPTOP NEGRO/GRIS TARGUS', 0, 'pending', 'hidden', 0, 0.36, 0.36, 0.36, '\"La mochila Asgus de 16 \"de Targus es perfecta para viajes, trabajo y escuela. Un amplio compartimento de almacenamiento cuenta con un compartimento acolchado para computadora portátil y espacio para documentos y archivos. Una espaciosa estación de trabajo, numerosos bolsillos para accesorios, bolsillos para botellas de agua y un panel trasero acolchado completo la mochila.\n', 456, 502, NULL, 0),
(7285, 'A640048', 'Targus Mochila Spruce EcoSmart de Poliester 17\' Negro/Verde (TBB019US) ECOSMART P/PUNTOS DE CONTROL  NEGRO', 0, 'pending', 'hidden', 0, 0.36, 0.36, 0.36, 'Mochila Backpack 17.0\" Spruce EcoSmart, Hecho de 100% poliéster reciclado PET y material libre de PVC, CheckPoint-Friendly para punto de control y detección de la TSA, Bolsillo dedicado para portatil o tableta, Asa superior para transporte suave y Correa para carro rodante, Color Negro\n\n\"Una combinación perfecta de estilo y almacenamiento, la mochila Spruce ? EcoSmart® Checkpoint-Friendly está diseñada para proteger las computadoras portátiles de pantalla ancha de hasta 15.6 \"de tamaño. Respetuosa con el medio ambiente, está construida con poliéster hecho de botellas de plástico recicladas y presenta níquel- hardware gratuito y componentes plásticos reciclables. Para guardar sus elementos esenciales, la mochila cuenta con un clip para llaves, un porta botellas de agua, un reproductor de MP3, un porta tarjetas de visita, bucles para bolígrafos y compartimentos para accesorios. Un bolsillo frontal de acceso rápido proporciona un lugar conveniente para guardar artículos mientras viaja. El panel trasero acolchado y la correa para el hombro ajustable permiten un ajuste personalizado y cómodo. Un colorido interior verde aligera el estuche, haciendo que los artículos almacenados en el interior sean más visibles. Elegante y deportivo,La línea Spruce ofrece una opción duradera con materiales cuidadosamente seleccionados para minimizar su huella de carbono. En el viaje de la botella a la bolsa, las botellas de agua de plástico primero se trituran en pequeños copos. Esos copos se vuelven a polimerizar en chips de plástico que luego se calientan y se hilan en hilo. Finalmente, ese hilo se cose y cose en la tela de nuestras bolsas EcoSmart. Mantenga su computadora portátil segura y protegida mientras viaja con nuestro diseño patentado compatible con puntos de control. Simplemente descomprima la bolsa, colóquela sobre la cinta transportadora y envíela directamente a través de la máquina de rayos X. Su computadora portátil permanece dentro de su bolsillo dedicado dentro de la mochila durante todo el control de seguridad, donde está a salvo de golpes, caídas, robos y de quedarse atrás en el punto de control de la TSA.\n\"', 456, 502, NULL, 0),
(7286, 'A64005R', 'Mochila Targus  de Poliester para Laptops 16\', Negro (TSB515US) LIGHT PARA PORTATILES  NEGRO TARGUS', 0, 'pending', 'hidden', 0, 0.33, 0.33, 0.33, '\"Obtenga protección esencial para la computadora portátil con la mochila UltraLight de 15.6 ?. Su compartimento dedicado para computadora portátil de carga lateral está equipado con una gran cantidad de relleno para ayudar a proteger su dispositivo. Hemos incorporado un compartimento secundario que es ideal para archivos, carpetas y accesorios más grandes. Pero eso no es donde termina su almacenamiento. Los accesorios más pequeños como auriculares, bolígrafos, cargadores de teléfonos inteligentes y tarjetas de visita se pueden almacenar en los dos bolsillos frontales de acceso rápido. La mochila también está hecha para la comodidad, con un panel posterior de malla de aire que promueve el flujo de aire y correas de hombro contorneadas que aseguran que el peso del peso de su mochila sobre sus hombros sea manejable. Sin embargo, más que eso, hemos diseñado esta mochila para que sea increíblemente liviana, sin escatimar en la protección de la computadora portátil.\"\n', 456, 502, NULL, 0),
