(7298, 'A8402D2', 'StarTech.com Docking Station DKT30CHVGPD USB-C, 1x USB-C 3.0, 1x USB 3.0, 1x HDMI, 1x RJ-45, 1x VGA, Gris HDMI VGA GBE WIN MAC CHROME', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Alcance la máxima productividad durante sus viajes de trabajo. Este adaptador multipuerto USB-C con HDMI y VGA es como tener cuatro adaptadores en uno solo, ya que le ofrece una configuración flexible de salida de video, un puerto USB 3.0 y un puerto Ethernet Gigabit, un cable oculto, además de potente carga y alimentación. Gracias al sencillo sistema de instalación plug-and-play disponible en la mayoría de los sistemas operativos, el adaptador USB-C no requiere software controlador. Es el accesorio ideal para su MacBook, Dell XPS, Chromebook u otra laptop equipada con USB-C. Conecte una pantalla HDMI 4K UHD o VGA El adaptador USB Type-C a HDMI y VGA le permite estar siempre preparado al viajar por trabajo. Extienda el espacio de la pantalla de su laptop conectándole una pantalla o proyector 4K HDMI (resolución 4096 x 2160 o 3840 x 2160) o VGA (1920 x 1200), para hacer presentaciones o configurar una estación de trabajo. Potente capacidad de carga de la laptop Compatible con 95W de entrega de potencia (PD) 3.0, el adaptador multipuerto USB Type-C ofrece hasta 85W para carga de la laptop, además de alimentación para sus dispositivo periférico cuando se conecta a un adaptador de alimentación por USB-C.PD 3.0 incluye la función FRS (\"Fast Role Swap\" , intercambio rápido de roles) para evitar la interrupción de transmisión de datos por USB al cambiar de fuentes de alimentación (adaptador de alimentación por USB-C a alimentación por bus). Práctica administración de cables Con varios puertos y cable oculto de fácil acceso, este adaptador USB-C todo en uno constituye el replicador de puertos ideal como accesorio al viajar. Además, obtiene su alimentación por bus, lo cual facilita la portabilidad. Potencie su productividad Este adaptador USB-C le permite agregar una unidad de memoria Flash, un mouse u otro dispositivo, mediante el puerto Type-A. Agregue conectividad por red con cable mediante el puerto Ethernet Gigabit. Producto avalado por la garantía de 3 años de StarTech.com y con soporte técnico gratuito de por vida.', 455, 511, NULL, 0),
(7299, 'B22000X', 'Switch Linksys Gigabit Ethernet SE3005, 5 Puertos - No Administrable NO ADMINISTRABLE', 0, 'pending', 'hidden', 0, 0.16, 0.16, 0.16, '\"Linksys SE3005 Switch de Red, 5 Puertos Control de flujo IEEE 802.3x dúplex completo y contrapresión semidúplex con detección de congestión inteligente basada en puerto y control de velocidad de transmisión\nTodos los puertos admiten detección automática de cables MDI / MDI-X\nArquitectura de bloqueo sin cabecera de línea\nQoS: Priorice las aplicaciones de video y audio para una mejor transmisión (IEEE 802.1p\nAhorro de energía: el modo avanzado de ahorro de energía detecta los puertos no utilizados\nPuertos de detección automática: ajuste para maximizar los flujos de datos de 10/100/1000 Mbps\"', 443, 467, NULL, 0),
(7300, 'B22001D', 'Router Linksys Gigabit Ethernet LRT224, Alámbrico, 5x RJ-45 WAN FIREWALL VLAN VPN ADM WEB', 0, 'pending', 'hidden', 0, 0.24, 0.24, 0.24, 'Linksys Router Gigabit 2 puertos WAN 4 Puertos Land soporta VPN sitio a sitio/ Cliente a sitio, hasta 5 Open VPN para usuarios IOS y Andriod , hasta 5 tuneles EasyLink VPN sitio a sitio, firewall integrado, balanceo de cargas, Failover y Stiky balance\n\nPANORAMA GENERAL\nLa serie LRT de Linksys integra firewall Gigabit, VPN de sitio a sitio y diversas tecnologías VPN de acceso remoto en un mismo dispositivo. Con dos modelos disponibles entre los que elegir, los routers VPN Gigabit de Linksys ofrecen un servicio de red seguro y fiable para sus empleados, tanto si están en la oficina como si están viajando.\nPuertos Gigabit Ethernet\nHasta 50 túneles IPsec (para VPN de sitio a sitio y de cliente a sitio) y cinco túneles VPN abiertos para los usuarios de iOS y Android\nRendimiento de firewall de 900 Mbps y de 110 Mbps IPsec\nEl modelo de WAN dual admite equilibrio de carga y conmutación por error WAN, para ofrecer una conectividad a internet fiable\n\nNombre de modelo:\nLinksys LRT224\nWAN dual:\nConmutación por error de enlace, equilibrio de carga\nProtocolo y enlace IP a un puerto WAN\nFirewall: SPI (Inspección de paquetes de datos)\nPrevención de DoS (Denegación del Servicio)\nReglas de acceso programadas (50)\nFiltrado de páginas web (bloqueo de URL y palabras clave)\nBloqueo de Java, cookies, ActiveX, servidores proxy http\nProxy IGMP\nUPnP\nVPN sitio a sitio:\n50 túneles sitio a sitio IPSec\nDivisión DNS sobre túnel sitio a sitio\nVPN de reserva para túnel sitio a sitio\nDPD (Dead Peer Detection)\nMantener activo\nNAT transversal\nAcesso remoto VPN:\nOpenVPN, PPTP, IPsec cliente a cliente\nCompatibilidad con cliente móvil OpenVPN (iOS, Android)\nNAT:\nModo puerta de enlace, modo router\nNAPT:\nNAT 1-a-1 (10)\nReenvío de puerto (30)\nDisparo de puerto (30)\nTraducción de la dirección de puerto (30)\nHost DMZ\nPuerto DMZ:\nAlcance DMZ, subred DMZ\nVLAN 802.1q:\n5 VLAN etiquetadas (compatibilidad con enrutado inter-VLAN, reglas de acceso de inter-VLAN)\nEl VLAN trunking permite una conexión a puntos de acceso (con múltiples SSID) y conmutadores adicionales inteligentes o administrados\nServidor DHCP:\nMúltiples grupos de direcciones (uno por subred VLAN)\nEnlace MAC y IP\nFiltrado MAC\nRetransmisión DHCP\nDNS:\nProxy DNS, base de datos local DNS\nGestión del ancho de banda:\nControl de tasa que permite la limitar del flujo de datos de subida y de bajada por servicio y IP\nEsquema de preferencias para permitir la aplicación de servicios a 3 niveles de priorización\nSupervisión/Notificación:\nSNMP, Syslog, correo electrónico\nConexión WAN:\nIP dinámica, PPPoE, PPTP, IP estática, puente transparente\nClonación de direcciones MAC\nDDNS:\nDynDNS, 3322\nEnrutamiento:\nEnrutamiento estático y dinámico (RIP 1, RIP2)\nIPv6:\nDHCPv6-PD, 6to4, anuncio de router\nMantenimiento:\nConfiguración, copia de seguridad, y restablecer\nConfiguraciones duales (inicio y espejo)\nActualización del firmware\nDiagnósticos (búsqueda de nombre de ping y DNS)\nReiniciar\nParámetros predeterminados de fábrica\nEstado y estadísticas:\nEstado de la conexión WAN\nEstado de túnel VPN/usuario\nEstado de puerto y estadísticas\nIndicadores LED\nSistema, DIAG, WAN, DMZ. VPN, LAN 1?4\nGestión de puertos:\n10/100/1000 Mbps, negociación automática, dúplex completo/medio\nIntuitivo y a través de página web Interfaz de administración:\nInternet Explorer, Firefox, Safari\nAsistente de la instalación\nGestión remota sobre HTTPS\nRendimiento:\nTasa de transferencia de VPN IPsec (Mbps)\n110\nMáxima tasa de transferencia NAT (Mbps)\n900\nMáximas conexiones simultáneas\n30.000\nDimensiones (L x A x A):\n191 x 130 x 40 mm\nPeso:\n722.2 gramos\nPuertos:\nUn puerto WAN RJ45 10/100/1000\nUn puerto DMZ RJ45 10/100/1000\nCuatro puertos LAN RJ45 10/100/1000\nOpenVPN para plataformas móviles (iOS, Android)\nBotón Reset (Reinic