(7317, 'B4000BP', 'Router TP-LINK Ethernet Firewall ARCHER C60, Inalámbrico, 867Mbit/s, 5x RJ-45, 2.4/5GHz, 5 Antenas Externas BPS Y 5GHZ/867MBPS  RED DE INVITADO', 0, 'pending', 'hidden', 0, 0.39, 0.39, 0.39, 'El Archer C60 incorpora el último estándar inalámbrico - 802.11ac. Este avanzado Wi-Fi está diseñado para actividades online de alto tráfico y llegando a conseguir que las aplicaciones funcionen al triple de velocidad que con el anterior estándar 802.11n. El resultado: Wi-Fi más rápido, más fuerte y más capaz de dar rienda a todos tus dispositivos inalámbricos.\n\nEspecificaciones técnicas\nRedes y Comunicaciones\nCompatibilidad con VPN	Sí\nTecnología Ethernet	Fast Ethernet\nCaracterísticas Físicas\nFormato	De Escritorio\nAltura	37mm\nAnchura	230mm\nProfundidad	144mm\nEspecificaciones del Sistema Inalámbrico\nTecnología de transmisión de banda ancha	Ethernet\nEstádar LAN sin Cable	IEEE 802.11ac\nBanda ISM	Sí\nBanda UNII	Sí\nFrecuencia máxima IGS	2.40GHz\nFrecuencia máxima UNII	5GHz\nNúmero de Antenas Externas	5\nInterfaces/Puertos\nUSB	No\nPuertos número de red (RJ-45)	4\nNúmero de banda ancha (RJ-45) Puertos	1\nPuerto PoE (RJ-45)	No\nInformación General\nTipo de Producto	Router inalámbrico\nCódigo de Fabricante	ARCHER C60\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	C60\nNombre de Producto	Router inalámbrico Archer C60\nLínea de Producto	Archer\nNombre de Marca	TP-Link', 458, 468, NULL, 0),
(7318, 'B4000BQ', 'TP-Link Antena Direccional CPE610, 23dBi, 5GHz DE 23DBI', 0, 'pending', 'hidden', 0, 0.09, 0.09, 0.09, 'Hasta 300 Mbps a velocidades de datos inalámbricas de 5 GHz\nAntena MIMO 2 × 2 direccional de alta ganancia de 23dBi y un reflector de metal dedicado, ideal para aplicaciones de larga distancia\nExcelente directividad del haz, latencia mejorada y cancelación de ruido\nLas innovadoras piezas de cierre a presión permiten un montaje rápido y un diseño estructural resistente mantiene estable el CPE610 incluso con vientos fuertes\nEl gabinete resistente a la intemperie IP65 duradero junto con 15 kV ESD y protección contra rayos de 6 kV asegura la idoneidad para todo clima\nLa tecnología TP-Link Pharos MAXtream TDMA mejora el rendimiento, la capacidad y el rendimiento de latencia\nPharos Control ofrece a los administradores un sistema de gestión centralizado y gratuito\nSoporta PoE pasivo para permitir una implementación flexible y una instalación conveniente\n2 × 2 MIMO\nMAXtream TDMA\nAntena direccional de 23dBi y estabilidad estructural profesional para transmisión Wi-Fi al aire libre de larga distancia.\n\nEstándar profesional 23dBi direccional\nAntena para transmisión inalámbrica de largo alcance\n\nCon antena Cassegrain MIMO 2 × 2 direccional de alta ganancia de 23dBi y reflector de metal dedicado, el CPE610 proporciona una excelente directividad de haz, latencia mejorada e inmunidad al ruido. El rendimiento profesional, junto con un diseño fácil de usar, hace que el CPE610 para exteriores de 5 GHz, 300 Mbps y 23 dBi, sea una opción ideal y una solución rentable para aplicaciones de redes inalámbricas al aire libre.\n\nDiseño estructural estable e instalación flexible\n\nLas piezas de bloqueo a presión hacen que el montaje sea simple y conveniente\nLos kits de montaje en poste y la libertad de alineación de tres ejes facilitan una instalación flexible\nEl diseño robusto garantiza la estabilidad en condiciones de viento\nCompacto y\nEmbalaje ligero\n\nCajas pequeñas y ligeras\nbeneficio del transporte marítimo, la logística y el comercio minorista.\n\nPharos Control - Sistema de gestión centralizado\n\nCPE610 viene equipado con el software de administración centralizada Pharos Control, que ayuda a los usuarios a administrar fácilmente todos los dispositivos en su red desde una sola PC. Las funciones incluyen la recuperación de dispositivos, la supervisión del estado, la actualización del firmware y el mantenimiento de la red. Una interfaz intuitiva basada en web, PharOS, proporciona un método de gestión alternativo y permite a los profesionales acceder a configuraciones más detalladas.', 458, 468, NULL, 0),
(7319, 'B4000BT', 'Switch TP-Link Gigabit Ethernet TL-SG1005P, 5 Puertos 10/100/1000, 10Gbit/s, 2000 Entradas - No Administrable GIGABIT CON 4 PUERTOS POE  SIN ADM', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'Cantidad de Puertos: 5\nPuertos RJ-45 Ethernet: Gigabit Ethernet (10/100/1000)\nCapacidad de conmutación: 10 Gbit/s\nTabla de direcciones MAC: 2000 entradas\nTipo de interruptor: No administrado\nEnergía sobre Ethernet (PoE): Sí', 458, 467, NULL, 0),
(7320, 'B4000BY', 'TP-Link Extensor de Rango AC750, 2.4/5GHz, 750Mbit/s, 1x RJ-45, 2 Antenas BANDA AC750', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, '¿Cansado de las \"zonas muertas\" de Wi-Fi? El extensor de cobertura RE205 extiende inalámbricamente el Wi-Fi de tu router, fortificando y extendiendo su señal en todos los rincones a los que no llega por si solo, mientras reduce las interferencias de señal para asegurar una cobertura Wi-Fi de confianza en tu vivienda u oficina.\n\nEspecificaciones técnicas\nInterfaces/Puertos\nTecnología Ethernet	Fast Ethernet\nPuertos número de red (RJ-45)	1\nInformación General\nTipo de Producto	Extensor de alcance inalámbrico\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	RE205\nNombre de Producto	Extensor de alcance inalámbrico AC750\nNombre de Marca	TP-Link\nCaracterísticas Físicas\nFormato	Montaje en pared\nAltura	77mm\nAnchura	78mm\nProfundidad	80mm\nInformación Técnica\nVelocidad de transmisión inalámbrica	750Mbit/s\nBanda de Frecuencia	5GHz\n2.40GHz\nEstádar LAN sin Cable	IEEE 802.11ac', 458, 468, NULL, 0),
(7321, 'B4000C0', 'Switch TP-Link Fast Ethernet TL-SF1005P, 5 Puertos 10/100Mbps, 1 Gbit/s, 2000 Entradas - No Administrable ETHERNET CON 4 PTOS POE  SIN ADMI', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Qué hace este producto\n\nTL-SF1005P es un conmutador no administrado de 5 puertos 10 / 100Mbps que no requiere configuración y proporciona 4 puertos PoE (Power over Ethernet). Puede detectar y suministrar energía automáticamente con todos los dispositivos alimentados (PD) que cumplen con IEEE 802.3af. En esta situación, la energía eléctrica se transmite junto con los datos en un solo cable lo que le permite expandir su red hacia donde no hay líneas eléctricas o enchufes, donde desea reparar dispositivos como AP, cámaras IP o teléfonos IP, etc.\n\nAlimentación a través de Ethernet\n\n4 de los 5 puertos RJ45 de negociación automática (puerto 1 a puerto 4) del conmutador admiten la función Power over Ethernet (PoE). Estos puertos PoE pueden detectar y suministrar energía automáticamente con los dispositivos alimentados (PD) que cumplen con IEEE 802.3af.\n\nDisposición de sobrecarga\n\nTL-SF1005P tiene la función de prioridad que ayudará a proteger el sistema cuando se sobrecarga la energía del sistema. Si el consumo de energía de todos los PD de PoE es> = 58 W, se organizará una prioridad entre los puertos PoE, luego el sistema cortará la energía del puerto de menor prioridad.\n\nFunción de prioridad de puerto\n\nPrioridad (puerto-1 = puerto-2 = puerto-3> puerto-4): esta función ayudará a garantizar el funcionamiento normal del sistema, lo que significa que el puerto 4 se cortará cuando todo el consumo de energía total de los PD de PoE supere los 58 W. Por ejemplo, los puertos 1, 2 y 4 utilizan 15,4 W (la potencia máxima por puerto es 15,4 W); la potencia del sistema es de 46,2 W en total. Si hay un PD adicional insertado en el puerto 3 con 12 W, y luego el sistema cortará la alimentación del puerto 4 debido a la sobrecarga de energía, esto significa que el puerto 1, 2 usará 15,4 W y el puerto 3 usará 12 W, sin energía se suministrará al puerto 4.\n\nFácil de usar\n\nTL-SF1005P es fácil de instalar y usar. No requiere configuración ni instalación. Con un diseño de escritorio, un rendimiento y una calidad excepcionales, el conmutador de escritorio TL-SF1005P de 5 puertos a 10 / 100Mbps de TP-Link con PoE de 4 puertos es una opción ideal para expandir la red de su hogar u oficina.\n\nEspecificaciones técnicas\nGestión y protocolos\nGestionable	No\nRedes y Comunicaciones\nCompatibilidad con nivel	2\nDescripción de la Alimentación\nFuente de Corriente	Adaptador CA\nFuente de alimentación redundante admitido	No\nFormato / Prestaciones\nTecnología de Red	10/100Base-T\nTecnología Ethernet	Fast Ethernet\nTipo de Medio Compatible	Par trenzado\nInterfaces/Puertos\nModular	No\nNúmero de Puertos Puerto de Vínculo Superior	No\nPuertos de Apilamiento	No\nNúmero Total de Puertos de Red	5\nDetalles de Ranura de Expansión/Puerto	5 x Fast Ethernet Network\nCaracterísticas Físicas\nFormato	De Escritorio\nAltura	25.4mm\nAnchura	99.1mm\nProfundidad	99.1mm\nInformación General\nTipo de Producto	Conmutador Ethernet\nCódigo de Fabricante	TL-SF1005P\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	TL-SF1005P\nNombre de Producto	Conmutador Ethernet TL-SF1005P\nNombre de Marca	TP-Link', 458, 467, NULL, 0),
(7322, 'B4000C1', 'Access Point TP-Link con Sistema de Red Wi-Fi en Malla EAP225-OUTDOOR, 1200 Mbit/s, 1x RJ-45, 2.4/5GHz MU-MIMO DE EXTERIOR/INTERIOR', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'Velocidades de Wi-Fi Gigabit con tecnología MU-MIMO\n\nEAP225-Outdoor admite una velocidad de banda dual simultánea de hasta 1200 Mbps. Equipado con la última tecnología 802.11ac Wave 2 MU-MIMO, EAP225-Outdoor puede comunicarse con varios clientes al mismo tiempo, lo que lo hace ideal para entornos de alta densidad.\n\nExcelentes diseños de hardware\n\nCon un diseño especial de su antena, apariencia, opciones de energía y métodos de instalación, EAP225-Outdoor puede adaptarse perfectamente a diferentes escenarios tanto en interiores como en exteriores.\n\nDespliegue flexible\n\nEAP225-Outdoor se puede instalar fácilmente en una pared o en un poste con los kits de montaje proporcionados.\n\nWi-Fi que recorre la distancia\n\nCon una alta potencia de transmisión y antenas omnidireccionales de alta ganancia, EAP225-Outdoor proporciona una cobertura inalámbrica estable en un rango de hasta 200m + a 2.4GHz y 300m + a 5GHz en entornos al aire libre.\n\nRecinto resistente a la intemperie especialmente diseñado para entornos al aire libre\n\nCon clasificación IP65 durante las pruebas de protección de ingreso, una carcasa resistente a la intemperie protege los puntos de acceso contra las duras condiciones exteriores.\n\nProtección contra rayos 4KV y protección ESD 15KV\nSin entrada de polvo\nRecinto a prueba de agua\n\nGestión de red centralizada eficiente\n\nCon el software Omada Controller, las pequeñas y medianas empresas pueden controlar cientos de puntos de acceso interiores y exteriores, todo desde una única ubicación. Es la gestión de la red como debería ser: eficiente e intuitiva.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nFormato	Montable en poste\nMontaje en pared\nAltura	27.9mm\nAnchura	215.9mm\nProfundidad	45.7mm\nInformación General\nTipo de Producto	Punto de acceso inalámbrico\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	EAP225-Outdoor\nNombre de Producto	Punto de acceso inalámbrico EAP225-Outdoor\nNombre de Marca	TP-Link\nInformación Técnica\nVelocidad de transmisión inalámbrica	1.17Gbit/s\nBanda de Frecuencia	2.40GHz\n5GHz\nEstádar LAN sin Cable	IEEE 802.11ac\nNúmero Total de Antenas	2\nNúmero de Antenas Internas	2\nTecnología MIMO	Sí\nTecnología de formación de haces direccionales	Sí\nInterfaces/Puertos\nTecnología Ethernet	Gigabit Ethernet\nUSB	No\nHDMI	No\nVGA	No\nPuertos número de red (RJ-45)	1\nLínea eléctrica	No\nPuerto de gestión	No\nPuerto PoE PD	Sí\n', 458, 468, NULL, 0),
(7323, 'B4000DV', 'Router TP-Link con Sistema de Red Wi-Fi en Malla AC1300 Deco M5, 1300 Mbit/s, 2.4/5GHz - 2 Piezas TODA LA CASA AC1300  (PAQUETE DE 2)', 0, 'pending', 'hidden', 0, 0.25, 0.25, 0.25, 'Vive la Vida Sin Interrupciones\nDeco es la solución Wi-Fi para todo el hogar con la seguridad más extensa. Ofrece unos resultados rápidos, Wi-Fi ininterrumpido para cada habitación sacando el máximo partido de los tres equipos separados del AC1300 de hasta 4,500 pies de cobertura total. Deco es también fácil de configurar y crece a medida que se añaden dispositivos a su hogar. Y Deco está respaldado por el soporte de por vida 24/7 de la industria.\n\nDeja que Deco Se Encargue de Configurar\nDeco es fácil de configurar. Simplemente descarga la aplicación y deja que Deco encuentre el lugar perfecto para la mejor cobertura.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nFormato	De Escritorio\nDiámetro	120mm\nAltura	38mm\nInterfaces/Puertos\nTecnología Ethernet	Gigabit Ethernet\nUSB	Sí\nHDMI	No\nVGA	No\nPuertos número de red (RJ-45)	2\nLínea eléctrica	No\nPuerto PoE (RJ-45)	No\nInformación General\nTipo de Producto	Punto de acceso inalámbrico\nDirección Web de Fabricante	http://www.tp-link.com\nCantidad de Unidades	2\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	Deco M5\nNombre de Producto	Punto de acceso inalámbrico DECO M5\nTipo de embalaje	Al por menor\nNombre de Marca	TP-Link\nInformación Técnica\nVelocidad de transmisión inalámbrica	1.27Gbit/s\nBanda de Frecuencia	2.40GHz\n5GHz\nEstádar LAN sin Cable	IEEE 802.11ac\nEstándar Bluetooth	Bluetooth 4.2\nNúmero Total de Antenas	4\nNúmero de Antenas Internas	4\nTecnología MIMO	Sí', 458, 468, NULL, 0),
(7324, 'B4000DW', 'Router TP-Link con Sistema de Red Wi-Fi en Malla AC1200 Deco M4, 867 Mbit/s, 2x RJ-45, 2.4/5GHz - 2 Piezas TODA LA CASA AC1200  (PAQUETE DE 2)', 0, 'pending', 'hidden', 0, 0.37, 0.37, 0.37, 'Asesino de zona muerta Wi-Fi\n\nDeco M4 es la forma más sencilla de garantizar una fuerte señal Wi-Fi en cada rincón de su hogar hasta 2800 pies cuadrados (paquete de 2). Las conexiones inalámbricas y el backhaul Ethernet opcional funcionan en conjunto para vincular las unidades Deco, proporcionando velocidades de red aún más rápidas y una cobertura verdaderamente perfecta.\n¿Quieres más cobertura? Simplemente agregue otra Deco.\n\nRoaming sin interrupciones con un nombre de Wi-Fi\n\nTP-Link Mesh significa que las unidades Deco trabajan juntas para formar una red unificada. Su teléfono o tableta se conecta automáticamente a la Deco más rápida a medida que se desplaza por su hogar, creando una experiencia Wi-Fi verdaderamente perfecta.\n\nNo más búfer\n\nLas velocidades de red tres veces más rápidas que los enrutadores de la generación anterior, gracias a la tecnología inalámbrica 802.11ac, hacen que Deco sea capaz de proporcionar una conexión sin demoras a hasta 100 dispositivos.\n\nMúltiples modos de enrutador, punto de acceso y extensor de rango 3 en 1\n\nFlexible y multifuncional, Deco M4 incluye una variedad de características que le permiten servir como enrutador, punto de acceso o extensor de rango. Simplemente elija el modo para sus demandas de red reales y experimente la máxima flexibilidad inalámbrica.\n\nEnrutador (predeterminado)\n\nGenere instantáneamente una red inalámbrica privada.\n\nPunto de acceso\nCree acceso a Wi-Fi para cualquier red cableada existente.\n\nExtensor de alcance\n\nAmplíe el alcance de Wi-Fi para eliminar las zonas muertas.\n\nWi-Fi hecho fácil\n\nConfiguración basada en aplicaciones\n\nLa instalación de Deco M4 es rápida y sencilla. Simplemente desempaquete el sistema, descargue la aplicación Deco y siga las instrucciones en pantalla.\n\nManejo sencillo\n\nAdministre su Wi-Fi en casa o fuera de ella en la aplicación Deco, lo que incluye ver los dispositivos conectados, priorizar sus dispositivos, configurar una red para invitados y más.', 458, 468, NULL, 0),
(7325, 'B4000DX', 'Punto de Acceso Inalámbrico TP-Link Deco DECO E4 - IEEE 802.11ac - 1.17Gbit/s - 2.40GHz, 5GHz - Tecnología MIMO - 2 x Red (RJ-45) - De Escritorio - 2 Paquete(s) CASA AC1200  (PAQUETE DE 2)', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, '', 458, 468, NULL, 0),
(7326, 'B4000DZ', 'Router TP-Link Gigabit Ethernet AC1200 ARCHER C6, Inalámbrico, 867Mbit/s, 5 Puertos RJ-45, Dual Band 2.4/5GHz, 4 Antenas Externas IMO DE BANDA DUAL AC1200', 0, 'pending', 'hidden', 0, 0.33, 0.33, 0.33, 'Entretenimiento fluido con Wi-Fi de doble banda AC1200\n\nEl Archer C6 crea una red confiable y ultrarrápida con tecnología Wi-Fi 802.11ac. La banda de 2.4GHz ofrece velocidades de hasta 300Mbps, lista para las tareas diarias como el correo electrónico y la navegación web, mientras que la banda de 5GHz ofrece velocidades de hasta 867Mbps, ideal para transmisión de video HD y juegos en línea sin demoras.\n\nCobertura Wi-Fi de 5 antenas de alto rendimiento en toda su casa\n\nCuatro antenas externas y una antena interna envían señales de Wi-Fi a todos los rincones de su hogar. Manténgase conectado y disfrute de una conexión Wi-Fi rápida, ya sea que esté descansando en el sofá o en el balcón. Con un potente chipset, el Archer C6 proporciona una cobertura Wi-Fi ideal. La cobertura de la banda de 2,4 GHz es especialmente impresionante, ya que elimina las zonas muertas de Wi-Fi y supera a la de otros enrutadores de la competencia.\n\nTambién es un punto de acceso\n\nCambie el modo de trabajo del Archer C6 al modo de punto de acceso para compartir su red cableada con otros dispositivos inalámbricos.\n\nLos asuntos MU-MIMO aumentan la velocidad, el rendimiento y la capacidad\n\nMU-MIMO permite que el Archer C6 sirva a varios dispositivos a la vez. No más congestión o latencia del ancho de banda. ¡Todos los dispositivos obtienen sus datos más rápido y el Wi-Fi se usa de manera más eficiente!\n\nConectividad Gigabit, 10 veces más rápida\n\nCon un puerto WAN Gigabit y cuatro puertos LAN Gigabit, las velocidades pueden ser hasta 10 veces más rápidas que las conexiones Ethernet estándar. ¡Conecte sus dispositivos con cable favoritos al Archer C6 y déjese impresionar!\n\nFácil configuración y administración con la aplicación Tether\n\nLa aplicación gratuita Tether está disponible para dispositivos Android e iOS, lo que facilita la configuración del Archer C6 y la administración de la configuración de red.', 458, 468, NULL, 0),
(7327, 'B4000D7', 'TP-Link Hub USB A 3.0 de 7 Puertos, 5000 Mbit/s, Negro 12V/2.5A ADAPTADOR DE ENERGIA INCL', 0, 'pending', 'hidden', 0, 0, 0, 0, 'Los puertos USB 3.0 ofrecen velocidades de transferencia de hasta 5 Gbps, 10 veces más rápido que el USB 2.0 estándar\nLos 7 puertos de transferencia de datos significan que no tiene que cambiar entre dispositivos\nHub USB 3.0 de 7 puertos\n\nUH700\n\nDiseñado para cargar rápidamente\n\nEl UH700 puede ofrecer una salida de hasta 5 V / 1,5 A que se carga un 50% más rápido y ahorra hasta un 30% en el tiempo de carga *. La carga completa de un Galaxy S6 edge toma solo 100 minutos con el concentrador USB UH700, mientras que toma 150 minutos con un concentrador USB que admita una salida de 5V / 1A. *\n\nEl tiempo de carga exacto puede variar y está sujeto a situaciones de carga reales.\nIncrementar la cantidad de puertos disponibles\n\nEl UH700 es perfecto para cualquier persona que tenga una computadora con solo uno o dos puertos USB y desee un acceso más fácil a puertos adicionales sin tener que cambiar entre dispositivos.\n\nMuchas computadoras portátiles tienen solo uno o dos puertos USB\nMuchas computadoras tienen puertos USB en lugares de difícil acceso\nProteja tanto sus dispositivos como sus datos valiosos\n\nEl UH700 tiene un diseño de circuito sofisticado con múltiples protecciones para sus dispositivos contra sobrecalentamiento, sobrecorriente, sobrevoltaje y cortocircuito. Un protector contra sobretensiones incorporado mantiene sus dispositivos y datos seguros en el proceso de transferencia de datos. El UH700 admite el intercambio en caliente de puertos USB que se pueden conectar y desconectar de forma segura mientras la computadora está encendida y en funcionamiento.\n\nDiseño considerado\n\nUn indicador LED blanco tenue en el botón de encendido ayuda a visualizar el estado de la conexión y, de manera similar, 7 indicadores LED blancos tenues más allá de cada puerto USB también indican si los dispositivos están conectados correctamente.', 458, 467, NULL, 0),
(7328, 'B4000EH', 'Router TP-Link con Sistema de Red Wi-Fi en Malla AC1200 Deco M4, 867 Mbit/s, 2x RJ-45, 2.4/5GHz - 3 Piezas TODA LA CASA AC1200  (PAQUETE DE 3)', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'Deco utiliza un sistema de torres para lograr una cobertura de Wi-Fi sin interrupciones en todo el hogar: ¡elimine las áreas de señal débil de una vez por todas!\nCon la avanzada tecnología Deco Mesh, las torres trabajan en conjunto para formar una red unificada con un solo nombre de red. Los dispositivos cambian automáticamente entre Decos a medida que se desplaza por su hogar para obtener las velocidades más rápidas posibles.\nUn paquete de dos Deco M4 ofrece Wi-Fi de gran conbertura. Y si eso no es suficiente, simplemente agregue más Decos a la red en cualquier momento para aumentar la cobertura.\nDeco M4 proporciona conexiones rápidas y estables con velocidades de hasta 1167 Mbps y funciona con los principales proveedores de servicios de Internet (ISP).\nDeco puede manejar el tráfico incluso desde las redes más ocupadas, proporcionando conexiones sin demora para hasta 100 dispositivos.\nEl control parental limita el tiempo en línea y bloquea los sitios web inapropiados de acuerdo con los perfiles únicos creados para cada miembro de la familia.\nLa configuración es más fácil que nunca con la aplicación Deco para guiarte en cada paso.', 458, 468, NULL, 0),
(7329, 'B4000EI', 'Router TP-Link con Sistema de Red Wi-Fi en Malla AC1200 Deco M4, 867 Mbit/s, 2x RJ-45, 2.4/5GHz - 1 Pieza TODA LA CASA AC1200  (PAQUETE DE 3)', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'Deco utiliza un sistema de torres para lograr una cobertura de Wi-Fi sin interrupciones en todo el hogar: ¡elimine las áreas de señal débil de una vez por todas!\nCon la avanzada tecnología Deco Mesh, las torres trabajan en conjunto para formar una red unificada con un solo nombre de red. Los dispositivos cambian automáticamente entre Decos a medida que se desplaza por su hogar para obtener las velocidades más rápidas posibles.\nUn paquete de dos Deco M4 ofrece Wi-Fi de gran conbertura. Y si eso no es suficiente, simplemente agregue más Decos a la red en cualquier momento para aumentar la cobertura.\nDeco M4 proporciona conexiones rápidas y estables con velocidades de hasta 1167 Mbps y funciona con los principales proveedores de servicios de Internet (ISP).\nDeco puede manejar el tráfico incluso desde las redes más ocupadas, proporcionando conexiones sin demora para hasta 100 dispositivos.\nEl control parental limita el tiempo en línea y bloquea los sitios web inapropiados de acuerdo con los perfiles únicos creados para cada miembro de la familia.\nLa configuración es más fácil que nunca con la aplicación Deco para guiarte en cada paso.', 458, 468, NULL, 0),
