(7338, 'B4000E0', 'TP-Link Adaptador de Red USB Archer T3U, Alámbrico, WLAN, 1267 Mbit/s, 2.4/5GHz AMBRICO MU-MIMO AC1300', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'AC1300 Mini adaptador USB inalámbrico MU-MIMO\nMáxima velocidad de Wi-Fi ? AC1300 (400 Mpbs en la banda de 2.4GHz y 867 Mbps en la banda de 5GHz) de velocidad inalámbrica con la próxima generación de Wi-Fi - 802.11ac\nDual Band Wireless ? 2.4GHz and 5GHz band for flexible connectivity\nMini design ?Mini-sized design for convenient portability with a reliable high performance\nSuper Speed USB 3.0 Port - Up to 10x faster transfer speeds than USB 2.0\nMU-MIMO - Delivers highly efficient wireless connection\nSupported Operating System ? Windows 10/8.1/8/7/XP, Mac OS X', 458, 468, NULL, 0),
(7339, 'B4000E1', 'TP-LINK Tarjeta de Red Archer T4E, 867Mbit/s, PCI Express, 2 Antenas CO DE BANDA DUAL AC1200', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'Adaptador Wi-Fi TP-Link Archer T4E - IEEE 802.11ac para Computadora de escritorio - PCI Express - 1.17Gbit / s - 2.40GHz ISM - 5GHz UNII - Interno\n\nArcher T4E de TP-LINK es compatible con el estándar Wi-Fi avanzado de IEEE 802.11ac, que ofrece velocidades de transferencia 3 veces superiores a las de IEEE 802.11n. Puede enviar correos electrónicos y navegar por la web con una red de 2.4GHz, mientras mantiene la veloz banda de 5GHz libre para juegos, transmisión de HD y otras aplicaciones de ancho de banda intensivo.', 458, 468, NULL, 0),
