(7344, 'B4000FM', 'Router TP-Link con Sistema de Red Wi-Fi en Malla AC1200 Deco E4, 867Mbit/s, 2.4/5GHz, 2 Antenas Internas TODA LA CASA AC1200  (PAQUETE DE 1)', 0, 'pending', 'hidden', 0, 0.23, 0.23, 0.23, 'Rápido. Estable. En todos lados.\n\nDeco es la forma más sencilla de garantizar una fuerte señal Wi-Fi en cada rincón de su hogar. Disfrute de conexiones rápidas y estables para un ejército de dispositivos en una cobertura para todo el hogar. La configuración es más fácil con la aplicación Deco que está allí para guiarlo en cada paso.\n\nAsesino de zona muerta Wi-Fi\n\nElimine las áreas de señal débil con Wi-Fi para toda la casa. No más buscar una conexión estable.\n\nNo más búfer\n\nEl Wi-Fi de doble banda AC1200 3 veces más rápido garantiza una experiencia de juego fluida y transmisión 4K con la tecnología 11ac Wave 2 MU-MIMO y proporciona conexiones sin demoras para hasta 100 dispositivos.\n\nTecnología de malla TP-Link\n\nLas unidades Deco trabajan juntas para formar una red Wi-Fi unificada con un solo SSID. Camine por su casa y manténgase conectado con las velocidades más rápidas posibles gracias a la cobertura perfecta de Deco y la tecnología de malla Plug-and-Play.\n\nControles parentales\n\nLimite el tiempo en línea y bloquee el contenido inapropiado de acuerdo con los perfiles únicos creados para cada miembro de la familia.', 458, 468, NULL, 0),
(7345, 'B4000FN', 'Router TP-Link con Sistema de Red Wi-Fi en Malla AC1200 Deco E4, 867Mbit/s, 2.4/5GHz, 2 Antenas Internas - 3 Piezas TODA LA CASA AC1200  (PAQUETE DE 3)', 0, 'pending', 'hidden', 0, 0.36, 0.36, 0.36, 'Rápido. Estable. En todos lados.\n\nDeco es la forma más sencilla de garantizar una fuerte señal Wi-Fi en cada rincón de su hogar. Disfrute de conexiones rápidas y estables para un ejército de dispositivos en una cobertura para todo el hogar. La configuración es más fácil con la aplicación Deco que está allí para guiarlo en cada paso.\n\nAsesino de zona muerta Wi-Fi\n\nElimine las áreas de señal débil con Wi-Fi para toda la casa. No más buscar una conexión estable.\n\nNo más búfer\n\nEl Wi-Fi de doble banda AC1200 3 veces más rápido garantiza una experiencia de juego fluida y transmisión 4K con la tecnología 11ac Wave 2 MU-MIMO y proporciona conexiones sin demoras para hasta 100 dispositivos.\n\nTecnología de malla TP-Link\n\nLas unidades Deco trabajan juntas para formar una red Wi-Fi unificada con un solo SSID. Camine por su casa y manténgase conectado con las velocidades más rápidas posibles gracias a la cobertura perfecta de Deco y la tecnología de malla Plug-and-Play.\n\nControles parentales\n\nLimite el tiempo en línea y bloquee el contenido inapropiado de acuerdo con los perfiles únicos creados para cada miembro de la familia.', 458, 468, NULL, 0),
(7346, 'B4000FR', 'Router TP-Link Archer AX6000, Inalámbrico, 4804 Mbit/s, 8x RJ-45, 2.4GHz/5GHz, 8 Antenas Externas de Alto Rendimiento LAN 1 PTO WAN 1 PTO USB-A Y USB-C', 0, 'pending', 'hidden', 0, 0.37, 0.37, 0.37, '\nMás rápido. Más amplio. Mayor capacidad.\n\nEl Archer AX6000 es el primer enrutador de TP-Link con Wi-Fi 6, basado en la tecnología Wi-Fi 802.11ax de próxima generación. Lleve su Wi-Fi al siguiente nivel mientras es compatible con versiones anteriores de los estándares Wi-Fi 802.11a / b / g / n / ac.\n\nHomecare ? para una protección integral contra amenazas en el hogar\n\nDefienda su sistema de amenazas maliciosas que pueden infiltrarse a través de descargas y uso compartido de archivos. TP-Link HomeCareTM, con tecnología Trend MicroTM, protege todos los dispositivos de las últimas amenazas cibernéticas con una potente seguridad, antivirus incorporado y prevención de intrusiones de vanguardia, creando de manera integral un entorno doméstico inteligente altamente protegido.\n\nRendimiento 4 veces superior\n\nLos nuevos MU-MIMO y OFDMA de enlace descendente y ascendente logran un aumento de rendimiento 4 veces superior al de 802.11ac\n\nCapacidad 4 veces mayor\n\nOFDMA aumenta en gran medida la cantidad de dispositivos conectados al asignar canales a más dispositivos simultáneamente\n\nVelocidad 3 veces más rápida\n\n1024 QAM y Long OFDM Symbol aumentan las velocidades generales hasta unos increíbles 6000 Mbps\n\nCobertura mejorada\n\nLa tecnología Beamforming y RangeBoost proporciona conexiones más fuertes y confiables\n\nEspecificaciones técnicas\nInterfaces/Puertos\nUSB	Sí\nPuertos número de red (RJ-45)	8\nNúmero de banda ancha (RJ-45) Puertos	1\nRedes y Comunicaciones\nCompatibilidad con VPN	Sí\nTecnología Ethernet	2.5 Gigabit Ethernet\nMulti-SIM Soportada	No\nEspecificaciones del Sistema Inalámbrico\nTecnología de transmisión de banda ancha	Ethernet\nEstádar LAN sin Cable	IEEE 802.11ax\nBanda ISM	Sí\nBanda UNII	Sí\nFrecuencia máxima IGS	2.40GHz\nFrecuencia máxima UNII	5GHz\nCaracterísticas Físicas\nFormato	De Escritorio\nAltura	61mm\nAnchura	261.6mm\nProfundidad	261.6mm\nInformación General\nTipo de Producto	Router inalámbrico\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	AX6000\nNombre de Producto	Router inalámbrico Archer AX6000\nLínea de Producto	Archer\nNombre de Marca	TP-Link', 458, 468, NULL, 0),
(7347, 'B4000FS', 'ROUTER GIGABIT WI-FI 6 3000MBPS  4 PTS LAN 1 PTO WAN 1 PTO USB-A 3.', 0, 'pending', 'hidden', 0, 0.33, 0.33, 0.33, '', 458, 468, NULL, 0),
(7348, 'B4000FU', 'Router TP-Link AX1500 Archer AX10, Inalámbrico, 1500 Mbit/s, 4x RJ-45, 2.4/5GHz, con 4 Antenas Externa ? ¡Optimizado para Gaming!  4 PTS LAN 1 PTO WAN', 0, 'pending', 'hidden', 0, 0.33, 0.33, 0.33, '\nWi-Fi 6 con CPU de triple núcleo\nRendimiento estable de próxima generación\n\nWi-Fi avanzado y revolucionario 6\n\nWi-Fi 6 ofrece un gran impulso en velocidad y capacidad total. Aproveche la última tecnología Wi-Fi para eliminar todos los molestos temblores y ralentizaciones, y disfrute de la red del futuro que se carga más rápido y se conecta más.\n\nVelocidad más allá de Gigabit\n\nEl último 1024-QAM y la velocidad de símbolo más alta se combinan para aumentar las velocidades de los dispositivos más nuevos al nivel de Gigabit. Conéctese a una red Wi-Fi de 1 Gbps con su teléfono o computadora portátil y disfrute de velocidades comparables a las de conectar un cable Ethernet.\n\nConecte docenas de dispositivos\n\nAgregue más dispositivos Wi-Fi sin reducir el rendimiento. OFDMA permite que varios dispositivos utilicen una sola banda al mismo tiempo, lo que permite que su Wi-Fi soporte más dispositivos en comparación con el mismo nivel de velocidad del enrutador Wi-Fi 5.\n\nMenos retraso, más diversión\n\nWi-Fi 6 transmite datos de manera eficiente, lo que permite que los paquetes de datos para diferentes aplicaciones compartan una transmisión y reduzcan la latencia. Disfrute de chats de audio y video impecables, mejores velocidades de juego y carga de video instantánea en diferentes dispositivos, todo al mismo tiempo.\n\nProcesador de tres núcleos\n\nRespuesta instantánea a cada clic\n\nUna CPU de triple núcleo de 1,5 GHz proporciona una potencia abrumadora para hacer frente a grandes cantidades de transferencia de datos, minimizando la latencia dentro de su red. Disfrute de una respuesta instantánea cuando haga clic en el botón de reproducción para la reproducción en línea y obtenga una mejor calidad para el chat de video en línea.\n\nCobertura Wi-Fi mejorada\n\nLa tecnología Beamforming y 4 antenas de alta ganancia se combinan para generar una señal Wi-Fi fuerte y confiable en toda su casa, brindando conexiones fluidas y estables para cada cliente.\n\nAcceso a Internet de banda ancha Gigabit\n\nTodos los puertos Gigabit Ethernet le permiten aprovechar al máximo la velocidad de su banda ancha hasta 1 Gbps. Conecte sus PC, televisores inteligentes y consolas de juegos en uno de los cuatro puertos LAN Gigabit Ethernet para conexiones por cable rápidas y confiables.\n\nFácil instalación y uso\n\nYa sea que prefiera la intuitiva aplicación Tether o la potente interfaz web, puede configurar su Archer AX10 en minutos. La aplicación Tether le permite administrar la configuración de red, incluidos los controles parentales y las preferencias de uso compartido de medios, desde cualquier dispositivo Android o iOS.\n\nListo para el hogar inteligente de hoy y del mañana\n\nCon el creciente número de dispositivos en el hogar de hoy, todos merecen una forma más inteligente y fácil de reunir todos sus productos. Utilice Amazon Alexa para controlar todo a través de comandos de voz para disfrutar de una vida verdaderamente inteligente.\n\n\nEspecificaciones técnicas\nInterfaces/Puertos\nPuertos número de red (RJ-45)	4\nNúmero de banda ancha (RJ-45) Puertos	1\nRedes y Comunicaciones\nTecnología Ethernet	Gigabit Ethernet\nMulti-SIM Soportada	No\nEspecificaciones del Sistema Inalámbrico\nTecnología de transmisión de banda ancha	Ethernet\nEstádar LAN sin Cable	IEEE 802.11ax\nBanda ISM	Sí\nBanda UNII	Sí\nFrecuencia máxima IGS	2.40GHz\nFrecuencia máxima UNII	5GHz\nNúmero de Antenas Externas	4\nCaracterísticas Físicas\nAltura	38.1mm\nAnchura	259.1mm\nProfundidad	134.6mm\nInformación General\nTipo de Producto	Router inalámbrico\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	AX10\nNombre de Producto	Router inalámbrico Archer AX10\nLínea de Producto	Archer\nNombre de Marca	TP-Link', 458, 468, NULL, 0),
