(7367, 'B4000HB', 'Access Point TP-Link EAP265 HD, 1750 Mbit/s, 2x RJ-45, 2.4/5GHz, 3 Antenas Internas de 4dBi DE MONTAJE EN TECHO MU-MIMO GIGABIT', 0, 'pending', 'hidden', 0, 0.34, 0.34, 0.34, 'Solución WiFi profesional AC1750 para entornos de alta densidad\n\nPunto de acceso de montaje en techo Gigabit MU-MIMO inalámbrico AC1750\n\nOmada EAP265 HD\n\nConecte más dispositivos en entornos densos\n\nCon un rendimiento de clase empresarial, EAP265 HD está diseñado para cumplir el desafiante objetivo de aumentar la capacidad hasta 3 veces en entornos densos en comparación con el EAP AC estándar sin capacidad de alta densidad. MU-MIMO y las antenas profesionales ayudan a brindar WiFi confiable a más dispositivos simultáneamente, aprovechando la experiencia de múltiples usuarios como nunca antes.\n\nVelocidades de banda dual premium con cobertura de largo alcance\n\nCompatible con la tecnología 802.11ac Wave2, EAP265 HD proporciona velocidades de Wi-Fi mejoradas de hasta 1750 Mbps para más dispositivos en entornos de alta densidad. Las antenas dedicadas de alta potencia con Beamforming garantizan una cobertura de largo alcance en las bandas de 2,4 GHz y 5 GHz. Las tecnologías inalámbricas avanzadas como Load Balance, Band Steering y Airtime Fairness optimizan el rendimiento de toda la red y mejoran la eficiencia.\n\nRoaming sin interrupciones\n\nEl roaming 802.11k / v cambia a los clientes automáticamente al AP con la señal óptima con una transición perfecta al moverse. Esto permite que las aplicaciones sensibles como VoIP y videoconferencias no se interrumpan.\n\nSolución en la nube Omada SDN-Smarter para redes empresariales\n\nLa plataforma Omada Software Defined Networking (SDN) integra dispositivos de red que incluyen puntos de acceso, conmutadores y puertas de enlace, lo que garantiza una red comercial potente con mayor eficiencia, mayor seguridad y mayor confiabilidad.\n\nGestión en la nube centralizada sin complicaciones:\n\nGestión en la nube 100% centralizada de toda la red desde diferentes sitios, todo controlado desde una única interfaz en cualquier lugar y en cualquier momento.\n\nRed de invitados segura con Facebook Wi-Fi e inicio de sesión por SMS\n\nGuest Network proporciona un acceso elevado y seguro a los invitados que comparten su red Wi-Fi, con un portal cautivo que ayuda a mantener solo a los invitados autorizados para usar la red. La adición de autenticación por SMS y Facebook simplifica aún más el portal cautivo para simplificar la conectividad y potenciar su negocio.\n\nVarias opciones de PoE para una fácil instalación\n\nEAP265 HD admite fuentes de alimentación PoE 802.3af y PoE pasivo, puede ser alimentado por un interruptor PoE o el adaptador PoE provisto. La adición de una apariencia elegante y un diseño de montaje simple para una fácil fijación a una pared o techo hace que el despliegue sea más fácil y flexible.\n\nFácil gestión con la aplicación Omada\n\nSiga las instrucciones de configuración de la aplicación gratuita Omada para configurarla en minutos. Omada le permite configurar ajustes, monitorear el estado de la red y administrar clientes, todo desde la comodidad de un teléfono inteligente o tableta.\n\nEspecificaciones técnicas\nDescripción de la Alimentación\nConsumo Energético	12.30W\nInterfaces/Puertos\nTecnología Ethernet	Gigabit Ethernet\nPuertos número de red (RJ-45)	2\nPuerto PoE PD	Sí\nInformación Técnica\nVelocidad de transmisión inalámbrica	1.71Gbit/s\nBanda de Frecuencia	2.40GHz\n5GHz\nEstádar LAN sin Cable	IEEE 802.11ac\nEstándar de codificación	WPA2-ENT\nWPA-PSK\nWPA2-PSK\nWPA\nEncriptación de datos	Sí\nTecnología MIMO	Sí\nTecnología de formación de haces direccionales	Sí\nCaracterísticas Físicas\nFormato	Montable en techo\nMontaje en pared\nAltura	38.1mm\nAnchura	205.7mm\nProfundidad	180.3mm\nInformación General\nTipo de Producto	Punto de acceso inalámbrico\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	EAP265 HD\nNom