(7369, 'B4000H0', 'TP-LINK Adaptador de Red USB ARCHER T3U PLUS, Inalámbrico, WLAN, 867Mbit/s, 1 Antena BAND USB ADAPTER', 0, 'pending', 'hidden', 0, 0.21, 0.21, 0.21, 'Adaptador Wi-Fi TP-Link Archer T3U Plus - IEEE 802.11ac para Computadora de escritorio/Notebook - USB 3.0 - 1.27Gbit/s - 2.40GHz ISM - 5GHz UNII - Externo\n\nEl Archer T3U Plus recibe las señales Wi-Fi en dos bandas separadas para todas tus necesidades online. Elige la banda de 2.4 GHz para una navegación de hasta 400 Mbps, envío de correos y redes sociales o cambia a 5 GHz para lograr hasta 867 Mbps y asi jugar en red, para transmisiones HD y descarga de grandes archivos.', 458, 468, NULL, 0),
