(7371, 'B4000H6', 'Router TP-Link TL-WR845N, Inalámbrico, 300 Mbit/s, 5x RJ-45, 2.4GHz, con 3 Antenas Externas de 5dBi .', 0, 'pending', 'hidden', 0, 0.36, 0.36, 0.36, 'Speedy Wireless N300\n\nEl TL-WR845N proporciona Wi-Fi rápido y estable para los dispositivos que necesita su red. La velocidad inalámbrica de hasta 300 Mbps lo convierte en una solución práctica para aplicaciones de red doméstica como descarga de archivos, video chat o transmisión en línea.\n\nMayor cobertura y confiabilidad mejorada\n\nTres antenas de alta ganancia de 5dBi perfectas para casas pequeñas y medianas, una mejor cobertura le permite nunca perder conexiones y disfrutar de una conexión más estable.\n\nApariencia delicada\n\nEl nuevo diseño con textura elegante lo convierte en un complemento elegante para la decoración de cualquier habitación de su hogar.\n\nAcceso a la red de invitados\n\nLa función Guest Network proporciona acceso seguro para que los invitados compartan su red Wi-Fi. Fácil de compartir, no se preocupe por su red privada.\n\nControl parental sencillo\n\nParent Control permite a los padres o administradores implementar acceso restringido para los niños o el personal. Con el bloqueo de URL, puede configurar fácilmente una lista blanca o negra para limitar el nivel de acceso a la web\n\nFácil configuración y administración\n\nConfigure el TL-WR845N en minutos gracias a su interfaz web intuitiva y la poderosa aplicación Tether. La aplicación TP-Link Tether proporciona la forma más fácil de acceder y administrar su enrutador en su teléfono inteligente, le permite comenzar a disfrutar de su nuevo dispositivo más rápido. que nunca!', 458, 468, NULL, 0),
(7372, 'B4000H7', 'Access Point TP-Link TL-WA901N, 450 Mbit/s, 1x RJ-45, 2.4GHz, 3 Antenas Integradas 450MBPS', 0, 'pending', 'hidden', 0, 0.37, 0.37, 0.37, 'Qué hace este producto\n\nEl punto de acceso inalámbrico N de TP-LINK TL-WA901N está diseñado para establecer o expandir una red N inalámbrica escalable de alta velocidad o para conectar un dispositivo habilitado para Ethernet, como una consola de juegos, un adaptador de medios digitales, una impresora o un almacenamiento conectado a la red. dispositivo a una red inalámbrica. El AP admite una serie de funciones diferentes que hacen que su experiencia de red inalámbrica sea más flexible que nunca. Ahora, puede disfrutar de una mejor experiencia en Internet al descargar, jugar, transmitir video o cualquier otra aplicación que desee utilizar.\n\nRango y velocidad inalámbrica N\n\nAdoptando la tecnología IEEE 802.11n avanzada MIMO (Multi Input Multi Output), funciona simultáneamente a través de tres antenas con tecnología de antena inteligente para Tx y Rx para superar la interferencia y la degradación de la señal al viajar largas distancias o atravesar barreras físicas en una oficina pequeña o grande. apartamento, lo que resulta en una mejora increíble en el rendimiento inalámbrico, incluso en un edificio de acero y hormigón. Sobre todo, ¡podría captar fácilmente la red inalámbrica durante una conexión de larga distancia donde los productos antiguos de 11g podrían no hacerlo!\n\nMúltiples modos de funcionamiento: WLAN fácil de construir\n\nAdmite los modos de operación Cliente, Multi-SSID, Range Extender y AP para habilitar varias aplicaciones inalámbricas para brindar a los usuarios una experiencia más dinámica y completa al usar su AP. El modo de funcionamiento múltiple también lo ayuda a construir fácilmente una red inalámbrica para ubicaciones difíciles de cablear o eliminar la zona muerta inalámbrica.\n\nCompatible con PoE pasivo: implementación más flexible\n\nEl TL-WA901N puede alimentarse mediante un cable Ethernet para enviar simultáneamente datos y electricidad a cualquier lugar donde se encuentre su AP, incluso a una distancia de hasta 100 pies. Esta característica multiplica sus opciones permitiéndole colocar el AP en una posición que sea más conveniente para obtener la mejor señal posible, como en la pared o en el techo de su oficina.', 458, 468, NULL, 0),
