(7377, 'B400002', 'Router TP-Link Gigabit de Banda Dual AC1750 ARCHER C7, Inalámbrico, 1300Mbit/s, 5x RJ-45, 2.4/5GHz, con 3 Antenas Internas y 3 Antenas Desmontables de 5dBi DOBLE BANDA AC1750', 0, 'pending', 'hidden', 0, 0.24, 0.24, 0.24, 'Archer C7 de TP-LINK viene con el estándar WiFi de la próxima generación - 802.11ac, 3 veces más rápido que las velocidades inalámbricas N y ofrece una velocidad de transferencia de datos inalámbrica combinada de hasta 1.75Gbps. Con velocidades inalámbricas de 1.3Gbps a través de la banda nítida de 5GHz y 450Mbps a través de la banda de 2.4GHz, Archer C7 es la opción superior para el streaming en HD sin contratiempos, juegos en línea y otras tareas que utilizan bastante banda ancha.\n\n Especificaciones técnicas\nGestión y protocolos\nGestión	\nDHCP\nGestión remota\nDescripción de la Alimentación\nVoltaje de Entrada	12V DC\nFuente de Corriente	Adaptador CA\nRedes y Comunicaciones\nCompatibilidad con VPN	Sí\nTecnología de Red	10/100/1000Base-T\nTecnología Ethernet	Gigabit Ethernet\nVarios\nContenido de la Caja	\nRouter Inalámbrico Gigabit Dual Band AC1750\n3 x Antenas desmontables\nFuente de alimentación Unidad\nCD de Recursos\nCable Ethernet\nGuía de inicio rápido\nCertificaciones y Estandáres	\nCE\nFCC\nRequerimientos del Sistema	\nSistemas Operativos:\n\nWindows 98SE\nWindows NT\nWindows 2000\nWindows XP\nWindows Vista\nWindows 7\nWindows 8\nMAC OS\nNetWare\nLinux\nCaracterísticas Físicas\nFormato	De Escritorio\nAltura	32.5mm\nAnchura	243mm\nProfundidad	160.6mm\nInformación General\nTipo de Producto	Router inalámbrico\nCódigo de Fabricante	ARCHER C7\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	C7\nNombre de Producto	Router Inalámbrico Gigabit Dual Band AC1750\nTipo de embalaje	Al por menor\nLínea de Producto	Archer\nNombre de Marca	TP-Link\nInterfaces/Puertos\nUSB	Sí\nVGA	No\nPuertos número de red (RJ-45)	4\nRed (RJ-11)	No\nLínea eléctrica	No\nPuerto de gesti