(7378, 'B40001B', 'TP-Link Tarjeta de Red TL-WN881ND, 300 Mbit/s, PCI Express, 2 Antenas N 300MBPS', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'Tarjeta de Red Inalambrica PCI Express (x1) TP-link,TL-WN881ND, 300Mbps en 2.4Ghz, 2 antenas desmontables ominireccional de 2dBi.\n\nEl adaptador PCI inalámbrico N TL-WN881ND le permite conectar su ordenador de sobremesa a una red inalámbrica y acceder a ella a alta velocidad. Conforme con el estándar IEEE 802.11n, ofrece una velocidad inalámbrica de hasta 300 Mbps, perfecta para jugar online o el vídeo en streaming.', 458, 468, NULL, 0),
(7379, 'B40001C', 'TP-Link TL-WN781ND Tarjeta de Red PCI Express, Inalámbrico, IEEE 802.11b/g/n EXPRESS N 150MBPS', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'TL-WN781ND de TP-LINK está diseñado para proporcionar un rendimiento inalámbrico completo de extremo a extremo del servidor o servidores de la columna vertebral de la infraestructura de conmutación y hacia la computadora de escritorio con el conector PCI Express. El adaptador PCI Express Lite inalámbrico N (x1) TL -WN781ND proporciona una compatibilidad más amplia, compatible con los estándares de ranura PCI Express x1, x2, x8, o x16. En comparación con las tarjetas de red estándar PCI, ofrece mayor ancho de banda, fiabilidad y una mayor funcionalidad, lo que te permite disfrutar de una conexión rápida y avanzada, como descargas, haciendo llamadas por Internet y transmisión de video.\n', 458, 468, NULL, 0),
(7380, 'B40001H', 'TP-Link Adaptador de Red USB TL-WN8200ND, Inalámbrico, 2.4GHz, con 2 Antenas de 5dBi ALTA POTENCIA 300MBPS  2 ANTENAS', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'TP-LINK TL-WN8200ND es un adaptador inalámbrico de alta potencia de 300 Mbps que permite a los usuarios activar tu PC o portátil con capacidad inalámbrica muy potente para ofrecer mejoras de rendimiento. El adaptador adopta el diseño de alta potencia que ofrece hasta 10 veces la gama de adaptadores convencionales. Una de las mejores características del TL-WN8200ND es su penetrabilidad fuerte, que puede asegurar efectivamente que la señal sigue siendo fiable cuando pasa a través de múltiples paredes o pisos.\n\n', 458, 468, NULL, 0),
(7381, 'B40001R', 'Switch TP-Link Fast Ethernet TL-SF1008D, 10/100Mbps, 1.6Gbit/s, 8 Puertos, 1000 Entradas ? No Administrable ETEHRNET  SIN ADMINISTRACION', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'El switch Fast Ethernet TL-SF1008D está diseñado para las oficinas pequeñas y reducidos grupos de trabajo. Los 8 puertos soportan MDI/MDIX automático, lo que le evita tener que preocuparse de qué cable debe utilizar: sólo tiene que enchufarlo y listo. Además, gracias a su innovadora tecnología de eficiencia energética, el TL-SF1008D ahorra hasta un 60%* de energía eléctrica, lo que lo convierte en una solución ecológica para la red de su negocio.', 458, 467, NULL, 0),
(7382, 'B40001S', 'Switch TP-Link Gigabit Ethernet TL-SG1008D, 10/100/1000Mbps, 8 Puertos ? No Administrable GIGABIT  SIN ADMINISTRACION', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'El TL-SG1008D de TP-LINK es un switch de sobremesa con 8 puertos Gigabit que le permite migrar fácilmente su red a la tecnología Gigabit Ethernet. Aumente tanto la velocidad de su servidor de red como la de las conexiones troncales o lleve la experiencia Gigabit a su escritorio. Adicionalmente, el diseño del TL-SG1008D le permite reducir su consumo eléctrico. Gracias a su innovadora tecnología de eficiencia energética, el TL-SG1008D ahorra hasta un 80% de energía eléctrica, lo que lo convierte en una solución ecológica para la red de su hogar o lugar de trabajo.\n\nEspecificaciones técnicas\nDescripción de la Alimentación\nFuente de Corriente	Adaptador CA\nGestión y protocolos\nGestionable	No\nRedes y Comunicaciones\nCompatibilidad con nivel	2\nFormato / Prestaciones\nTecnología de Red	10/100/1000Base-T\nTecnología Ethernet	Gigabit Ethernet\nTipo de Medio Compatible	Par trenzado\nCaracterísticas Físicas\nFormato	Montaje en pared\nDe Escritorio\nAltura	25.4mm\nAnchura	180.3mm\nProfundidad	88.9mm\nInterfaces/Puertos\nPuertos número de red (RJ-45)	8\nNúmero Total de Puertos de Red	8\nDetalles de Ranura de Expansión/Puerto	8 x Gigabit Ethernet Network\nInformación General\nTipo de Producto	Conmutador Ethernet\nCódigo de Fabricante	TL-SG1008D\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	TL-SG1008D\nNombre de Producto	Conmutador Ethernet TL-SG1008D\nNombre de Marca	TP-Link\n', 458, 467, NULL, 0),
(7383, 'B40001U', 'Extensor de rango TP-LINK  Nano Powerline Kit, TP-link, TL-PA4010/KIT, 1 Puerto Rj45 Ethernet, 300 Mbps hasta 500Mbps en 2.4Ghz. KIT  1 PUERTO ETHERNET', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Gracias a la avanzada tecnología de AV Home Plug, el TL-PA4010KIT proporciona a los usuarios, velocidades de transferencia de datos estables, de alta velocidad de hasta 500Mbps en una longitud de línea de hasta 300 metros. Con una velocidad de hasta 500 Mbps, el TL-PA4010KIT permite aplicaciones de ancho de banda pesada como transmisión HD, juegos en línea y descarga de archivos grandes, convirtiendo tu hogar en un establecimiento de red robusta y de alta velocidad.\n\nEspecificaciones técnicas\nEspecificaciones del Sistema Inalámbrico\nLAN inalámbrica	No\nFormato / Prestaciones\nDistancia máxima admitida	300m\nVelocidad de Transferencia de Datos en Red	600Mbit/s\nRedes y Comunicaciones\nEstándar de transmisión de línea eléctrica	HomePlug AV\nTecnología Ethernet	Fast Ethernet\nInformación General\nTipo de Producto	Adaptador de red línea eléctrica\nCódigo de Fabricante	TL-PA4010/KIT/US\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	TL-PA4010 KIT\nNombre de Producto	Adaptador Nano Powerline AV500 Kit de Inicio\nNombre de Marca	TP-LINK\nVarios\nRespetuoso del medio ambiente	Sí\nCertificación medioambiental	RoHS\nCaracterísticas Físicas\nAltura	27.9mm\nAnchura	66mm\nProfundidad	50.8mm\nInterfaces/Puertos\nUSB	No\nPuertos número de red (RJ-45)	1\nRed (RJ-45)	Sí\nLínea entrada de audio	No\nLínea salida de audio	No\nLínea telefónica (RJ-11)	No\nPuerto PoE (RJ-45)	No\n', 458, 468, NULL, 0),
