(7385, 'B40001X', 'TG-3468 TP-Link Tarjeta de Red PCI, Alámbrico, IEEE 802.3/3u/3ab, 802.3x, 802.1q/1p GIGABIT', 0, 'pending', 'hidden', 0, 0.16, 0.16, 0.16, 'El adaptador de red PCIe Gigabit a 10/100/1000 Mbps TG-3468 es una solución Ethernet PCI Gigabit de 32 bits altamente integrada y asequible que es totalmente compatible con los estándares IEEE 802.3, IEEE 802.3u y IEEE 802.3ab.\n\nEl adaptador PCIe Gigabit TG-3468 es un dispositivo de altas prestaciones diseñado para arquitectura de bus de alta velocidad PCI Express. Soporta y detecta automáticamente velocidades de red de 10/100/1000 Mbps e incorporta funciones tales como control de flujo 802.3x y Wake-on-LAN. El adaptador de red PCIe Gigabit TG-3468 es una solución Ethernet Gigabit altamente integrada y asequible que constituye una buena opción para actualizar su red.\n\nEspecificaciones técnicas\nFormato / Prestaciones\nRatio de Transferencia de Datos	1024MB/s\nRedes y Comunicaciones\nTecnología de Red	10/100/1000Base-T\nVarios\nDispositivo Compatible	PC\nPlataforma Compatible	PC\nRequerimientos del Sistema	Sistemas Operativo:\nWindows 98SE\nWindows Me\nWindows 2000/2000 Server\nWindows XP (32/64-bit)\nWindows Server 2003\nWindows Vista (32/64-bit)\nWindows 7 (32/64-bit)\nWindows 8\nServidor Novel NetWare 5.x/ 6.x\nLinux Kernel 2.4.x/ 2.6.x\nInformación General\nTipo de Producto	Tarjeta Gigabit Ethernet\nCódigo de Fabricante	TG-3468\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	TG-3468\nNombre de Producto	Tarjeta Gigabit Ethernet TG-3468\nNombre de Marca	TP-Link\nCaracterísticas Físicas\nFormato	Tarjeta enchufable\nLongitud	80mm\nAltura	57.5mm\nAnchura	1.6mm\nInterfaces/Puertos\nInterfaz de host	PCI Express x1\nPuertos número de red (RJ-45)	1\nRed (RJ-45)	Sí\nNúmero Total de Puertos	1', 458, 467, NULL, 0),
