(7387, 'B400010', 'TP-Link Adaptador de Red USB TL-WN821N, Inalámbrico, 300MBPS', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Adaptador inalámbrico N USB TL-WN821N le permite conectar una computadora de escritorio o portátil a una red inalámbrica y la conexión a Internet de alta velocidad de acceso. Cumplir con el estándar IEEE 802.11n, que proporcionan velocidad inalámbrica de hasta 300Mbps, lo cual es beneficioso para el juego en línea o incluso HD streaming de video.\n', 458, 468, NULL, 0),
(7388, 'B400011', 'TP-Link Mini Adaptador de Red USB TL-WN823N, Inalámbrico, 2.4 - 2.4835 GHz DE 300MBPS', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'TL-WN823N de TP-LINK está diseñado para conectar tu ordenador portátil o de escritorio a una red inalámbrica y disfrutar de un rendimiento inalámbrico de alta velocidad. El diseño de la punta del dedo hace que el adaptador conveniente y fácil de llevar a todas partes. Lo que es más, el TL-WN823N cuenta con modo SoftAP, configuración de seguridad de un solo botón, software de configuración fácil de usar, por lo que es una excelente opción para disfrutar de la red inalámbrica rápida.\n', 458, 468, NULL, 0);
