(7389, 'B400014', 'TP-Link Adaptador de Red USB TL-WN725N, Inalámbrico, 2.4 - 2.4835GHz 150MBPS', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Adaptador USB TP-LINK 150Mbps inalámbrico N Nano, TL-WN725N permite al usuario conectar un ordenador de sobremesa o portátil a una red inalámbrica en 150Mbps. Este adaptador miniatura está diseñado para ser lo más cómodo posible y una vez conectado al puerto USB de un ordenador, se puede dejar allí, ya sea que viaje o en casa. También cuenta con encriptación inalámbrica avanzada y fácil instalación.\n', 458, 468, NULL, 0),
(7390, 'B400015', 'TP-LINK c Inalámbrico de Alta Ganancia, TP-link, TL-WN822N, 300Mbps en 2.4Ghz, 2 antenas externas ALTA GANANCIA 300MBPS', 0, 'pending', 'hidden', 0, 0.21, 0.21, 0.21, 'Adaptador USB Inalámbrico de Alta Ganancia, TP-link, TL-WN822N, 300Mbps en 2.4Ghz, 2 antenas externas de 3 dBi omnidireccionales, 1 puerto Mini USB 2.0, incluye Cable USB de 1.5m.\n\nEl adaptador USB TL-WN822N de alta ganancia es un cliente inalámbrico de 300 Mbps, que permite a los usuarios conectar una computadora o laptop a una red inalámbrica y acceder a una conexión a Internet de alta velocidad. Es totalmente compatible con dispositivos IEEE 802.11 b / g / n inalámbricos, ofreciendo velocidades rápidas de 11N y señal confiable para juegos en línea sin demoras, llamadas por Internet o incluso transmisión de video HD.', 458, 468, NULL, 0),
