(7414, 'B40005Z', 'Switch TP-Link Gigabit Ethernet TL-SG108, 10/100/1000Mbps, 8 Puertos - No Administrable 8 PUERTOS GIGABIT  SIN ADMINISTRACI', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'El TL-SG108 dispone de 8 puertos 10/100/1000 que le permiten ampliar significativamente la capacidad de su red y disfrutar de unas velocidades de transferencia instantáneas cuando se manejan archivos de gran tamaño. De este modo, los usuarios más avanzados disponen del ancho de banda suficiente para transferir archivos de grandes dimensiones, ya sea en un entorno doméstico, oficina, grupo de trabajo o de producción creativa. Transfiera archivos gráficos, CGI, CAD o multimedia en un instante a través de la red.\n\nEspecificaciones técnicas\nDescripción de la Alimentación\nFuente de Corriente	Adaptador CA\nGestión y protocolos\nGestionable	No\nRedes y Comunicaciones\nCompatibilidad con nivel	2\nVarios\nRequerimientos del Sistema	Sistemas Operativo:\nMicrosoft Windows 98SE, NT, 2000, XP, Vista o Windows 7\nMac OS X\nNetWare\nUNIX\nLinux\nFormato / Prestaciones\nTecnología de Red	10/100/1000Base-T\nTecnología Ethernet	Gigabit Ethernet\nTipo de Medio Compatible	Par trenzado\nInformación General\nTipo de Producto	Conmutador Ethernet\nCódigo de Fabricante	TL-SG108\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	TL-SG108\nNombre de Producto	Conmutador Ethernet TL-SG108\nNombre de Marca	TP-Link\nCaracterísticas Físicas\nColor	Negro\nFormato	De Escritorio\nAltura	25.4mm\nAnchura	157.5mm\nProfundidad	101.6mm\nInterfaces/Puertos\nPuerto LRE	No\nUSB	No\nPuertos número de red (RJ-45)	8\nModular	No\nPuerto de gestión	No\nNúmero de Puertos Puerto de Vínculo Superior	No\nBypass	No\nNúmero Total de Puertos de Red	8\nDetalles de Ranura de Expansión/Puerto	8 x Gigabit Ethernet Network', 458, 467, NULL, 0),
