(7416, 'B40006D', 'TP-Link Hub Portátil USB A 3.0 de 4 Puertos, 5000 Mbit/s, Negro 3.0', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'El UH400 soporta todos los dispositivos USB incluyendo memorias USB, ratones, impresoras o cualquier otro dispositivo USB con el que quiera trabajar simultáneamente. Puertos USB 3.0 ofrecen velocidades de transferencia de hasta 5Gbps, 10 veces más rápido que el estándar USB 2.0.\n\n', 458, 467, NULL, 0),
(7417, 'B40006H', 'Router TP-Link WISP Nano TL-WR802N, Inalámbrico, 1x RJ-45, 2.4GHz TAMANO DE BOLSILLO', 0, 'pending', 'hidden', 0, 0.08, 0.08, 0.08, 'El TL-WR802N está diseñado para usar con tablets, smartphones, consolas portátiles y otros dispositivos portátiles electrónicos inalámbricos. Los dispositivos, que se pueden alimentar mediante un adaptador de corriente externo o a través de un cable USB a un ordenador, pueden conectarse convenientemente a internet y compartir la conexión a 300Mbps en una habitación de tamaño medio. El pequeño tamaño del dispositivo lo hace ideal para usarlo en la carretera y es lo suficientemente potente como para satisfacer casi cualquier requisito de aplicación inalámbrica.\n\n', 458, 468, NULL, 0),
(7418, 'B40006T', 'Router TP-Link Fast de Banda Dual AC1200 ARCHER C50, Inalámbrico, 4x RJ-45, 2.4-5GHz, con 4 Antenas Externas AC 1200 TP-LINK', 0, 'pending', 'hidden', 0, 0.08, 0.08, 0.08, 'El Archer C50 de TP-LINK incorpora el estándar Wi-Fi de última generación - 802.11ac, 3 veces más rápido que las velocidades inalámbricas N entregando una velocidad de transferencia inalámbrica combinada de hasta 1.2Gbps. Con velocidades inalámbricas de 300Mbps sobre la banda de 2.4GHz y 867Mbps sobre la banda cristalina de 5GHz, el Archer C50 es la mejor opción para Streaming HD sin interrupciones, juego en red y otras tareas intensivas en ancho de banda.\n\nEspecificaciones técnicas\nRedes y Comunicaciones\nCompatibilidad con VPN	Sí\nTecnología Ethernet	Fast Ethernet\nCaracterísticas Físicas\nFormato	De Escritorio\nAltura	35.6mm\nAnchura	231.1mm\nProfundidad	144.8mm\nEspecificaciones del Sistema Inalámbrico\nTecnología de transmisión de banda ancha	Ethernet\nEstádar LAN sin Cable	IEEE 802.11ac\nBanda ISM	Sí\nBanda UNII	Sí\nFrecuencia máxima IGS	2.40GHz\nFrecuencia máxima UNII	5GHz\nNúmero de Antenas Externas	2\nInterfaces/Puertos\nUSB	Sí\nPuertos número de red (RJ-45)	4\nNúmero de banda ancha (RJ-45) Puertos	1\nPuerto PoE (RJ-45)	No\nInformación General\nTipo de Producto	Router inalámbrico\nCódigo de Fabricante	ARCHER C50\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	Archer C50\nNombre de Producto	Router Inalámbrico de Doble Banda AC1200\nNombre de Marca	TP-Link\n', 458, 468, NULL, 0),
(7419, 'B400062', 'Convertidor de Medios TP-Link  MC220L, 10.000 Metros, 1 Puerto Fibra Multi/Monomodo, 1x RJ-45 GIGABIT', 0, 'pending', 'hidden', 0, 0.21, 0.21, 0.21, 'El MC220L es un conversor de medios diseñado para convertir el cable de fibra 1000BASE-SX/LX/LH a cable de cobre 1000Base-T o viceversa. El MC220L está diseñado conforme a los estándares IEEE802.3ab, 1000Base-T, IEEE802.3z y 1000Base-SX/LX/LH. Puede usarse con cable de fibra multimodo y monomodo utilizando un conector tipo SC/LC. Funciona a 850 nm tanto en el envío como en la recepción de datos cuando se utiliza fibra multimodo y a 1310 nm tanto en el envío como en la recepción de datos cuando se utiliza fibra monomodo.\n\nEspecificaciones técnicas\nDescripción de la Alimentación\nFuente de Corriente	Adaptador CA\nExpansiones E/S\nTipo de Ranura de Expansión	SFP (mini-GBIC)\nNúmero Total de Ranuras de Expansión	1\nNúmero de la SFP ranuras	1\nInterfaces/Puertos\nPuertos número de red (RJ-45)	1\nRed (RJ-45)	Sí\nNúmero Total de Puertos	1\nInformación General\nTipo de Producto	Transceptor/Convertidor de Medio\nCódigo de Fabricante	MC220L\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	MC220L\nNombre de Producto	Conversor de medios Gigabit Ethernet\nNombre de Marca	TP-Link\nRedes y Comunicaciones\nTecnología de Red	1000Base-T\n1000Base-FX\nTecnología Ethernet	Gigabit Ethernet\nCaracterísticas Físicas\nFormato	Externo\nAltura	27.9mm\nAnchura	94mm\nProfundidad	73.7mm\nFormato / Prestaciones\nDistancia máxima admitida	10km\nTipo de Medio Compatible	Fibra Óptica\nPar trenzado\nModo de Fibra Compatible	Multi-modo', 458, 467, NULL, 0),
(7420, 'B400065', 'Router TP-Link de Banda Dual AC750 ARCHER C20, Inalámbrico, 5x RJ-45, 2.4-5GHz, con 3 Antenas DOBLE BANDA AC750', 0, 'pending', 'hidden', 0, 0.36, 0.36, 0.36, 'El Archer C20 de TP-LINK viene con el estándar de próxima generación Wi-Fi - 802.11ac, compatible con 802.11n y 3 veces más rápido que las velocidades inalámbricas N. Con una mayor eficiencia energética y una seguridad robusta, el 802.11ac es la manera perfecta de acelerar una red doméstica multimedia y resolver la congestión que varios dispositivos puedan causar.\n\nEspecificaciones técnicas\nVarios\nRespetuoso del medio ambiente	Sí\nRedes y Comunicaciones\nCompatibilidad con VPN	Sí\nTecnología Ethernet	Fast Ethernet\nInterfaces/Puertos\nPuertos número de red (RJ-45)	4\nNúmero de banda ancha (RJ-45) Puertos	1\nPuerto PoE (RJ-45)	No\nEspecificaciones del Sistema Inalámbrico\nTecnología de transmisión de banda ancha	Ethernet\nEstádar LAN sin Cable	IEEE 802.11ac\nBanda ISM	Sí\nBanda UNII	Sí\nFrecuencia máxima IGS	2.40GHz\nFrecuencia máxima UNII	5GHz\nNúmero de Antenas Externas	3\nCaracterísticas Físicas\nFormato	De Escritorio\nAltura	35.6mm\nAnchura	231.1mm\nProfundidad	144.8mm\nInformación General\nTipo de Producto	Router inalámbrico\nCódigo de Fabricante	ARCHER C20\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	C20\nNombre de Producto	Router inalámbrico Archer C20\nLínea de Producto	Archer\nNombre de Marca	TP-Link', 458, 468, NULL, 0),
(7421, 'B400066', 'Tp-Link Receptor de Audio Bluetooth V5, Alcance de 20 Metros, Negro BLUETOOTH 4.0  AUDIO 3.5MM CONNECTO', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'Receptor de Música Bluetooth, TP-link, HA100, 20 metros de rango en el Buetooth, incluye Cable AUX de 3.5mm a 3.5mm, Cable de 3.5mm a RCA y Tag NFC.\n\nEl HA100 le proporciona a su dispositivo estéreo conectividad Bluetooth, permitiéndole transmitir música desde su smartphone o tablet. Podrá relajarse, escuchar y controlar sus listas de canciones favoritas lejos de su equipo estéreo.', 458, 495, NULL, 0),
(7422, 'B40007D', 'Extensor de Cobertura TP-Link E WiFi AC1750 RE450, Inalámbrico, 450 Mbit/s en 2.4GHz, 1300 Mbit/s en 5GHz BANDA AC1750', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'Ampliación de la Cobertura de Wi-Fi hasta 900 metros cuadrados, ¿Cansado de las \"zonas muertas\" Wi-Fi? El Extensor de Cobertura Wi-Fi AC1750 de TP-LINK se conecta al router de forma inalámbrica, fortaleciendo y ampliando su señal en las zonas a las que no puede llegar por sí misma. El dispositivo también reduce las interferencias de la señal para garantizar una cobertura Wi-Fi fiable en todo su hogar u oficina.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nFormato	Montaje en pared\nAltura	163mm\nAnchura	86.4mm\nProfundidad	29mm\nInterfaces/Puertos\nTecnología Ethernet	Ethernet\nFast Ethernet\nGigabit Ethernet\nHDMI	No\nVGA	No\nPuertos número de red (RJ-45)	1\nLínea eléctrica	No\nPuerto de gestión	No\nPuerto PoE (RJ-45)	No\nInformación Técnica\nVelocidad de transmisión inalámbrica	1.71Gbit/s\nBanda de Frecuencia	5GHz\n2.40GHz\nEstádar LAN sin Cable	IEEE 802.11ac\nNúmero de Antenas Externas	3\nInformación General\nTipo de Producto	Extensor de alcance inalámbrico\nCódigo de Fabricante	RE450\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	RE450\nNombre de Producto	Extensor de Cobertura Wi-Fi AC1750\nNombre de Marca	TP-Link', 458, 468, NULL, 0),
