(7424, 'B40007W', 'Switch TP-Link Gigabit Ethernet TL-SG105, 10/100/1000Mbps, 5 Puertos - No Administrable 5PTOS GIGABIT  SIN ADMINISTRACION', 0, 'pending', 'hidden', 0, 0.11, 0.11, 0.11, 'El TL-SG105 de TP-LINK es un switch de sobremesa con 5 puertos 10/100/1000Mbps que le permite migrar fácilmente su red a la tecnología Gigabit Ethernet. Aumente tanto la velocidad de su servidor de red como la de las conexiones troncales o lleve la experiencia Gigabit a su escritorio. Adicionalmente, el diseño del TL-SG105 le permite reducir su consumo eléctrico. Gracias a su innovadora tecnología de eficiencia energética, el TL-SG105 ahorra hasta un 65% de energía eléctrica, lo que lo convierte en una solución ecológica para la red de su hogar o lugar de trabajo.\n\nEspecificaciones técnicas\nDescripción de la Alimentación\nFuente de Corriente	Adaptador CA\nGestión y protocolos\nGestionable	No\nRedes y Comunicaciones\nCompatibilidad con nivel	2\nInterfaces/Puertos\nPuerto Token Ring	No\nPuerto LRE	No\nUSB	No\nPuertos número de red (RJ-45)	5\nModular	No\nPuerto de gestión	No\nNúmero de Puertos Puerto de Vínculo Superior	No\nPuertos de Apilamiento	No\nBypass	No\nNúmero Total de Puertos de Red	5\nDetalles de Ranura de Expansión/Puerto	5 x Gigabit Ethernet Network\nFormato / Prestaciones\nTecnología de Red	10/100/1000Base-T\nTecnología Ethernet	Gigabit Ethernet\nTipo de Medio Compatible	Par trenzado\nCaracterísticas Físicas\nFormato	De Escritorio\nAltura	25.4mm\nAnchura	99.1mm\nProfundidad	99.1mm\nInformación General\nTipo de Producto	Conmutador Ethernet\nCódigo de Fabricante	TL-SG105\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	TL-SG105\nNombre de Producto	Conmutador Ethernet TL-SG105\nNombre de Marca	TP-Link', 458, 467, NULL, 0),
(7425, 'B400075', 'Access Point TP-Link para Exteriores CPE220, Inalámbrico, 300 Mbit/s, 2 Antenas Integradas de 12dBi DE 12DBI', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Antena MIMO direccional de doble polarización incorporada de 12dBi 2x2\nPotencia de transmisión ajustable de 0 a 30dBm / 1000mw\nOptimizaciones a nivel del sistema para una transmisión inalámbrica de más de 13 km de largo alcance\nLa tecnología TP-LINK Pharos MAXtream TDMA (Time-Division-Multiple-Access) mejora el rendimiento del producto en rendimiento, capacidad y latencia, ideal para aplicaciones PTMP\nSistema de gestión centralizado: control de Pharos\nModos de operación AP / Cliente / Puente / Repetidor / Enrutador AP / Enrutador de cliente AP (WISP)\nEl adaptador PoE pasivo admite hasta 60 metros (200 pies) de implementación de Power over Ethernet y permite restablecer el dispositivo de forma remota\nEl CPE para exteriores de 2.4GHz 300Mbps 12dBi de TP-LINK, el CPE220 está dedicado a soluciones rentables para aplicaciones de redes inalámbricas al aire libre. Con su aplicación de administración centralizada, es flexible e ideal para aplicaciones de cobertura de Wi-Fi punto a punto, punto a multipunto y al aire libre. El rendimiento profesional, junto con un diseño fácil de usar, hace que CPE220 sea una opción ideal para usuarios domésticos y empresariales.\n\nHardware empresarial\nCon chipsets de nivel empresarial Qualcomm Atheros, antenas de alta ganancia y material de alta calidad, carcasa especialmente diseñada y fuente de alimentación PoE, CPE220 está especialmente diseñado para uso en exteriores y puede funcionar sin problemas en casi cualquier clima, con temperaturas de funcionamiento que oscilan entre -30 ° C. (-22?) A +70? (158?).\n\nSistema de antena avanzado\nAntena incorporada de alta ganancia y doble polarización El reflector de metal dedicado garantiza una mayor ganancia y una menor interferencia de ruido\n\n13 km + Transmisión de datos inalámbrica\nEspecialmente diseñado para usos al aire libre, ideal para la transmisión de datos inalámbrica de larga distancia a más de 13 km, probado en el campo.\n\nTecnología TP-LINK MAXtream TDMA\n\nA medida que aumenta la escala de la red, la competencia inalámbrica y las colisiones entre los CPE y las estaciones base serán tan enormes que el rendimiento real de la red disminuirá, lo que tendrá un impacto grave en la experiencia del usuario final. Para mitigar estos efectos, el CPE220 utiliza la tecnología MAXtream TDMA.\n\nPharos Control - Sistema de gestión centralizado\n\nEl CPE220 también viene equipado con un software de administración centralizada que ayuda a los usuarios a administrar fácilmente todos los dispositivos en su red desde una sola PC: Pharos Control. Funciones como descubrimiento de dispositivos, monitoreo de estado, actualización de firmware y mantenimiento de red se pueden administrar usando Pharos Control.', 458, 468, NULL, 0),
