(7430, 'B40008J', 'TP-Link Adaptador de Red USB UE200, Alámbrico, 100 Mbit/s ETHERNET A 100MBPS', 0, 'pending', 'hidden', 0, 0.08, 0.08, 0.08, 'El UE200 añade conectividad de red Ethernet a esos dispositivos sin puerto LAN Ethernet, como Ultrabooks o Macbooks Air, a través de un puerto USB 2.0 de uso común, que también es compatible con el estándar USB 1.1. Equipado con puerto USB 2.0 y puerto Ethernet de 100Mbps, el UE200 permite a su dispositivo una conexión de datos rápida y estable a la red Ethernet.\n\nEspecificaciones técnicas\nFormato / Prestaciones\nTipo de Medio Compatible	Par trenzado\nVarios\nDispositivo Compatible	Computador\nInformación General\nTipo de Producto	Tarjeta Fast Ethernet\nCódigo de Fabricante	UE200\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	UE200\nNombre de Producto	Tarjeta Fast Ethernet UE200\nNombre de Marca	TP-Link\nRedes y Comunicaciones\nTecnología de Red	100Base-TX\n10Base-T\nInterfaces/Puertos\nInterfaz de host	USB 2.0\nPuertos número de red (RJ-45)	1\nNúmero Total de Puertos	1\nCaracterísticas Físicas\nFormato	Tarjeta enchufable\nAltura	15.2mm\nAnchura	71.1mm\nProfundidad	25.4mm', 458, 467, NULL, 0),
(7431, 'B40008M', 'Switch TP-Link Gigabit Ethernet TL-SG108PE Easy Smart PoE, 8 Puertos 10/100/1000Mbps + 4 Puertos PoE, 16 Gbit/s, 4000 entradas - No Administrable GIGABIT CON 4 PUERTOS POE', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'Switch Easy smart Gigabit, TP-link, TL-SG108PE, NO administrable, 8 Puertos RJ45 AUTO Negociación/AUTO MDI/MDIX, de los cuales 4 puertos PoE que suministran un máximo de 15.4W por puerto.\n\nEl TL-SG108PE es un Switch Gigabit Easy Smart de 8 puertos con 4 puertos PoE, que representa una potente actualización de un switch no gestionable. Está diseñado específicamente para pequeñas empresas que requieren una gestión de red sencilla con función PoE. El TL-SG108PE puede conectar y alimentar hasta cuatro dispositivos PoE, como puntos de acceso inalámbricos (AP), cámaras IP y teléfonos IP. A través de su interfaz de usuario basada en web y su utilidad de gestión, el TL-SG108PE ofrece una gran variedad de características útiles, incluyendo monitoreo de red, priorización de tráfico y QoS mejorado. Además, con VLAN basada en puerto, etiquetas y MTU, el TL-SG108PE puede mejorar la seguridad y satisfacer más requisitos de segmentación de red.', 458, 467, NULL, 0),
(7432, 'B40008W', 'Convertidor TP-LINK - SC - RJ-45 - 1310nm - Monomodo INDIVIDUAL DE GIGABIT', 0, 'pending', 'hidden', 0, 0.16, 0.16, 0.16, 'El MC210CS es un conversor de medios diseñado para convertir el cable de fibra 1000BASE-LX/LH a cable de cobre 1000Base-T o viceversa. El MC210CS está diseñado conforme a los estándares IEEE802.3ab, 1000Base-T, IEEE802.3z y 1000Base-LX/LH. Puede usarse con cable de fibra multimodo utilizando un conector tipo SC. El MC210CS soporta la especificación de láser de onda larga (LX) a la máxima velocidad de transmisión. Funciona a 1310 nm tanto en el envío como en la recepción de datos.\n\nEspecificaciones técnicas\nDescripción de la Alimentación\nFuente de Corriente	Adaptador CA\nRedes y Comunicaciones\nTecnología de Red	1000Base-T\n1000Base-FX\nTecnología Ethernet	Gigabit Ethernet\nCaracterísticas Físicas\nFormato	Externo\nAltura	27.9mm\nAnchura	94mm\nProfundidad	73.7mm\nFormato / Prestaciones\nDistancia máxima admitida	15km\nTipo de Medio Compatible	Par trenzado\nFibra Óptica\nModo de Fibra Compatible	Multi-modo\nInterfaces/Puertos\nPuertos número de red (RJ-45)	1\nRed (RJ-45)	Sí\nNúmero de Puertos SC	1\nNúmero Total de Puertos	2\nInformación General\nTipo de Producto	Transceptor/Convertidor de Medio\nCódigo de Fabricante	MC210CS\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	MC210CS\nNombre de Producto	Transceptor/Convertidor de Medio MC210CS\nNombre de Marca	TP-Link\n', 458, 467, NULL, 0),
(7433, 'B40009H', 'Switch TP-Link Fast Ethernet TL-SF1024, 10/100Mbps, 4.8Gbit/s, 24 Puertos, 8000 Entradas ? No Administrable ETHERNET  SIN ADMINISTRACION', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'Características\nCantidad de Puertos: 24\nPuertos RJ-45 Ethernet: Fast Ethernet (10/100)\nTabla de direcciones MAC: 8000 entradas\nTipo de interruptor: No administrado\nEnergía sobre Ethernet (PoE): No\nMontaje en rack: Si\n\nPuertos e Interfaces\nCantidad de puertos básicos de conmutación RJ-45 Ethernet	24\nCantidad de puertos Fast Ethernet (cobre)	24\nPuertos tipo básico de conmutación RJ-45 Ethernet	Fast Ethernet (10/100)\nPeso y dimensiones\nAltura	44 mm\nProfundidad	180 mm\nAncho	440 mm\nDetalles técnicos\nAncho de la caja de envío	1 mm\nPallet height (air)	1.1 cm\nPallet gross weight (air)	1 g\nNumber of cartons per pallet (sea)	1\nQuantity per pallet (air)	1 pieza(s)\nPeso neto del empaque de envío (interno)	1 g\nQuantity per pallet (sea)	1 pieza(s)\nLongitud de la tarima	1 mm\nNúmero de cartones por capa	1\nPallet height (sea)	1.1 cm\nNúmero de capas por tarima (marítima)	1\nNumber of cartons per pallet (air)	11\nAncho de la tarima	1 mm\nCantidad por caja de envío	11 pieza(s)\nLongitud del contenedor de envío	1 mm\nAltura de la caja de envío	1 mm\nPallet gross weight (sea)	1 g\nNúmero de capas por tarima (aérea)	1\nGuía de configuración rápida	Si\nControl de energía\nConsumo energético	3.53 W\nFuente de alimentación incluida	Si\nFrecuencia de entrada AC	50/60 Hz\nConector eléctrico	Toma de entrada de CC\nVoltaje de entrada AC	100 - 240 V\nDiseño\nCertificación	FCC, CE\nMontaje en rack	Si\nColor del producto	Negro\nIndicadores LED	Actividad, Enlace\n', 458, 467, NULL, 0),
(7434, 'B40009I', 'SWITCH DE 16 PUERTOS GIGABIT PARA RACK  SIN ADMINISTRACION', 0, 'pending', 'hidden', 0, 0.4, 0.4, 0.4, '', 458, 467, NULL, 0),
(7435, 'B40009J', 'Router TP-Link con Sistema de Red Wi-Fi en Malla Deco M5, 1300 Mbit/s, 2x RJ-45, 2.4/5GHz - 1 Pieza BANDA AC1300  1 PZA', 0, 'pending', 'hidden', 0, 0.32, 0.32, 0.32, 'Se necesita un sistema Wi-Fi para una cobertura completa\n\nLos enrutadores promedio están diseñados para enviar Wi-Fi en todas las direcciones, pero no siempre llegan a todas las habitaciones. Los extensores de rango mejoran la cobertura pero crean múltiples redes para que usted navegue.\n\nDeco M5 utiliza varias unidades que trabajan juntas para reemplazar su enrutador y crear una conexión Wi-Fi perfecta en cada habitación. Cada enrutador de malla Deco puede funcionar de forma independiente para cubrir hasta 1,500 pies cuadrados y tres unidades que trabajan juntas brindan hasta 4,500 pies cuadrados de Wi-Fi rápido. Para una cobertura aún mayor, puede usar hasta 10 unidades Deco en una sola red.\n\nPequeña casa\n1 unidad - 1,500 pies cuadrados\n\nCasa mediana\n2 Unidades - 3,000 pies cuadrados\n\nCasa grande\n3 Unidades - 4,500 pies cuadrados\n\nDeco para el mejor Wi-Fi\n\nDeco incluye tres funciones independientes en un dispositivo: cobertura perfecta, antivirus y controles parentales.\n\nNo solo obtienes un potente Wi-Fi en todas las habitaciones de tu hogar, también obtienes el Wi-Fi más seguro para todo el hogar con HomeCare que protege todos los dispositivos.\n\nAntivirus\nProtege todos los dispositivos de las amenazas cibernéticas.\n\nControles parentales\nMantenga a su familia segura mientras está en línea.\n\nCalidad de servicio\nPriorice dispositivos y aplicaciones.\n\nLa configuración ahora es mucho más fácil\n\nCon solo unos minutos y la aplicación Deco, puede poner en funcionamiento toda su red doméstica. Simplemente desempaque sus unidades Deco, descargue la aplicación \"TP-Link Deco\" para Android o iOS y siga las instrucciones en pantalla. Deco se encargará del resto, incluso ayudándote a colocar cada unidad en el mejor lugar.', 458, 468, NULL, 0),
(7436, 'B40009M', 'TP-Link Adaptador de Red UE300, USB 3.0 a Ethernet Gigabit, Alámbrico ETHERNET GIGABIT', 0, 'pending', 'hidden', 0, 0.09, 0.09, 0.09, 'El USB 3.0 para Adaptador Ethernet Gigabit UE300 añade conectividad Ethernet Gigabit de red a su Ultrabook, MacBook Air o de escritorio a través de un puerto USB 3.0. 2.0/1.1 estándares compatible con USB, la transferencia de archivos a una velocidad ultrarrápida sobre un puerto Ethernet.\n\n', 458, 494, NULL, 0);
