(7437, 'B40009O', 'Router TP-Link con Sistema de Red Wi-Fi en Malla AC1300 Deco M5, 1300 Mbit/s, 2x RJ-45, 2.4/5GHz - 3 Piezas BANDA DUAL AC1300  4 ANTENAS INTE', 0, 'pending', 'hidden', 0, 0.32, 0.32, 0.32, 'Deco M5 utiliza tres unidades para ofrecer hasta 4500 pies cuadrados de cobertura Wi-Fi sin interrupciones. ART (Adaptive Routing Technology) de Deco elige automáticamente la mejor ruta para todos sus dispositivos para mantener su Wi-Fi funcionando lo más rápido posible. No importa en qué habitación se encuentre, Deco le permite transmitir música y películas y ejecutar sus dispositivos domésticos inteligentes sin interrupciones. TP-Link HomeCareTM le brinda a Deco la seguridad más completa de cualquier sistema Wi-Fi para toda la casa, protegiendo todos los dispositivos de las amenazas de seguridad. HomeCare incluye controles parentales fáciles de usar desde la aplicación Deco. Incluso puede priorizar dispositivos y actividades para que su red se mantenga rápida, incluso cuando todos están conectados a la vez.', 458, 468, NULL, 0),
(7438, 'B400091', 'Access Point TP-Link AC1750, 1300 Mbit/s, 1x RJ-45, 2.4/5GHz, Blanco BANDA AC1750 CON MONTAJE DE TECHO', 0, 'pending', 'hidden', 0, 0.33, 0.33, 0.33, 'La última generación de WI-Fi 802.11ac combinada con la avanzada tecnología MIMO 3x3 asegura unas increibles velocidades y una mejor cobertura en las bandas inalámbricas de 2.4GHz y 5GHz.\n\nEspecificaciones técnicas\nInformación Técnica\nVelocidad de transmisión inalámbrica	1.71Gbit/s\nBanda de Frecuencia	5GHz\n2.40GHz\nEstádar LAN sin Cable	IEEE 802.11ac\nCaracterísticas Físicas\nFormato	Montaje en pared\nMontable en techo\nAltura	48.3mm\nAnchura	180.3mm\nProfundidad	180.3mm\nInformación General\nTipo de Producto	Punto de acceso inalámbrico\nCódigo de Fabricante	EAP245\nDirección Web de Fabricante	http://www.tp-link.com\nFabricante	TP-LINK Technologies Co., Ltd\nModelo de Producto	EAP245\nNombre de Producto	Punto de acceso inalámbrico Auranet EAP245\nLínea de Producto	Omada\nNombre de Marca	TP-Link\nInterfaces/Puertos\nTecnología Ethernet	Gigabit Ethernet\nUSB	No\nHDMI	No\nVGA	No\nPuertos número de red (RJ-45)	1\nLínea eléctrica	No\nPuerto PoE (RJ-45)	No\nPuerto PoE PD	Sí\n', 458, 468, NULL, 0),
