fiables con Wi-Fi® de doble banda.\nComparta recursos fácilmente: acceda e imprima con redes Ethernet e inalámbricas.\nConecte su dispositivo móvil directamente a su impresora e imprima fácilmente sin acceder a una red.\n', 430, 475, NULL, 0),
