(7527, 'D7700AR', 'Mochila Vorago de Poliéster BP-400 para Laptop 15.6\", Negro APTOP 15.6   IMPERMEABLE  NEGRO', 0, 'pending', 'hidden', 0, 0.33, 0.33, 0.33, 'Diseño Vanguardista\nLleva todo lo necesario de una manera cómoda y discreta con la BP-400. La mochila ideal para tu estilo ejecutivo.\n\nLista para la vida diaria.\nLa Backpack Vorago BP-400 está fabricada con polyester repelente de agua por lo que tus pertenencias estarán seguras aún durante lluvias ligeras. Su cierre posterior de apertura completa facilita la organización y el acceso a tus pertenencias.\n\nIdeal para viajar.\nLa BP-400 separa tu laptop y accesorios de su compartimento principal, lleva contigo hasta 3 cambios de ropa de manera discreta. Ideal para viajeros de negocios.\n\nFácil de llevar.\nGracias a sus 3 agarraderas podrás tomarla fácilmente, su agarradera superior de metal es cómoda y amplia. Bajar tu backpack del avión nunca había sido tan fácil.', 459, 511, NULL, 0),
