(7645, 'D77006W', 'Audífonos  Vorago HPB-300 - Bluetooth - Micrófono - 3.5mm / Micro USB / BT / FM/ TF - Negro H/ FM/ MSD PLEGABLE NEGRA', 0, 'pending', 'hidden', 0, 0.3, 0.3, 0.3, 'Características principales\nTecnología de conectividad:\nInalámbrico\nColor del producto:\nNegro\nEstilo de uso:\nDiadema\nPeso:\n150 g\nTecnología de batería:\nPolímero de litio\n\nHPB-300\n\nCategoría: computer headsets\n\nFabricante: Vorago\n\nFecha de Salida: 22/09/2017\n\nVive la potencia bluetooth\nPrepárate para llevar tu música al siguiente nivel con las diademas bluetooth HPB-300 de Vorago con sonidos precisos, bien balanceados y eliminación de ruido gracias a sus cómodas almohadillas para que te olvides de todo a tu alrededor.\n\nMejor sonido.\nGraves poderosos y agudos definidos son los que podrás disfrutar con las diademas bluetooth.\n\nLigeros y portátiles.\nLos audífonos son plegables para que puedas guardarlos fácilmente en tu mochila cuando no\nlos utilices y así llevarlos a cualquier lugar.\n\nComodidad.\nSus almohadillas se ajustan perfectamente a tus oídos bloqueando el ruido del exterior para\nlargas sesiones de buena música.\n\nAutonomía.\nHasta 3.5 horas de música continua y 10 metros de alcance para disfrutar de toda tu música.\n\nControla lo que escuchas.\nAdelanta la pista, sube y baja el volumen con sus botones en tus audífonos fácilmente y con un solo toque.\n\nManos libres.\nContesta tus llamadas entrantes presionando un solo botón en tus audífonos, incluso si estás\nescuchando música.\n\nGran sonido.\nDeja que la música te envuelva en todas direcciones con bajos profundos y altos más claros', 459, 495, NULL, 0),
(7646, 'D770060', 'Vorago Audífonos Intrauriculares Deportivos ESB-300, Inalámbrico, Bluetooth, 60cm, Negro/Azul 0 AZUL BLUETOOTH MANOS LIBRES', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'orago Audifonos Sport Esb-300 Azul Bluetooth Manos Libres - Binaural - Intrauditivo - 1000cm - Bluetooth - 16Ohm - 20Hz a 20kHz\n\n\"No importa si vas caminando por la calle, trotando o practicando tu deporte favorito al aire libre, los earphones bluetooth ESB-300 de Vorago son los compañeros perfectos para añadir ritmo a todas tus actividades físicas. Son ligeros y sus almohadillas se adaptan perfectamente a tus oídos para largas sesiones de entrenamiento sin interrupciones.\"', 459, 495, NULL, 0),
