(7719, 'F52003R', 'KINGSTON DISCO ESTADO SOLIDO SSD 120GB M.2 2280 (A400) PCLAP SSD 120GB M.2 A400 PCLAP', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Kingston SSD A400 120GB M.2 SATA 2280 Lectura: 500MB/s y Escritura: 320MB/s\n\nSSD Kingston A2000 500GB M.2 NVMe PCIe Gen 3.0 x 4 Carriles 2280 Lectura: 2200MB/s y Escritura: 2000MB/s XTS-AES de 256-bit La unidad de estado sólido A400 de Kingston mejora dramáticamente la capacidad de respuesta de su sistema existente con velocidades increíbles de inicio, carga y transferencia, comparadas con los discos duros mecánicos. Usando un controlador de última generación para leer y escribir a velocidades de hasta 500MB/seg y 450MB/seg*, este SSD es 10 veces más rápido que un disco duro tradicional* para un mejor rendimiento, multi-tarea con mayor capacidad de respuesta y en general un sistema más rápido. Además de ser más confiable y duradero que un disco duro, el A400 está disponible en varios factores de forma de unidad y capacidades desde 120GB a1.92TB**. Este SSD está diseñado para ser utilizado con cargas de trabajo propias de computadoras de escritorio y notebooks y no está diseñado para entornos de servidores. * Basado en el rendimiento de una unidad nueva y sin uso, utilizando una placa madre con SATA Rev. 3.0. La velocidad puede variar dependiendo del hardware huésped, el software y el uso. La lectura/escritura aleatoria de 4k IOMeter está basada en la partición de 8GB. ** Algunas de las capacidades mencionadas en los dispositivos de almacenamiento Flash son utilizadas para formatear y otras funciones, por lo tanto no se encuentran disponibles para el almacenamiento de datos. Por este motivo, la capacidad real de almacenamiento de datos es inferior a la indicada en los productos. Si desea más información, consulte la Guía de Memoria Flash de Kingston en kingston.com/flashguide.', 436, 482, NULL, 0),
