(7839, '1650JF3', 'Switch Cisco Gigabit Ethernet SG550X-24P-K9, 24 Puertos 10/100/1000Mbps + 2 Puertos SFP+, 128 Gbit/s, 16.000 Entradas - Gestionado 1000 195W 4X10(2X10GBASE-T+2XSFP+)', 0, 'pending', 'hidden', 0, 0.56, 0.56, 0.56, 'Switches administrados apilables Cisco de la serie 550X\n\nFunciones avanzadas para entornos exigentes a un precio asequible\n\nSu negocio está creciendo y eso significa más clientes, más oportunidades y más atención a su empresa. El único problema: su red fue construida para una operación más pequeña. A medida que agregue más dispositivos, aplicaciones y usuarios, su entorno de TI será cada vez más difícil y costoso de administrar. Peor aún, a medida que la red se vuelve más compleja y sobrecargada, es probable que sus usuarios vean un rendimiento lento e incluso interrupciones.\n\nDado que los clientes y empleados dependen de su negocio más que nunca, una red lenta o poco confiable no es una opción. Necesita una red troncal de TI que proporcione un rendimiento excelente, disponibilidad ininterrumpida y seguridad avanzada. La red ideal será fácil de administrar, admitirá funciones avanzadas que crecerán con su empresa y tendrá un precio asequible.', 422, 467, NULL, 0),
