(7849, '1650LSK', 'Switch Cisco Fast Ethernet SF350-24P, 24 Puertos 10/100Mbps - Gestionado 10/100 POE MANAGED SWITCH', 0, 'pending', 'hidden', 0, 0.55, 0.55, 0.55, 'Switches Cisco de la serie 350\n\nLa serie 350 de Cisco, parte de la línea de soluciones de red Cisco Small Business, es una cartera de conmutadores administrados asequibles que proporciona una base confiable para la red de su empresa. Estos conmutadores brindan las características que necesita para mejorar la disponibilidad de sus aplicaciones comerciales críticas, proteger su información confidencial y optimizar el ancho de banda de su red para entregar información y aplicaciones de manera más efectiva. Fácil de configurar y usar, la serie 350 de Cisco ofrece la combinación ideal de asequibilidad y capacidades para las pequeñas empresas y le ayuda a crear una fuerza laboral más eficiente y mejor conectada.\n\nLa serie 350 de Cisco es una amplia cartera de conmutadores Ethernet administrados de configuración fija. Los modelos están disponibles con 48 puertos de Fast Ethernet y de 10 a 28 puertos de conectividad Gigabit Ethernet, lo que brinda una flexibilidad óptima para crear exactamente la base de red adecuada para su negocio. Sin embargo, a diferencia de otras soluciones de conmutación para pequeñas empresas que brindan capacidades de red administradas solo en los modelos más costosos, todos los conmutadores Cisco de la serie 350 admiten las capacidades de administración de seguridad avanzadas y las funciones de red que necesita para admitir tecnologías inalámbricas, de seguridad, de voz y de datos de clase empresarial. Al mismo tiempo, estos conmutadores son fáciles de implementar y configurar, lo que le permite aprovechar los servicios de red administrados que su empresa necesita.\n\nAplicaciones de negocios\n\nYa sea que necesite una red básica de alto rendimiento para conectar las computadoras de los empleados o una solución para brindar servicios de datos, voz y video, la serie 350 de Cisco ofrece una solución para satisfacer sus necesidades. Los posibles escenarios de implementación incluyen:\n\nConectividad de escritorio segura: los switches Cisco de la serie 350 pueden conectar de forma sencilla y segura a los empleados que trabajan en oficinas pequeñas entre sí y con todos los servidores, impresoras y otros dispositivos que utilizan. El alto rendimiento y la conectividad confiable ayudan a acelerar las transferencias de archivos y el procesamiento de datos, mejoran el tiempo de actividad de la red y mantienen a sus empleados conectados y productivos.\nConectividad inalámbrica segura: con sus funciones de seguridad avanzadas, Power over Ethernet, Auto Smartports, QoS, VLAN y funciones de control de acceso, los switches Cisco de la serie 350 son la base perfecta para agregar tecnología inalámbrica de nivel empresarial a una red empresarial.\nComunicaciones unificadas: como solución de red administrada, la serie 350 de Cisco proporciona el rendimiento y la inteligencia avanzada de manejo de tráfico que necesita para entregar todas las comunicaciones y datos a través de una sola red. Cisco ofrece una cartera completa de telefonía IP y otros productos de comunicaciones unificadas diseñados para empresas. Los switches Cisco de la serie 350 se han probado rigurosamente para ayudar a garantizar una fácil integración y compatibilidad total con estos y otros productos, proporcionando una solución empresarial completa.\nConectividad para invitados de alta seguridad. Los switches Cisco de la serie 350 le permiten extender la conectividad de red de alta seguridad a los huéspedes en una variedad de entornos, como un hotel, una sala de espera de la oficina o cualquier otra área abierta para usuarios que no sean empleados. Usando capacidades de segmentación de tráfico y seguridad poderosas pero fáciles de configurar, puede aislar el tráfico vital de su negocio de los servicios para invitados y mantener las sesiones de red de los invitados privadas entre sí.', 422, 467, NULL, 0),
(7850, '1650LSN', 'Access Point inalámbrico Cisco WAP581 - IEEE 802.11ac - 2.80Gbit/s - 2.40GHz, 5GHz - Tecnología MIMO - 2 x Red (RJ-45) - Montable en techo, Montaje en pared, De Escritorio AC DUAL RADIO WAVE 2 W/2.5GBE LAN', 0, 'pending', 'hidden', 0, 0.34, 0.34, 0.34, 'Hoy en día, el Wi-Fi es la forma principal de acceso móvil; Las pequeñas y medianas empresas ahora buscan redes Wi-Fi simples pero fáciles de implementar, donde puedan brindar la mejor experiencia a sus empleados y clientes. Para mantenerse productivos, necesitan acceso confiable y de clase empresarial a las aplicaciones de red en toda la oficina. El punto de acceso Cisco WAP581 Wireless-AC Dual Radio Wave 2 con LAN de 2.5GbE proporciona una forma simple y rentable de extender la red móvil de alto rendimiento y alta seguridad a sus empleados e invitados, para que puedan permanecer conectados en cualquier lugar de la oficina, independientemente de qué dispositivos móviles utilizan.\n\nEl punto de acceso Cisco WAP581 Wireless-AC Dual Radio Wave 2 con LAN de 2,5 GbE utiliza radio de doble banda simultánea para mejorar la cobertura y la capacidad del usuario. La tecnología 4 x 4 MU-MIMO en la radio de 5.0 GHz y 3 x 3 MIMO en la radio de 2.4 GHz permiten que el punto de acceso funcione al máximo rendimiento y brinde una mejor experiencia de usuario. Dos interfaces LAN Gigabit Ethernet, una con 2.5 Gigabit Ethernet y la segunda con 1 Gigabit Ethernet con PoE facilitan la instalación flexible y reducen el cableado y los costos de cableado. Las funciones inteligentes de calidad de servicio (QoS) le permiten priorizar el tráfico sensible al ancho de banda para aplicaciones de video y voz sobre IP (VoIP).\n\nPara proporcionar acceso de invitados altamente seguro a visitantes y otros usuarios, el punto de acceso Cisco WAP581 Wireless-AC Dual Radio Wave 2 con LAN de 2.5GbE admite un portal cautivo con múltiples opciones de autenticación y la capacidad de configurar derechos, roles y ancho de banda. Una página de inicio de sesión de invitado personalizada le permite presentar un mensaje de bienvenida y detalles de acceso, y refuerza su marca con logotipos de la empresa.\n\nLos puntos de acceso son fáciles de configurar y usar, con una configuración intuitiva basada en asistente para que pueda operar en minutos. Un diseño atractivo con opciones de montaje flexibles permite que los puntos de acceso se mezclen sin problemas en cualquier entorno empresarial pequeño o mediano.\n\nPara mejorar la confiabilidad y proteger la información comercial confidencial, el WAP581 admite tanto el Acceso protegido Wi-Fi (WPA) Personal como Enterprise, codificando todas sus transmisiones inalámbricas con un cifrado potente. Además, la autenticación 802.1X RADIUS ayuda a mantener alejados a los usuarios no autorizados.\n\nDiseñados para escalar sin problemas a medida que su organización crece, los puntos de acceso cuentan con una configuración de punto único sin controlador, que simplifica la implementación de múltiples puntos de acceso sin hardware adicional. Con Cisco WAP581, puede extender la red inalámbrica de clase empresarial a empleados e invitados en cualquier lugar de la oficina, con la flexibilidad de satisfacer las nuevas necesidades comerciales en los próximos años.', 422, 468, NULL, 0),
