(7863, '1650PE8', 'Switch Cisco Gigabit Ethernet Catalyst 9200L, 48 Puertos PoE+ 4x1G, 1000 Entradas - No Administrable 4 X 1G  NETWORK ESSENTIALS', 0, 'pending', 'hidden', 0, 0.54, 0.54, 0.54, 'Los switches Cisco® Catalyst® 9200 Series extienden el poder de las redes basadas en intenciones y la innovación de hardware y software Catalyst 9000 a un conjunto más amplio de implementaciones. Con su pedigrí familiar, los switches de la serie Catalyst 9200 ofrecen simplicidad sin compromiso: es seguro, siempre está encendido y la TI está simplificada.\n\nComo bloques de construcción fundamentales para la arquitectura de red digital de Cisco, los switches de la serie Catalyst 9200 ayudan a los clientes a simplificar la complejidad, optimizar la TI y reducir los costos operativos al aprovechar la inteligencia, la automatización y la experiencia humana que ningún otro proveedor puede brindar, independientemente de dónde se encuentre en la intención. viaje de networking basado.\n\nLos switches de la serie Catalyst 9200 brindan características de seguridad que protegen la integridad del hardware, así como el software y todos los datos que fluyen a través del switch. Proporciona resistencia que mantiene su negocio en funcionamiento sin problemas. Combine eso con las API abiertas de Cisco IOS XE y la capacidad de programación de la tecnología UADP ASIC, los switches de la serie Catalyst 9200 le brindan lo que necesita ahora con protección de la inversión en innovaciones futuras.\n\nCon capacidad PoE + completa, redundancia de alimentación y ventiladores, ancho de banda de apilamiento de hasta 160 Gbps, enlaces ascendentes modulares, compatibilidad con funciones de capa 3 y parcheo en frío, los switches de la serie Catalyst 9200 son la solución incomparable de la industria con resistencia diferenciada y arquitectura progresiva para sucursales rentables. acceso a la oficina.', 422, 467, NULL, 0),
