(7949, '47501G5', 'Videojuego Microsoft Xbox One - Halo Master Chief Collection COLLECTION', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Por primera vez, la historia completa de The Master Chief está en una sola consola. Con Halo 2: Anniversary remasterizado, junto con Halo: Combat Evolved Anniversary, Halo 3 y Halo 4, una nueva serie digital, Halo: Nightfall y acceso a la beta multijugador de Halo 5: Guardians, esta es la experiencia definitiva de Halo . * La historia completa de Master Chief: en honor al héroe icónico y su viaje épico, la historia completa de Master Chief se reúne como The Master Chief Collection. Halo: Combat Evolved Anniversary, Halo 2: Anniversary, Halo 3 y Halo 4 se incluyen con fidelidad visual de Xbox One, 60 fps, un total de 45 misiones de campaña más más de 100 multijugador (incluidos los mapas originales de Halo Combat Evolved) y Spartan Mapas de operaciones. Junto con el nuevo prólogo y el epílogo que presagian Halo 5: Guardians, esta es la colección que los fanáticos de Halo estaban esperando, todo en Xbox One. * Halo 2: Anniversary - Celebrando el décimo aniversario, el icónico favorito de los fanáticos regresa. Con una campaña completamente remasterizada con \"Modo Clásico\" que te permite cambiar instantáneamente entre el juego remasterizado y el juego original de 2004. Descubre nuevos elementos de la historia de Halo 5: Guardians con escenas de corte extendidas, videos terminales ocultos y utiliza todo nuevos cráneos para experimentar la campaña de una forma completamente nueva. Incluyendo los 25 mapas multijugador originales tal como los recuerdan los fanáticos, más 6 mapas completamente rediseñados. Juega el juego que definió el modo multijugador en línea en consolas y prepárate para el próximo capítulo de Halo. Nueva serie digital de acción en vivo de Halo: Nightfall: un mundo extraño y traicionero expone a los agentes de élite del UNSC a un peligro mucho más profundo en esta serie de acción en vivo de 343 Industries y Scott Free Productions. Producida por Ridley Scott y el presidente de Scott Free TV, David Zucker y dirigida por Sergio Mimica-Gezzan (\"Battlestar Galactica\", \"Pillars of the Earth\", \"Heroes\"), Halo: Nightfall es una nueva y emocionante historia para los fans de Halo y Nuevas audiencias por igual. Halo 5: Guardians Multiplayer Beta: sé uno de los primeros en experimentar una nueva generación de Halo multijugador en Halo 5: Guardians Beta. Prepárate para la versión beta de Guardianes desbloqueando contenido exclusivo en The Master Chief Collection y Halo: Nightfall. Estos elementos exclusivos se transferirán a Halo 5: Guardians. * Algunas funciones del juego, incluidos los videos de terminales ocultos, requieren Internet de banda ancha; Se aplican tarifas de ISP. Las funciones multijugador en línea requieren una suscripción a Xbox Live Gold (se vende por separado). Halo 5: Guardians se vende por separado; fecha de lanzamiento aún no anunciada. Halo: Nightfall: la serie de acción en vivo de 5 episodios solo se transmite, y los episodios se lanzan semanalmente. Se requiere Xbox One o Windows 8.1 e Internet de banda ancha; Se aplican tarifas de ISP. Se requiere Halo 5: Guardians Beta: Halo: The Master Chief Collection. Comienza la beta por tiempo limitado:29 de diciembre de 2014; Finaliza: 18 de enero de 2015. Debe ser mayor de 17 años. Se requiere Xbox One, Internet de banda ancha (se aplican tarifas de ISP) y membresía Xbox Live Gold (se vende por separado). Las fechas, el contenido y las funciones de Halo: Nightfall y Halo 5: Guardians Beta están sujetos a cambios. Visita www.xbox.com/halo Ahora puedes experimentar el viaje épico del Jefe Maestro en cuatro juegos de Halo, reunidos en una única experiencia integrada que aprovecha el poder de Xbox One. Esto incluye el clásico remasterizado Halo: Combat Evolved Anniversary y Halo 2 Anniversary con nuevo audio y efectos visuales de alta definición, el innovador Halo 3 y el comienzo del nuevo viaje del Jefe en Halo 4. Con la interfaz integrada puedes reproducir cualquiera de 100 mapas multijugador, aproveche nuestras listas de reproducción de campañas de juegos cruzados seleccionadas, esfuércese por completar cientos de nuevos logros o pruebe su habilidad contra la comunidad de Halo en las tablas de clasificación de velocidad y ataque de puntuación.', 461, 508, NULL, 0),
(7950, '47501G8', 'Gears of War Ultimate Edition, Xbox One ULTIMATE EDITION', 0, 'pending', 'hidden', 0, 0.02, 0.02, 0.02, 'Regresa el emblemático Gears of War original, espectacularmente remasterizado y modernizado para Xbox One.\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Software\nCódigo de Fabricante	4V5-00003\nDirección Web de Fabricante	http://www.microsoft.com\nFabricante	Microsoft Corporation\nNombre de Producto	Software 4V5-00003\nNombre de Marca	Microsoft\nInformación del Producto\nPlataforma Compatible	Xbox One\nSub Tipo de Software	Third Person Shooter\nTipo de Software Principal	Juego\nClasificación ESRB	M (Mature 17+)\nDescriptor de Clasificación	Violencia Intensa\nLenguaje Fuerte\nViolencia & Gore\nCompatibilidad con multirreproductor	Sí\nCompatible con redes	Sí\n', 461, 508, NULL, 0),
(7951, '47501IO', 'Forza Motorsport 7 Standard Edition, Xbox One STANDARD EDITION', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, 'Experimenta la emoción del automovilismo al límite con el juego de carreras más completo, hermoso y auténtico jamás creado.\n\nForza Motorsport 7 es donde los corredores, los drifters, los drag Racers, los tuners y los creadores se unen en una comunidad dedicada a todo lo relacionado con la automoción. Conduce los coches de tus sueños, con más de 700 vehículos increíbles para elegir, incluida la colección más grande de Ferrari, Porsche y Lamborghinis. Ponte a prueba en 30 destinos famosos y 200 pistas, donde las condiciones de la carrera cambian cada vez que regresas a la pista. ¡Experimente todo en una magnífica resolución de 60 fps y 4K nativa en HDR!\n\nLas nuevas funciones incluyen:\nDeriva, arrastre y contrarreloj mejorados\nNuevos modos: etiquetar, virus y pasar la TI\nIluminación, gráficos y sombras mejorados\nMejora y puntuación del ángulo de dirección de deriva\nNueva tienda de carreras\nMultijugador mejorado\nForce Feedback mejorado\nNuevos encuentros multijugador\nLímites de pistas nuevas\n\nEspecificaciones técnicas\nInformación del Producto\nPlataforma Compatible	Xbox One\nSub Tipo de Software	Juego de carreras\nTipo de Software Principal	Juego\nClasificación ESRB	E (Todos)\nCompatibilidad con multirreproductor	Sí\nCompatible con redes	Sí\nInformación General\nTipo de Producto	Software\nCódigo de Fabricante	GYK-00003\nDirección Web de Fabricante	http://www.microsoft.com\nFabricante	Microsoft Corporation\nNombre de Producto	Forza Motorsport 7 Standard Edition\nNombre de Marca	Microsoft', 461, 508, NULL, 0),
(7953, '47501JG', 'Disneyland Adventures, Xbox One ADVENTURES', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Disneyland Adventures está pensado para que tanto los niños como los seguidores de Disney de todas las edades exploren el parque de atracciones de Disneyland en 4K Ultra HD y HDR. Disfruta de aventuras de lo más envolventes, basadas en 18 de sus atracciones más emblemáticas; adéntrate en 100 misiones, a cuál más emocionante; e interactúa con 35 de los personajes Disney más queridos. Disneyland Adventures es tu pasaporte hacia el mágico mundo de Disneyland, y ¡todo sin salir del salón de tu casa!\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Software\nCódigo de Fabricante	GXN-00003\nDirección Web de Fabricante	http://www.microsoft.com\nFabricante	Microsoft Corporation\nNombre de Producto	Disneyland Adventures\nNombre de Marca	Microsoft\nInformación del Producto\nPlataforma Compatible	Xbox One\nSub Tipo de Software	Juego de acción/aventura\nTipo de Software Principal	Juego\nClasificación ESRB	E10+ - (Todos 10+)\nDescriptor de Clasificación	Violencia de tira\nCompatibilidad con multirreproductor	Sí\nCompatible con redes	Sí', 461, 508, NULL, 0),
(7954, '47501JH', 'Rush: A Disney-Pixar Adventure, Xbox One .', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, '\nRush: A Disney? Pixar Adventure, \"invita a familias y fanáticos de todas las edades a experimentar los mundos de seis amadas películas de Disney Pixar como nunca antes. Únete a personajes de\" Los Increíbles \",\" Ratatouille \",\" Up \",\" Cars \",\" Toy Story \"y\" Finding Dory \"para resolver acertijos y descubrir secretos ocultos, todo remasterizado en 4K Ultra HD y HDR.\n\nTú y tu personaje favorito de Pixar pueden interactuar en la pantalla y jugar de manera cooperativa para resolver desafíos. Pasa de la rápida resolución de acertijos a momentos de trepidante agilidad y velocidad \". Disney / Pixar\n\nQue hay de nuevo en esta version\n- Se corrigió la posible pérdida de datos en situaciones excepcionales al cambiar de dispositivo. - Se corrigieron los logros que ocasionalmente no se activaban cuando estaba previsto. - Se corrigieron algunas ubicaciones en las que los usuarios podían quedarse atascados al avanzar de nivel. - Oportunidad agregada para calificar la aplicación.\n\nCaracteristicas\n\nSalva el día en tu propia aventura de ritmo rápido. Invita a toda tu familia a unirse a Woody, Lightning McQueen y otros en esta experiencia única de Pixar.\nExperimente las vistas y los sonidos de cada mundo de Pixar mientras resuelve acertijos y descubre secretos ocultos. Conoce nuevos amigos y desbloquea aventuras.\nCompatible con Xbox Play Anywhere. Continúe donde lo dejó en otro dispositivo Xbox One o PC con Windows 10, y lleve consigo todas sus partidas guardadas y logros.\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Software\nCódigo de Fabricante	GYN-00003\nDirección Web de Fabricante	http://www.microsoft.com\nFabricante	Microsoft Corporation\nNombre de Producto	Rush: A Disney Pixar Adventure\nNombre de Marca	Microsoft\nInformación del Producto\nPlataforma Compatible	Xbox One\nSub Tipo de Software	Juego de carreras\nTipo de Software Principal	Juego\nClasificación ESRB	E10+ - (Todos 10+)\nDescriptor de Clasificación	Violencia de tira\nCompatibilidad con multirreproductor	Sí\nCompatible con redes	Sí', 461, 508, NULL, 0),
(7955, '47501MD', 'State of Decay 2, Xbox One .', 0, 'pending', 'hidden', 0, 0.02, 0.02, 0.02, 'State of Decay 2, Xbox One\n\nDescripción\n¿Cómo piensas sobrevivir? \n\nLos muertos se han levantado y la civilización se ha desmoronado. Ni siquiera el ejército pudo detener a los zombis y ahora te corresponde a ti reunir a los supervivientes y construir una comunidad en un mundo posapocalíptico donde cada decisión importa y las personas definen por sí solas lo que significa sobrevivir.\nFunciones\nCrea una historia única de supervivencia posapocalíptica.\n\nEnfréntate a aterradores enemigos vivos y muertos y explora un mundo dinámico.\n\nAfronta desafíos y situaciones impredecibles en el transcurso de la historia de tu comunidad.\n\nJuega en solitario, visita la comunidad de un amigo o invita a un máximo de tres jugadores a ayudarte.\n\nDisponible para Windows 10 y consolas Xbox.', 461, 508, NULL, 0),
(7956, '47501NN', 'Forza Horizon 4, Xbox One .', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, 'Microsoft Forza Horizon 4 - Juego de carreras - Xbox One\n\nLas estaciones dinámicas lo cambian todo en el mejor festival automovilístico del mundo. Ve por cuenta propia o únete a otros equipos para explorar la hermosa e histórica Gran Bretaña en un mundo abierto compartido. Colecciona, modifica y conduce más de 450 coches. Compite, realiza acrobacias, crea y explora: elige tu propio camino para convertirte en una Superestrella Horizon.', 461, 508, NULL, 0),
(7957, '47501P2', 'Minecraft Starter Collection, para Xbox One COLLECTION', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Crea cualquier cosa que te imagines. ¡Explora las montañas imponentes y los océanos de los mundos infinitos, expandidos aun más con las actualizaciones gratuitas del juego, así como los fabulosos mapas, servidores y MiniGames emocionantes creados por la comunidad, y mucho más! Sobrevive en línea con tus amigos al jugar en consolas, dispositivos móviles y Windows 10, o comparte la aventura en casa con el multijugador de pantalla dividida. Esta colección incluye el juego base de Minecraft, 1000 monedas y el contenido descargable del pack inicial y el pack de los creadores.\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Software\nCódigo de Fabricante	44Z-00108\nDirección Web de Fabricante	http://www.microsoft.com\nFabricante	Microsoft Corporation\nNombre de Producto	Minecraft Master Collection\nNombre de Marca	Microsoft\nInformación del Producto\nPlataforma Compatible	Xbox One\nSub Tipo de Software	Juego de acción/aventura\nTipo de Software Principal	Juego\nClasificación ESRB	E10+ - (Todos 10+)\nDescriptor de Clasificación	Violencia de fantasía\nCompatibilidad con multirreproductor	Sí\nCompatible con redes	Sí', 461, 508, NULL, 0),
(7958, '47501RT', 'Gears 5, para Xbox One .', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'La actualización gratis, Operación 3: Gridiron, ya está disponible. Aprovecha las nuevas habilidades de Cole y Clayton Carmine en los modos Horda y Escape y prueba el nuevo modo Gridiron.\n\nUna de las sagas más aclamadas del mundo de los videojuegos, Gears viene mejor que nunca, con cinco emocionantes modos y la campaña más interesante hasta ahora.\n\nEspecificaciones técnicas\nInformación General\nTipo de Producto	Software\nCódigo de Fabricante	6ER-00003\nDirección Web de Fabricante	http://www.microsoft.com\nFabricante	Microsoft Corporation\nNombre de Producto	Gears 5\nNombre de Marca	Microsoft\nInformación del Producto\nPlataforma Compatible	Xbox One\nSub Tipo de Software	Third Person Shooter\nTipo de Software Principal	Juego\nClasificación ESRB	M (Mature 17+)\nDescriptor de Clasificación	Lenguaje Fuerte\nViolencia Intensa\nViolencia & Gore\nCompatibilidad con multirreproductor	Sí\nCompatible con redes	Sí', 461, 508, NULL, 0),
