(7990, '7140LHZ', 'Disco Duro para Servidor HPE 1TB 6G SATA Hot Plug 7200RPM SFF 2.5\', SC Midline .', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Las unidades de disco duro HP SATA se han diseñado para obtener la fiabilidad y el almacenamiento masivo que demandan los entornos actuales de servidores actuales y almacenamiento externo. La cartera de unidades de disco duro SATA se clasifica en dos categorías: Disco duro básico (ETY) y de gama media (MDL). Los discos duro HP SATA básicos son la solución con el coste más bajo por unidad para servidores básicos. Están diseñados para ofrecer fiabilidad y rendimiento económico para aplicaciones que no son de misión crítica. Los discos rígidos SATA básicos y de gama media ofrecen como ventaja un mejor precio para estos entornos con carga de trabajo menor. Estos discos duros están disponibles en formato reducido (2,5 in) y grandes (3,5 in) tanto para conexión en caliente como entornos sin conexión en caliente.\n\n', 431, 483, NULL, 0),
(7991, '7140LH0', 'Disco Duro para Servidor HPE 2TB 6G SATA 7200RPM SFF 2.5\', SC 512e ', 0, 'pending', 'hidden', 0, 0.23, 0.23, 0.23, '¿Sus servidores necesitan unidades de disco SAS de alto rendimiento para sus aplicaciones de almacenamiento y de misión crítica? Las unidades de disco duro HP SAS para aplicaciones empresariales y de gama media (Enterprise y Midline) ofrecen soluciones de alto rendimiento para alojar aplicaciones basadas en transacciones altas. Están disponibles en el HP Smart Carrier, la portadora de conexión dinámica estándar de HP y la portadora de conexión no dinámica de HP.\n\n', 431, 483, NULL, 0),
