(8006, '7140LXJ', 'Disco Duro Interno HPE - 2.5\" - 1TB - SAS - 7200 RPM .', 0, 'pending', 'hidden', 0, 0.22, 0.22, 0.22, '¿Necesitan sus servidores unidades de disco SAS de alto rendimiento para sus aplicaciones críticas y de almacenamiento? Los discos duros HPE SAS para aplicaciones empresariales y de línea media ofrecen soluciones de alto rendimiento para alojar aplicaciones basadas en transacciones elevadas. Están disponibles en HPE Smart Carrier, HPE Standard Hot Plug Carrier y HPE Non-Hot Plug Carrier.\n\nLos discos duros HPE SAS están disponibles en factor de forma pequeño (SFF) de 2,5 pulgadas y factor de forma grande (LFF) de 3,5 pulgadas y vienen en una variedad de puntos de capacidad para cumplir con una amplia gama de requisitos que admiten aplicaciones empresariales y de línea media. La interfaz SAS se diseñó específicamente para ofrecer alta disponibilidad donde el almacenamiento de datos de clase empresarial, el rendimiento, la confiabilidad y la integridad de los datos son cruciales.', 431, 483, NULL, 0),
