(8008, '7140M25', 'SSD para Servidor HPE P18432-B21, 480GB, SATA, 2.5\", 127mm .', 0, 'pending', 'hidden', 0, 0.22, 0.22, 0.22, 'SSD HPE 480 GB SATA 6G uso mixto SFF SC múltiples proveedores\nLos SSD HPE SATA de uso mixto (MU) ofrecen características empresariales a un precio asequible. Los SSD HPE SATA están diseñados para ofrecer un mayor rendimiento y resistencia en aplicaciones que requieren un alto rendimiento de lectura y escritura aleatoria IOPS como las bases de datos, la virtualización, la computación en la nube o las aplicaciones transaccionales. Los SSD HPE Value SAS 12G ofrecen un mayor rendimiento que los SSD SATA 6G a un menor coste que los SSD SAS 12G tradicionales, lo que permite mejorar el coste total de la propiedad (TCO) mediante los asequibles SSD HPE Value SAS. Los SSD de HPE están respaldados por certificaciones y más de 3,35 millones de horas de pruebas1, lo que garantiza unidades fiables y de alto rendimiento. El firmware con firma digital HPE evita el acceso no autorizado a los datos al proporcionar la seguridad de que el firmware de la unidad procede de una fuente de confianza. También puedes supervisar la vida útil del SSD mediante HPE SmartSSD Wear Gauge para determinar si alguna de las unidades se halla en riesgo de fallo.', 431, 483, NULL, 0),
