(8072, '91400MZ', 'Mouse Gamer Logitech Óptico G603, RF Inalámbrico, Bluetooth, 12.000DPI, Negro INALAMBRICO LIGHTSPEED', 0, 'pending', 'hidden', 0, 0.19, 0.19, 0.19, 'MOUSE G603 LIGHTSEED INALAMBRICO PARA JUEGOS SENSOR HERO OFRECE UN DESEMPEÑO PRECISO Y ESTABLE, SEIS BOTONES PROGRAMABLES\n\nHERO es un nuevo y revolucionario sensor óptico diseñado por Logitech G para ofrecer un desempeño excelente y una eficiencia energética hasta 10 veces superior. Con el sensor HERO, G603 ofrece además un desempeño excepcionalmente preciso y estable en todo el rango de dpi, sin filtros, suavizado ni redondeo de píxeles de 200 a 12.000 dpi.', 445, 472, NULL, 0),
(8073, '91400NH', 'Mouse Logitech Óptico M170, Inalámbrico, USB, Negro/Gris MAC NEGRO/GRIS', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Tecnología Inalámbrica Confiable\nConexión Fiable\nCon M170 puedes tener la misma respuesta confiable que con un mouse con cable, pero con toda la libertad de la tecnología inalámbrica de 2.4 GHz desarrollada por Logitech, con un rango de acción de 10 m.\n\nM170 trabaja perfectamente con Windows, Mac OS, Chrome OS, Linux y prácticamente con cualquier dispositivo con entrada USB.\n\nConfiguración Sencilla\n\nConecta a través de receptor USB\nConectividad Plug&Play sin software necesario\n12 meses de duración de la batería\nAlcance inalámbrico de 10 m\n\nConecta a través de receptor USB\nConectividad Plug&Play sin software necesario\n12 meses de duración de la batería\nAlcance inalámbrico de 10 m\nLa forma de M170 permite un cómodo ajuste en tu palma derecha o izquierda, ideal para zurdos.', 445, 472, NULL, 0),
