(8084, '91400QK', 'Logitech Micrófono de Expansion para Logitech MeetUp, Alámbrico, Negro/Gris SISTEMA MEETUP LOGITECH', 0, 'pending', 'hidden', 0, 0.17, 0.17, 0.17, 'El micrófono de expansión Logitech para MeetUp proporciona más flexibilidad en las configuraciones de espacios de reunión reducidos. Los micrófonos integrados en MeetUp están optimizados para un alcance de hasta 2,4 metros. Para ampliar ese radio de acción hasta 4,2 metros, añada un micrófono de expansión. De ese modo se oirá lo que diga cualquier asistente, tanto si están alrededor de una mesa, cerca de la pared o de pie. AUDICIÓN CLARA A 4,2 METROS Dado el tamaño diverso de los espacios de reunión, hemos creado un micrófono de expansión para aumentar la flexibilidad de configuración. El micrófono de expansión amplía a 4,2 metros el radio de acción de captura del micrófono de MeetUp. FÁCIL SILENCIAMIENTO DE LLAMADAS Un botón de silenciamiento del micrófono permite que quienes se encuentran en el extremo de la mesa puedan silenciar todo el sistema manos libres. El indicador luminoso muestra cuándo se ha silenciado el micrófono, cuándo hay una llamada activa y cuándo se ha iniciado el emparejamiento inalámbrico Bluetooth.\n', 445, 495, NULL, 0),
(8085, '91400QN', 'Mouse Logitech Óptico M170, Inalámbrico, USB, Negro/Azul LAT - BLUE', 0, 'pending', 'hidden', 0, 0.12, 0.12, 0.12, 'Tecnología Inalámbrica Confiable\nConexión Fiable\nCon M170 puedes tener la misma respuesta confiable que con un mouse con cable, pero con toda la libertad de la tecnología inalámbrica de 2.4 GHz desarrollada por Logitech, con un rango de acción de 10 m.\n\nM170 trabaja perfectamente con Windows, Mac OS, Chrome OS, Linux y prácticamente con cualquier dispositivo con entrada USB.', 445, 472, NULL, 0),
(8086, '91400QO', 'Mouse Logitech Óptico M317, Inalámbrico, USB, Negro NEGRO', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, '\nDiseño Contorneado\nComodidad para ambas manos. Laterales blandos y cómodo diseño: para sentirse bien, incluso tras periodos de uso prolongado.\n\nUn Año De Duración De Pilas\nOlvídese de las pilas durante un año. Un conmutador de encendido/apagado y un modo de suspensión inteligente prolongan la duración de las pilas, mientras que un diodo evita sustos.2\n\nFiabilidad De Logitech\nObtendrá la calidad y fiabilidad que han hecho de Logitech el líder mundial en mouse, con tres años de garantía de hardware limitada.\n\nSeguimiento Óptico Avanzado De Logitech®\nDisfrute de un puntero y clics precisos (en superficies problemáticas para los mouse ópticos estándar) mientras navega por sus sitios Web favoritos gracias al seguimiento óptico avanzado de Logitech.\n\nReceptor Logitech Unifying\nEl minúsculo receptor permanece en el portátil. Además, puede agregar fácilmente un teclado o un mouse inalámbrico compatible, sin necesidad de usar varios receptores USB.', 445, 472, NULL, 0),
