(8099, '91400U7', 'Mouse Gamer Logitech Óptico G502 Hero RGB, Alámbrico, USB, 16.000DPI, Negro .', 0, 'pending', 'hidden', 0, 0.05, 0.05, 0.05, 'Sensor óptico avanzado\nG502 está dotado del sensor óptico PMW3366 sin aceleración, filtros ni suavizado en toda la gama de valores de dpi (200-12.000 dpi). Por eso proporciona una precisión de seguimiento excepcional y una respuesta uniforme, sea cual sea el valor de sensibilidad configurado en el mouse.\n\nBotón rueda con dos modos y desplazamiento superrápido\nDesbloquea el botón rueda para un desplazamiento superrápido continuo para girar rápidamente por páginas largas, o bloquéalo para un desplazamiento de precisión con un click. La pesada rueda metálica ofrece un control seguro, suave y satisfactorio para', 445, 472, NULL, 0),
(8100, '91400VB', 'Speaker para sistema de video conferencia Logitech Rally, Manos Libres, Alámbrico. Color Negro FOR LOGITECH RALLY', 0, 'pending', 'hidden', 0, 0.52, 0.52, 0.52, 'Speaker para sistema de video conferencia Rally, dos años de garantía.\n\nAgrega un segundo altavoz a Logitech Rally para llenar de audio nítido salas de gran tamaño. Con tecnologías RightSound? que prácticamente eliminan la distorsión, el clipping y la vibración, el altavoz Rally facilita la comunicación verbal con un nivel de volumen adecuado en todo el ámbito de la sala.', 445, 495, NULL, 0),
(8101, '91400V8', 'Logitech Micrófono Rally Mic Pod, Alámbrico, Negro FOR LOGITECH RALLY', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Todas Y Cada Una De Las Voces Se Oyen Claramente\nCon la tecnología RightSound? y múltiples elementos de formación de haces en cada base de micrófono individual, el audio siempre se centra automáticamente en el hablante activo. Una sola base proporciona cobertura para 10 personas. En espacios de reunión grandes se pueden usar hasta 7 bases funcionando al unísono para recibir y transmitir audio de asombrosa nitidez entre todos los participantes.\n\nCableado Simplificado\nEs posible conectar en serie hasta 7 bases de micrófono Rally con una sola conexión de cable al hub de sobremesa Rally. Para mesas dispuestas en forma de U o cableado simple a través de pasacables, el hub de base de micrófono Rally proporciona tres conexiones con que optimizar la colocación y acercar el control de silenciamiento.', 445, 495, NULL, 0),
