(8108, '91400ZF', 'Mouse Logitech Láser MX Master 3, Inalámbrico, Bluetooth, 4000DPI, Negro/Gris WIRELESS', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'COMBINACIÓN DE ELEGANCIA Y RENDIMIENTO\nMX Master 3 es precisión instantánea y potencial infinito. Es el ratón de la serie Master más avanzado hasta la fecha. Diseñado para diseñadores y concebido para codificadores. Si se te ocurre algo, puedes dominarlo.\n\nDESPLAZAMIENTO DE 1.000 LÍNEAS EN 1 SEGUNDO\nHemos reinventado el botón rueda. El novísimo desplazamiento electromagnético MagSpeed? es suficientemente preciso como para detenerse en un píxel y suficientemente rápido como para desplazarse por 1.000 líneas en un segundo. Ah, y es prácticamente silencioso. ?El acero mecanizado del botón rueda le da esa sensación táctil premium y el peso suficiente para ofrecer inercia dinámica que se siente pero que no se oye.\n\nTRABAJA MÁS RÁPIDAMENTE CON PERSONALIZACIONES ESPECÍFICAS DE APLICACIÓN\nPersonaliza MX Master 3 y configura cada acción para tu flujo de trabajo específico.\n? MX Master 3 es completamente personalizable en prácticamente todas las aplicaciones que usas (y trabajarás más rápido con personalizaciones predefinidas optimizadas para tus aplicaciones favoritas) 3 - Adobe Photoshop®, Adobe Premiere Pro, Final Cut Pro?, Google Chrome?, Safari? y Microsoft Word®, Excel®, PowerPoint® y Edge.', 445, 472, NULL, 0),
(8109, '9140070', 'Logitech Bocinas con Subwoofer Z313, 2.1, 50W RMS, Negro 25 WATTS RMS PC/MAC/MP3/IPOD/DVD', 0, 'pending', 'hidden', 0, 0.16, 0.16, 0.16, 'Sistema De Altavoces Z313 Con Subwoofer\nEste sistema de altavoces 2.1 ofrece una acústica equilibrada y proporciona graves mejorados con un compacto subwoofer. Conecta cualquier dispositivo a la entrada de 3,5 mm y accede fácilmente a los mandos de encendido y volumen en la sección de control con cable.\n\nSonido Pleno\n50 vatios de potencia de pico/25 vatios RMS ofrecen una gama completa de sonido con una acústica equilibrada. Graves mejorados a través del compacto subwoofer. Disfruta al instante de una experiencia de audio completa.\n\nInstalación Sencilla\nPuedes conectar cualquier dispositivo a través de la entrada de 3,5 mm. Configuración sencilla, sonido excelente.', 445, 495, NULL, 0),
(8110, '914008Q', 'Kit de Teclado y Mouse Logitech MK200, USB, Negro MK200 NEGRO PC USB', 0, 'pending', 'hidden', 0, 0.46, 0.46, 0.46, 'Especificaciones técnicas\nVarios\nRespetuoso del medio ambiente	Sí\nInterfaces/Puertos\nInterfaz de host de teclado/teclado numérico	USB\nInterfaz de host de dispositivo puntero	USB\nTeclado / Teclado numérico\nTeclas de Función Directa	Tecla de Internet\nCorreo Electrónico\nSilencio\nReproducción/Pausa\nControl de Volumen\nCaracterísticas de Teclado	Resistente a salpicaduras\nTeclas Silenciosas\nTeclas de perfil bajo\nDelgado\nTipo de teclado/Teclado numérico	Teclado\nTecnología de Conectividad de Teclado/Teclado Numérico	Cable\nRatón\nDetección del movimiento	Óptico\nResolución	1000 dpi\nTipo de Dispositivo Puntero	Mouse\nTecnología Conectividad de Dispositivo Puntero	Cable\nAjuste ergonómico	Simétrico\nInformación General\nTipo de Producto	Teclado y ratón\nCódigo de Fabricante	920-002716\nDirección Web de Fabricante	http://www.logitech.com\nFabricante	Logitech\nModelo de Producto	MK200\nNombre de Producto	Teclado y ratón Media Combo MK200\nLínea de Producto	Media Combo\nNombre de Marca	Logitech\n\n', 445, 473, NULL, 0),
(8111, '914009A', 'Logitech Sistema de Bocinas con Subwoofer Z906, 5.1, 500W RMS, Negro 500 WATTS RMS PC/MAC/MP3/IPOD/DVD', 0, 'pending', 'hidden', 0, 0.61, 0.61, 0.61, 'Potente Sonido\n1.000 watts de potencia de pico/500 watts RMS ofrecen audio pleno y graves potentes. Disfruta de todos los detalles sonoros, desde el clamor de la multitud hasta los pasos a tu espalda. Sonido que se oye y se siente.\n\nZ906 THX Surround Sound\nConfiguración Versátil\nSe admiten varias entradas simultáneas. Puedes conectar hasta seis dispositivos compatibles a través de entradas de 3,5 mm, RCA, directas para seis canales, digitales coaxiales y ópticas. Elige la entrada de audio en la consola de control o en el remoto.\n\nZ906 THX Surround Sound\nControles Integrados\nPuedes ajustar de forma independiente el volumen de cada bocina satélite y el subwoofer, y acceder fácilmente a los controles de encendido y silencio, todo ello desde el panel de control o el control remoto inalámbrico.\n\nZ906 THX Surround Sound\nSonido Envolvente\nDiseñado para ofrecer un sonido cautivador y una experiencia perfecta. Este sistema de bocinas 5.1 se ha optimizado al máximo para obtener la certificación THX, y se ha diseñado para descodificar pistas de sonido Dolby Digital y DTS y proporcionar una experiencia de audio excepcional.\n\n', 445, 495, NULL, 0),
(8112, '914009R', 'Logitech Bocinas para Computadora Stereo Z120, Alámbrico, 2.0, 1.2W RMS, Negro/Blanco CONEXION 3.5MM ALIMENTACION USB*.', 0, 'pending', 'hidden', 0, 0.12, 0.12, 0.12, 'BOCINA Z120 ESTEREO CON ALIMENTACION USB\n\nEstos compactos altavoces USB con controles de volumen y encendido integrados facilitan la conexión de casi cualquier fuente de audio. Para que pueda disfrutar fácilmente de la música, el vídeo, etc. que prefiera.\n\nPuede conectar cualquier fuente de audio que utilice un conector de 3,5 mm estándar, como la toma de auriculares del reproductor de MP3.\n\nEstos altavoces suenan genial sin ocupar demasiado espacio en su mesa o escritorio.', 445, 495, NULL, 0),
