(8115, '914010U', 'Mouse Logitech Óptico Pebble M350, Inalámbrico, Bluetooth, 1000DPI, Azul AZUL GRAFITO', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'MODERNO, COMPACTO Y PRECIOSO\nEl diseño moderno de Logitech Pebble M350 se adapta a tu estilo de vida, realza el aspecto del escritorio y se puede llevar en cualquier bolsa.\n\nCLICKS Y DESPLAZAMIENTO SILENCIOSOS\nPuedes trabajar en una cafetería, una biblioteca o un tren lleno de gente sin molestar a nadie a tu alrededor. La sensación de click será la que a ti te gusta pero un 90% menos ruidosa.1 El botón rueda de goma también funciona en silencio.\n\nELIGE TU CONEXIÓN\nConéctate sencillamente vía Bluetooth® o con el pequeño receptor USB de 2,4 GHz (almacenado bajo la tapa magnética del mouse) y olvida la posibilidad de interrupciones o demoras, con un radio de acción de hasta 10 metros.', 445, 472, NULL, 0),
