(8121, '914010Z', 'Teclado Logitech K380, Inalámbrico, Bluetooth, Blanco (Español) .', 0, 'pending', 'hidden', 0, 0.3, 0.3, 0.3, 'Easy-Switch\nConecta hasta tres dispositivos simultáneamente, por ejemplo un ordenador Windows, un iPhone y una tableta Android. Basta pulsar un botón para empezar a escribir con otro dispositivo.\n\nK380 MULTI-DEVICE\nEscribe en cualquier dispositivo\nDisfruta de escritura en Smartphones y tabletas tan cómoda y práctica como en el escritorio con este teclado portátil.\n\nK380 es un teclado inalámbrico multidispositivo que se conecta a todos los dispositivos inalámbricos Bluetooth compatibles con teclados externos.\n\n- Tecnología inalámbrica Bluetooth\n\n- Multiplataforma\n\n- Windows, Mac, Chrome OS, Android, iOS, Apple TV\n\nK380 MULTI-DEVICE\nDiseño para escribir sobre la marcha\nLleva este ligero y compacto teclado Bluetooth a cualquier lugar de la casa. Escribe donde quieras, con cualquier computadora, tableta o teléfono compatible.\n\nK380 MULTI-DEVICE\nDistribución habitual\nEl teclado multidispositivo K380 reconoce cada dispositivo y automáticamente asigna las teclas para ofrecer una distribución habitual con los accesos directos favoritos.\n\nAl detectar el dispositivo concreto, por ejemplo una computadora Apple o Windows, este teclado universal enviará los códigos correctos.', 445, 473, NULL, 0),
