(8147, '94201Z2', 'Monitor Lenovo D19-10 LED 18.5\", HD, Widescreen, HDMI, Negro HDMI VGA 3WY', 0, 'pending', 'hidden', 0, 0.61, 0.61, 0.61, 'SIN VOLANTES ADJUNTOS\n\nDiseñado para pequeñas empresas y aplicaciones industriales, así como para uso doméstico, el Lenovo D19-10 es una solución de pantalla simple y asequible. Tiene un diseño minimalista que es a la vez sutil y eficiente.\n\nDiseñado para ser un caballo de batalla de todos los días, el Lenovo D19-10 está enfocado y ofrece una experiencia de usuario sin complicaciones. Como dispositivo esencial, no escatima en las funciones necesarias que pueden mejorar las experiencias de visualización, ofreciendo todo lo que se espera de un monitor compacto.\n\nDiseño simple y limpio\n\nEl monitor está diseñado para adaptarse a oficinas pequeñas e ideal para profesionales que no trabajan con elementos visuales o gráficos pesados; por ejemplo, salas de monitoreo de seguridad, pantallas OTC y sistemas de facturación podrían beneficiarse de un D19-10.\n\nPantalla cómoda\n\nLa pantalla de 18,5 pulgadas de la D19-10 es un panel TN con retroiluminación WLED, 1366 x 786 HD, que admite 16,7 millones de colores, lo que cubre el 72% de la gama NTSC. También tiene un tiempo de respuesta de 5 ms para imágenes fluidas. Tiene certificación TÜV, lo que significa menos fatiga ocular durante largas jornadas laborales.\n\nConectividad perfecta\n\nComo monitor que probablemente se utilizará en varias funciones en oficinas y hogares, viene con conectores HDMI y VGA, lo que garantiza la compatibilidad con sistemas heredados. También se puede colocar sobre una mesa con su soporte inclinable o en una pared con un soporte VESA de 100 mm.\n\nEspecificaciones técnicas\nInterfaces/Puertos\nHDMI	Sí\nVGA	Sí\nVarios\nRespetuoso del medio ambiente	Sí\nEnergy Star	Sí\nVídeo\nBrillo	200cd/m² - Típico\nColores Admitidos	16,7 Millones de colores\nResolución máx.	1366 x 768\nRatio de Contraste Originario	600:1\nGama de colores	72% TNTSC (CIE 1931)\nInformac