(8182, '94609EY', 'Mouse Dell Gamer Alienware Óptico Elite, Alámbrico, USB, 12.000DPI, Negro/Plata 12000PPP RGB USB OPTICO', 0, 'pending', 'hidden', 0, 0.22, 0.22, 0.22, '\nDescripción\nRatón para juegos con sensor óptico de 12.000 ppp de PixArt. Con alas laterales rediseñadas para un mejor agarre y AlienFX ? con iluminación RGB.\n\nLa personalización viene de serie\n\nExperimente una mayor flexibilidad en forma y función con hasta 11 botones programables, memoria integrada y cuatro pesos configurables de cinco gramos. Con un reposamanos ajustable de varias posiciones con tres posiciones y dos nuevas alas laterales intercambiables con dos y cuatro botones.\n\nLas alas laterales funcionan cómodamente con los agarres de la palma, garras y yemas de los dedos y te permiten cambiar tu estilo de sujeción sobre la marcha. Esto aumenta la precisión general para mejorar sus habilidades en el juego.\n\nDurable y confortable\n\nEl mouse para juegos Alienware Elite fue construido con materiales superiores, como placas de aluminio anodizado y una rueda de aluminio para brindar máxima comodidad, diseño y durabilidad. También se ha diseñado con conmutadores Omron de rendimiento para garantizar un juego fiable con una vida útil de hasta 50 millones de clics. Este diseño personalizable ofrece comodidad, control y precisión de primer nivel en todos los niveles.\n\nEl poder de realizar\n\nExperimente una increíble velocidad de respuesta y control de sensibilidad con 12,000 DPI, hasta 50G, 250 IPS y 5 configuraciones de DPI sobre la marcha, una característica que le permite cambiar su configuración en el corazón de la acción. Y nunca pierda su objetivo gracias al sensor óptico de PixArt, el mejor en su clase.\n\nNuevo centro de comando de Alienware\n\nExperimente un software innovador diseñado específicamente para mejorar su experiencia de juego, ajustar su configuración, resolver problemas y administrar el tiempo.\n\nCalibra tus controles\n\nAhora tiene control sobre sus entornos de hardware y software. Una única interfaz transforma su PC con Windows en un entorno de juego mejorado que se adapta a su gusto.\n\nVea todos sus juegos en un solo lugar\n\nObtenga acceso rápido y fácil a todo su catálogo de juegos y ajuste la configuración de cada título. Crea perfiles únicos para cualquier juego de la biblioteca y mantén esas preferencias mientras cambias de juego.\n\nPersonalice la iluminación con AlienFX\n\nConfigure temas, macros y configuraciones periféricas. Asigne sus temas a los juegos para una experiencia de juego verdaderamente personal. Seleccione entre hasta 16,8 millones de colores, efectos de animación predefinidos y controles de brillo.\n\n', 426, 472, NULL, 0),
