(8184, '94609IP', 'Monitor DELL Videoconferencias  P2418HZM 24 Professional  W/ Camera PROFESSIONAL MONITOR W/ CAMERA§MIC', 0, 'pending', 'hidden', 0, 0.43, 0.43, 0.43, 'Descripción\n\"?Disfrute de una experiencia de videoconferencia de escritorio de primera clase.\nExperimente confiabilidad sorprendente\nViene con la promesa de alta confiabilidad de Dell.\n? Con la garantía de primera calidad para el panel de Dell puede estar tranquilo .\n? Reduzca el tiempo de inactividad con el Servicio de intercambio avanzado de 3 años.\n? Disfrute la alta confiabilidad de la marca de monitores n.º 1 en todo el mundo por tercer año consecuntivo.\n? Los bordes delgados le permiten disfrutar de una vista fluida y menos difícil al trabajar en varios monitores.\n? Realice varias tareas con facilidad. Manténgase organizado mientras trabaja en varias aplicaciones gracias a Dell Easy Arrange.\n? Use el manos libres. Inicie las funciones de comando de voz con Microsoft Cortana.\n? Optimice el confort visual con una pantalla sin parpadeos con la certificación TUV con la función ComfortView que minimiza las emisiones de luz azul.\n? Personalice su experiencia de visualización con una base completamente regulable que ofrece un movimiento pivotante, inclinación, un movimiento giratorio y ajusta la altura.\n? Se adapta fácilmente a su espacio de trabajo con opciones de montaje flexibles, que incluye VESA.\"\n\nDispositivos Incorporados\nCámara Web	Sí\nMicrófono	Sí\nDescripción de la Alimentación\nConsumo de energía	19W\nConsumo de energía en espera	300mW\nModo consumo de energía OFF	300mW\nInterfaces/Puertos\nUSB	Sí\nHDMI	Sí\nVGA	Sí\nDisplayPort	Sí\nInformación General\nTipo de Producto	Monitor LCD\nCódigo de Fabricante	210-ANME\nDirección Web de Fabricante	http://www.delltechnologies.com\nFabricante	Dell Technologies\nModelo de Producto	P2418HZM\nNombre de Producto	Monitor LCD P2418HZM\nGama de Producto	P\nNombre de Marca	Dell\nInformación Técnica\nRelación de aspecto	16:9\nTamaño de Pixel	