(8213, 'B4000GJ', 'TP-Link Extensor de Rango Universal RE650, Inalámbrico, 1733 Mbit/s C2600', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'Repetidor de WiFi Doble Banda AC2600\nAlcance extendido superior: cuatro antenas externas fijas extienden la cobertura de Wi-Fi\n4-Stream para Wi-Fi de banda dual AC2600: 800Mbps simultáneos en 2.4GHz + 1733Mbps en 5GHz\n4 × 4 MU-MIMO: transfiere datos simultáneamente a múltiples dispositivos para un rendimiento 4 veces más rápido\nTecnología Beamforming: envíe una señal Wi-Fi dirigida a dispositivos individuales para conexiones más fuertes\nPuerto Gigabit Ethernet: proporcione conexiones por cable más rápidas a televisores inteligentes, computadoras y consolas de juegos\nLuz de señal inteligente: ayuda a determinar la mejor ubicación para una cobertura Wi-Fi óptima al indicar la intensidad de la señal en la ubicación actual\nModo AP: cree un nuevo punto de acceso Wi-Fi para mejorar su red cableada con capacidad Wi-Fi\nAplicación TP-LINK Tether: acceda y administre fácilmente su red utilizando cualquier dispositivo móvil iOS o Android\nCompatibilidad definitiva: amplíe el alcance de cualquier repetidor de WiFi o punto de acceso inalámbrico\n\nRepetidor de WiFi Doble Banda Ultrarrápida\nCon cuatro antenas externas y de doble banda, el RE650 establece una conexión inalámbrica estable a cualquier enrutador Wi-Fi y aumenta la cobertura de la red en hasta 14,000 pies cuadrados *. El procesador de doble núcleo de 880MHz proporciona el máximo rendimiento de Wi-Fi, manteniendo sus teléfonos inteligentes y tabletas conectados mientras se desplaza por su hogar.\nLa tecnología Beamforming detecta la ubicación de los dispositivos y concentra el Wi-Fi hacia ellos para lograr conexiones más fuertes.', 458, 468, NULL, 0),
