(8297, '914018A', 'Cámara Web Logitech C505E .', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'Descripción\nC505e ofrece un campo visual diagonal de 60°, foco fijo y corrección de\niluminación automática que ajusta la iluminación de la mayoría de los\nespacios; un micrófono omnidireccional permite conversaciones claras\nhasta a 3 metros de distancia.\nEl cable USB-A extralargo y el clip universal ofrecen una amplia\nvariedad de opciones de montaje flexibles. Fíjala sobre la pantalla o\ncolócala hasta a 2m (7 ft) de distancia de la computadora.\nC505e funciona con las aplicaciones de videollamadas más populares,\nincluidas Microsoft® Teams, Skype? for Business, Google Voice y\nMeet, Zoom® y otras, para garantizar la compatibilidad y la perfecta\nintegración en el entorno de trabajo.\n\n1.- Video HD 720 en pantalla panorámica: Un campo visual diagonal de 60° junto\ncon la resolución HD 720p/30 fps, foco fijo y corrección de iluminación automática\nayudan a ajustarla a la mayoría de condiciones de iluminación.\n2.- Micrófono mono de largo alcance: El único micrófono omnidireccional se\nconcibió para ofrecer conversaciones claras y naturales hasta a 3 metros de\ndistancia, incluso en ambientes de oficina ruidosos.\n3.- El cable USB-A extralargo amplía las opciones de configuración: Con su\ncable USB y su clip universal, colócala de forma segura sobre la pantalla de una\nlaptop o sobre una pantalla externa, o instálala hasta a 2 m (7 ft) de distancia de\nla computadora.', 445, 497, NULL, 0),
