(8300, '081013D', 'Cinta Brother TZES261 Negro sobre Blanco, 36mm x 8m .', 0, 'pending', 'hidden', 0, 0.15, 0.15, 0.15, 'Brother International de México comercializa una gran variedad de equipos de oficina conocidos por su originalidad y creatividad.\n\nEspecificaciones técnicas\nCaracterísticas Físicas\nColor	Blanco\nVarios\nCompatibilidad	\nBrother - Sistema de etiquetado P-Touch:\n\n3600\n550\n550A\n9200\n9200DX\n9200PC\n9500\n9500PC\n9600\n9700PC\n9800PCN\nRL-700S\nPaís de Origen	Japón\nReciclado	No\nContenido Reciclado	0%\n% de Residuo Postconsumo	0%\nNecesita Montaje	No\nRespetuoso del medio ambiente	Sí\nInformación General\nTipo de Producto	Cinta para etiquetas\nCódigo de Fabricante	TZES261\nDirección Web de Fabricante	http://www.brother.com\nCantidad de Unidades	1 / Solamente\nFabricante	Brother Industries, Ltd\nModelo de Producto	TZES261\nNombre de Producto	Cinta para etiquetas TZES261\nGama de Producto	TZe\nNombre de Marca	Brother\nInformación del Producto\nLongitud Etiqueta	8m\nAnchura Etiqueta	36mm\nCaracterísticas	Resistente a sustancias químicas\nResistente a la abrasión\nAlta Duración\nAuto-adhesivo\nResistente a la temperatura\nResistente a la decoloración\nTecnología de Impresión	Térmica\nTransferencia térmica\nTipo de adhesivo	Permanente\nResistente al agua	Sí\nLaminada	Sí', 421, 478, NULL, 0),
(8301, '165104N', 'Switch Cisco Small Business Series 350 - 48 Puertos - Gigabit - 4 SFP+ - Gestionado 4X10G SFP+', 0, 'pending', 'hidden', 0, 0.54, 0.54, 0.54, 'Los conmutadores Cisco Business de la serie 350, que forman parte de la línea de soluciones de red Cisco Business, son una cartera de conmutadores gestionados asequibles que proporcionan un componente fundamental para cualquier red de oficina pequeña. El panel de control intuitivo simplifica la configuración de la red y las funciones avanzadas aceleran la transformación digital, mientras que la seguridad generalizada protege las transacciones críticas de la empresa. Los switches Cisco Business de la serie 350 brindan la combinación ideal de asequibilidad y capacidades para oficinas pequeñas y lo ayudan a crear una fuerza laboral más eficiente y mejor conectada.\n\nLos switches Cisco Business de la serie 350 son una familia de switches Ethernet administrados de configuración fija. Los modelos están disponibles con 8 a 48 puertos de conectividad Gigabit Ethernet y enlaces ascendentes Gigabit o 10 Gigabit, lo que brinda una flexibilidad óptima para crear exactamente el bloque de construcción adecuado para redes de oficinas pequeñas. Sin embargo, a diferencia de otras soluciones de conmutación para pequeñas empresas que brindan capacidades de red administradas solo en los modelos más costosos, todos los conmutadores Cisco Business de la serie 350 admiten las capacidades de administración de seguridad avanzadas y las funciones de red que necesita para admitir tecnologías inalámbricas, de seguridad, de voz y de datos de clase empresarial. . Al mismo tiempo, estos conmutadores son fáciles de implementar y configurar, lo que le permite aprovechar los servicios de red administrados que su empresa necesita.', 423, 467, NULL, 0),
(8302, '165104O', 'Switch Cisco CBS350-48FP-4G - 48 Puertos - Gigabit - PoE - 4 SFP - Gestionado FULL POE  4X1G SFP', 0, 'pending', 'hidden', 0, 0.31, 0.31, 0.31, 'Los conmutadores Cisco Business de la serie 350, que forman parte de la línea de soluciones de red Cisco Business, son una cartera de conmutadores gestionados asequibles que proporcionan un componente fundamental para cualquier red de oficina pequeña. El panel de control intuitivo simplifica la configuración de la red y las funciones avanzadas aceleran la transformación digital, mientras que la seguridad generalizada protege las transacciones críticas de la empresa. Los switches Cisco Business de la serie 350 brindan la combinación ideal de asequibilidad y capacidades para oficinas pequeñas y lo ayudan a crear una fuerza laboral más eficiente y mejor conectada.\n\nLos switches Cisco Business de la serie 350 son una familia de switches Ethernet administrados de configuración fija. Los modelos están disponibles con 8 a 48 puertos de conectividad Gigabit Ethernet y enlaces ascendentes Gigabit o 10 Gigabit, lo que brinda una flexibilidad óptima para crear exactamente el bloque de construcción adecuado para redes de oficinas pequeñas. Sin embargo, a diferencia de otras soluciones de conmutación para pequeñas empresas que brindan capacidades de red administradas solo en los modelos más costosos, todos los conmutadores Cisco Business de la serie 350 admiten las capacidades de administración de seguridad avanzadas y las funciones de red que necesita para admitir tecnologías inalámbricas, de seguridad, de voz y de datos de clase empresarial. . Al mismo tiempo, estos conmutadores son fáciles de implementar y configurar, lo que le permite aprovechar los servicios de red administrados que su empresa necesita.', 423, 467, NULL, 0),
(8303, '165104P', 'Switch Cisco Small Business Series 250 - 48 Puertos - Gigabit - 4 SFP+ - Gestionado SFP+', 0, 'pending', 'hidden', 0, 0.54, 0.54, 0.54, 'Cree una red empresarial confiable y fácil de usar a un precio asequible\n\nEn el mundo hiperconectado de hoy, el acceso confiable a los recursos de la red es fundamental para todas las empresas. Sin embargo, también debe invertir sabiamente para mantenerse competitivo, sabiendo cómo separar lo esencial de lo extraño y obtener el máximo valor por su dólar. Para invertir en infraestructura de red, es esencial construir una base sólida para su negocio, pero eso no significa que necesite el conjunto de funciones más avanzadas del mercado.\n\nPara las empresas que requieren alto rendimiento, seguridad avanzada y una gran capacidad de administración de la red, los conmutadores completamente administrados son una excelente opción. Sin embargo, también suelen tener etiquetas de precio elevado. Los conmutadores inteligentes proporcionan el nivel adecuado de funciones y capacidades de red para empresas en crecimiento a un precio más bajo, por lo que tendrá más dólares para invertir en otras áreas de su negocio.\n\nCon los conmutadores inteligentes Cisco® de la serie 250, puede lograr un rendimiento y seguridad de red de clase empresarial sin tener que pagar por funciones de red avanzadas que no utilizará. Cuando necesita una solución confiable para compartir recursos en línea y conectar computadoras, teléfonos y puntos de acceso inalámbricos, pero el bajo costo es una prioridad principal, los conmutadores inteligentes Cisco de la serie 250 brindan la solución ideal.\n\nLa serie 250 de Cisco es la próxima generación de conmutadores inteligentes asequibles que combinan un rendimiento y una fiabilidad de red potentes con un conjunto completo de funciones de red que necesita para una red empresarial sólida. Estos potentes conmutadores Fast Ethernet o Gigabit Ethernet, con enlaces ascendentes Gigabit o 10 Gigabit Ethernet, brindan múltiples opciones de administración, capacidades de seguridad sofisticadas, calidad de servicio (QoS) ajustada y características de enrutamiento estático de capa 3 que van mucho más allá de las de un sistema no administrado o conmutador de nivel de consumidor, a un costo menor que para los conmutadores totalmente administrados. Y con una interfaz de usuario web fácil de usar, una aplicación de red inteligente y la capacidad de Power over Ethernet Plus (PoE +), puede implementar y configurar una red empresarial completa en minutos.', 423, 467, NULL, 0),
