(8418, '94401D4', 'Tablet Lenovo Tab M10 10.1\", 64GB, 1280 x 800 Pixeles, 4G, Android 10, Bluetooth 5.0, Gris LTE 5.0MP/8.0MP ANDROID 1YW', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'La Tab M10 de Lenovo es una impresionante tablet familiar. Su pantalla FHD y altavoces frontales duales ofrecen un entretenimiento envolvente. Y todo ello incluido en un perfil extremadamente fino y ligero. Incluye además el paquete opcional para niños para que tus hijos puedan usarla sin preocupaciones. Querrás compartirla.\n\n', 438, 490, NULL, 0),
(8419, '94401D5', 'Tablet Lenovo Tab M7 - 7\" - MediaTek MT8765 - 1GB - 16GB - Cámaras 2MP - Android Pie Go Edition E CAM 2.0MP/8.0MP ANDROID 1YW', 0, 'pending', 'hidden', 0, 0.12, 0.12, 0.12, 'Diseño premium y repleto de funciones\n\nNo sacrifique la estética por la asequibilidad. La Tab M7 se ve muy bien y tiene muchas funciones de entretenimiento. Con el último sistema operativo Android Pie, esta tableta le brinda acceso a todas sus aplicaciones favoritas disponibles en la tienda Google Play. También disfrutará de la pantalla con certificación TÜV® que reduce los niveles dañinos de luz azul, por lo que puede mirar esta tableta durante períodos de tiempo más largos sin lastimar sus ojos.', 438, 490, NULL, 0),
(8420, '94401D6', 'Tablet Lenovo Tab M8 8\", 32GB, 1280 x 800 Pixeles, Android 9.0, Bluetooth 5.0, Gris/Acero CAM 2.0MP/5.0MP ANDROID 1YW', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'La Tab M8 (2.ª generación) es una pequeña tablet impresionante. Su elegante diseño metálico, su espectacular pantalla HD y su altavoz con tecnología Dolby Audio? se unen para ofrecerte un entretenimiento agradable y un atractivo de lujo. Gracias al procesador de cuatro núcleos y la batería con hasta 18 horas de autonomía de esta tablet, estarás entretenido todo el día con tus aplicaciones favoritas de Google Play Store.\n\n', 438, 490, NULL, 0),
