(8424, '94401DD', 'Tablet Lenovo Tab M10 10.1\", 32GB, 1280 x 800 Pixeles, Android 9.0, Bluetooth 4.2, Negro S QUALCOMM 2G 32GB ANDROID 1YW', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'La Tab M10 de Lenovo es una impresionante tablet familiar. Su pantalla FHD y altavoces frontales duales ofrecen un entretenimiento envolvente. Y todo ello incluido en un perfil extremadamente fino y ligero. Incluye además el paquete opcional para niños para que tus hijos puedan usarla sin preocupaciones. Querrás compartirla.\n\n', 438, 464, NULL, 0),
(8425, 'A04083X', 'Auriculares Apple AirPods Max Con cable/Inalámbrico Sobre la cabeza Estéreo - Gris - Binaural - Circumaural - Bluetooth - Cancelación de ruido - Conector Lightning .', 0, 'pending', 'hidden', 0, 0.24, 0.24, 0.24, 'Auriculares Apple AirPods Max Con cable / Inalámbrico Sobre la cabeza Estéreo - Gris - Binaural - Circumaural - Bluetooth - Cancelación de ruido - Conector Lightning\n\nDiseño\n\nUna composición radicalmente original Los auriculares supraaurales se han reinventado por completo. Desde el cojín hasta el dosel, los AirPods Max están diseñados para un ajuste sin concesiones que crea el sello acústico óptimo para muchas formas de cabeza diferentes, sumergiéndote por completo en cada sonido. El dosel que abarca la diadema está hecho de una malla de punto transpirable, distribuyendo el peso para reducir Presión de la cabeza. El marco de acero inoxidable está envuelto con un material suave al tacto para una combinación notable de resistencia, flexibilidad y comodidad. Los brazos telescópicos se extienden suavemente y permanecen donde los colocas, para un ajuste y sellado consistentes. Las copas de aluminio bellamente anodizado cuentan con un mecanismo revolucionario que permite que cada copa gire de forma independiente y equilibre la presión. Un tejido de malla de diseño personalizado envuelve las almohadillas para los oídos para brindar una suavidad similar a la de una almohada mientras se escucha. Crea un sello envolvente que es la base de un sonido increíble. La corona digital te permite controlar con precisión el volumen, saltar entre pistas, contestar el teléfono c alls y activa Siri.\n\nCinco colores.\n\nTodo menos monótono Calidad de audio Suena como una epifanía Los AirPods Max combinan audio de alta fidelidad con la cancelación activa de ruido líder en la industria para brindar una experiencia auditiva incomparable. Cada parte de su controlador personalizado funciona para producir sonido con una distorsión ultrabaja en todo el rango audible. Desde graves profundos y ricos hasta medios precisos y agudos nítidos y limpios, escuchará cada nota con una nueva sensación de claridad.Escucha inmersivaPara cancelar el sonido externo no deseado, los AirPods Max utilizan un total de seis micrófonos orientados hacia el exterior para detectar el ruido en su entorno y dos micrófonos orientados hacia el interior para medir lo que está escuchando. Los micrófonos de formación de haces ayudan a aislar su voz en las llamadas telefónicas, por lo que se escucha con claridad, incluso en situaciones de viento. Escuche cada detalle El controlador dinámico diseñado por Apple produce un amplio rango de frecuencia que descubre los ricos detalles de cada sonido, entregando sus canciones favoritas con una textura nunca antes escuchada. Reproducción sin distorsiones Siguiendo el modelo de los altavoces de piso de alta gama, el motor magnético de anillo de neodimio dual del controlador minimiza la distorsión armónica total en todo el rango audible. El resultado es una reproducción nítida y constante, incluso a todo volumen.', 419, 495, NULL, 0),
