(8450, 'A04083Y', 'Auriculares Apple AirPods Max Con cable/Inalámbrico Sobre la cabeza Estéreo - Plata - Binaural - Circumaural - Bluetooth - Cancelación de ruido - Conector Lightning  .', 0, 'pending', 'hidden', 0, 0.34, 0.34, 0.34, 'Auriculares Apple AirPods Max Con cable / Inalámbrico Sobre la cabeza Estéreo - Plata - Binaural - Circumaural - Bluetooth - Cancelación de ruido - Conector Lightning\n\nDiseño\n\nUna composición radicalmente original.\n\nLos auriculares supraaurales se han reinventado por completo. Desde el cojín hasta el dosel, los AirPods Max están diseñados para un ajuste sin concesiones que crea el sello acústico óptimo para muchas formas de cabeza diferentes, sumergiéndote por completo en cada sonido.\n\nEl dosel que abarca la banda para la cabeza está hecho de una malla de punto transpirable que distribuye el peso para reducir la presión sobre la cabeza.\n\nEl marco de acero inoxidable está envuelto con un material suave al tacto para una combinación notable de resistencia, flexibilidad y comodidad.\n\nLos brazos telescópicos se extienden suavemente y permanecen donde los colocas, para un ajuste y sellado consistentes.\n\nLas copas de aluminio bellamente anodizado cuentan con un mecanismo revolucionario que permite que cada copa gire de forma independiente y equilibre la presión.\n\nUn tejido de malla de diseño personalizado envuelve las almohadillas para los oídos para brindar una suavidad similar a la de una almohada mientras escucha.\n\nFabricadas con espuma viscoelástica diseñada acústicamente, las almohadillas crean un sello envolvente que es la base de un sonido increíble.\n\nLa corona digital le permite controlar con precisión el volumen, saltar entre pistas, contestar llamadas telefónicas y activar Siri.\n\nCinco colores.\n\nCualquier cosa menos monótona.\n\nCalidad de audio\n\nSuena a epifanía.\n\nLos AirPods Max combinan audio de alta fidelidad con la cancelación activa de ruido líder en la industria para brindar una experiencia auditiva incomparable. Cada parte de su controlador personalizado funciona para producir sonido con una distorsión ultrabaja en todo el rango audible. Desde graves profundos y ricos hasta medios precisos y agudos nítidos y limpios, escuchará cada nota con una nueva sensación de claridad.\n\nEscucha inmersiva\n\nPara cancelar el sonido externo no deseado, AirPods Max usa un total de seis micrófonos orientados hacia el exterior para detectar el ruido en su entorno y dos micrófonos orientados hacia el interior para medir lo que está escuchando. Los micrófonos con formación de haces ayudan a aislar su voz en las llamadas telefónicas, para que se escuche con claridad, incluso en situaciones de viento.\n\nEscucha cada detalle\n\nEl controlador dinámico diseñado por Apple produce un amplio rango de frecuencia que descubre los ricos detalles de cada sonido, entregando sus canciones favoritas con una textura y precisión nunca antes escuchadas.\n\nReproducción sin distorsiones\n\nSiguiendo el modelo de los de los altavoces de suelo de alta gama, el motor magnético de anillo de neodimio dual del controlador minimiza la distorsión armónica total en todo el rango audible. El resultado es una reproducción nítida y constante, incluso a todo volumen.', 419, 495, NULL, 0),
