(8468, 'F63016L', 'Memoria RAM HyperX Impact Black DDR3L, 1600MHz, 8GB, CL9, SO-DIMM, 1.35v 1600 MHZ CL9 NEGRO', 0, 'pending', 'hidden', 0, 0.06, 0.06, 0.06, 'Impacta con tu juego\nLas memorias Impact HyperX® cuentan con la frecuencia SO-DIMM más rápida del mundo ? 2666MHz ? para mantenerte en la delantera todo el tiempo y liderar el juego. Reconoce la plataforma a la cual está conectada y realiza overclocking automáticamente a la frecuencia más alta publicada (hasta 2133MHz) sin necesidad de realizar ajustes en el BIOS. Obtendrás un rendimiento extremo y podrás hacerlo con tu notebook, AMD o CPU y también con la última tecnología Intel sin tener ningún tipo de problema... ¡incluso si eres un noob!\n\nCon Impact la diversión y el juego nunca paran y tu sistema no se, recalienta. Sus ajustes de bajo voltaje de sólo 1,35V consumen menos energía, reducen la generación de calor y hace que tu máquina sea silenciosa. Su nuevo aspecto delgado y llamativo se destaca de la multitud y su delgada etiqueta termal, permite la instalación en notebooks de factor de forma pequeño o ultra-delgadas.\n\nY la mejor parte es que Impact de HyperX te brinda un alto rendimiento a un muy bajo costo. Cuenta con la aprobación de los profesionales del mundo de los juegos y está respaldada por una garantía de por vida, soporte técnico gratuito y la confiabilidad legendaria de Kingston.', 436, 486, NULL, 0),
(8469, 'A6400GJ', 'Targus Mochila de Nylon Terra para Laptop 15.6\", Negro PARA PORTATIL  NEGRO/ROJO TARGUS', 0, 'pending', 'hidden', 0, 0.16, 0.16, 0.16, 'Estuche de transporte Targus Terra TSB226LA (Mochila) para 40.6cm (16\") Portátil - Negro, Rojo - Resistente al agua Parte Inferior - Poliéster 840D - Correa de Hombro, Correa de mano\n\nTargus goza del reconocimiento mundial como proveedor líder de productos para el estilo de vida móvil. Fundada en 1983, la compañía sigue estableciendo los estándares de excelencia en protección, fabricación artesanal y funcionalidad de los maletines de transporte y los accesorios para la vida móvil.', 456, 502, NULL, 0),
