(8472, '346034F', 'Laptop Acer Chromebook Spin 13 CP713-2W-35DH 13.5\", Intel Core i3-10110U 2.10GHz, 8GB, 64GB eMMc, Chrome OS, Gris/Acero CORE I3 8GB RAM 64GB EMMC 13.5  QHD', 0, 'pending', 'hidden', 0, 0.08, 0.08, 0.08, 'Chromebook 2 en 1 - Acer Chromebook Spin 713 CP713-2W CP713-2W-35DH 34.3cm (13.5\") Pantalla Táctil - 2256 x 1504 - Intel Core i3 (10a Gen) i3-10110U Dual-core (2 núcleos) 2.10GHz - 8GB RAM - 64GB Memoria flash - Chrome OS - Intel UHD Graphics - CineCrystal (Resplandor), Tecnología conmutación en el mismo plano (In-plane Switching, IPS) - Español Teclado - 10Hora(s) Duración de pilas - IEEE 802.11 a/b/g/n/ac/ax Wireless LAN Standard\n\nCuando se encuentra en movimiento, necesita una computadora portátil que pueda seguir su ritmo. Con un procesador Intel® Core? i7 de 10 generación, esta Chromebook se activa del modo de hibernación en menos de un segundo y también cuenta con una batería de 10 horas de duración. Chrome Enterprise simplifica la manera en que dirige la empresa. Reduzca los costos, simplifique las operaciones, reduzca los riesgos de seguridad y disminuya considerablemente los recursos de TI necesarios mediante la posibilidad de implementar, actualizar y administrar todos los dispositivos a cualquier escala.', 418, 484, NULL, 0),
