(8475, 'B4000HR', 'Router TP-Link SafeStream TL-R605, Alámbrico, 4x RJ-45 MULTI-WAN TP-LINK CONTINENTAL', 0, 'pending', 'hidden', 0, 0.25, 0.25, 0.25, 'Enrutador VPN Gigabit Multi-WAN profesional, seguro y confiable con capacidad de administración centralizada\n\nSafeStream TL-R605\n\nOmada SDN: la solución en la nube más inteligente para redes empresariales\n\nComo la puerta de enlace que se integra a la perfección en la plataforma Omada Software Defined Networking (SDN), TL-R605 permite la administración remota y centralizada, en cualquier lugar y en cualquier momento. La administración independiente a través de la interfaz de usuario web o la aplicación también está disponible para maximizar la comodidad.\n\nGestión centralizada en la nube sin complicaciones:\n\nGestión en la nube 100% centralizada de toda la red desde diferentes sitios, todo controlado desde una única interfaz en cualquier lugar y en cualquier momento.\n\nHasta cuatro puertos WAN Gigabit para optimizar el uso del ancho de banda\n\nTres puertos libremente intercambiables que se pueden configurar para WAN o LAN permiten que el enrutador admita hasta cuatro puertos WAN para satisfacer varios requisitos de acceso a Internet a través de un dispositivo. La función de equilibrio de carga de múltiples WAN distribuye los flujos de datos de acuerdo con la proporción de ancho de banda de cada puerto WAN para aumentar la tasa de utilización de la banda ancha de múltiples líneas.\n\nVPN altamente segura\n\nTL-R605 admite IPSec / PPTP / L2TP VPN sobre protocolos IPSec / SSL. Con un poderoso diseño de hardware, el enrutador admite y administra hasta 20 × LAN-a-LAN IPsec, 16 × OpenVPN, 16 × L2TP y 16 × conexiones VPN PPTP. La VPN IPSec automática con un solo clic simplifica enormemente la configuración de la VPN y facilita la administración y la implementación de la red, al mismo tiempo que protege y encripta las comunicaciones de datos privadas de un sitio a otro que viajan a través de Internet.\n\nAbundantes funciones de seguridad\n\nCortafuegos potente\n\nLas políticas de firewall avanzadas protegen su red y sus datos.\n\nConveniente soporte de VLAN\n\nCree segmentos de red virtual para mejorar la seguridad y simplificar la gestión de la red.\n\nDefensa DoS\n\nDetecta y bloquea automáticamente ataques de denegación de servicio (DoS) como TCP / UDP / ICMP Flooding, Ping of Death y otras amenazas relacionadas.\n\nFiltrado de IP / MAC / URL\n\nEvite con fuerza los virus y los ataques de intrusos.\n\nEnlace IP-MAC\n\nReserva la asignación de IP estática para que los clientes se defiendan contra ataques ARP y suplantación de identidad.\n\nActivación ALG con un clic\n\nActivación ALG con un clic para aplicaciones como FTP, H323, SIP, IPsec y PPTP.\n\nEstrategia de gestión del acceso a Internet\n\nEstandarice el comportamiento en línea de los usuarios y especifique fácilmente los derechos y las estrategias de acceso a Internet del empleado a través del filtrado de IP / MAC / URL y la lista de control de acceso (ACL). La autenticación del portal cautivo facilita el control de los recursos de la red al capturar, autenticar y clasificar el acceso de los usuarios. También se pueden asignar recursos de red apropiados para usuarios o invitados particulares.\n\nFácil administración con la aplicación Omada\n\nSiga las instrucciones de configuración de la aplicación gratuita Omada para configurarla en minutos. Omada le permite configurar ajustes, monitorear el estado de la red y administrar clientes, todo desde la comodidad de un teléfono inteligente o tableta.', 458, 468, NULL, 0),
(8476, 'B4000HT', 'Router TP-Link Ethernet Firewall ARCHER C24, Inalámbrico, 433Mbit/s, 5x RJ-45, 2.4/5GHz, 4 Antenas Externas 50', 0, 'pending', 'hidden', 0, 0.25, 0.25, 0.25, 'Duplicar el ancho de banda con doble banda\n\nEl WiFi de doble banda de CA le permite conectar sus dispositivos exigentes a la banda de 5 GHz más rápida y clara, mientras que una banda tradicional de 2,4 GHz proporciona una conexión estable y de largo alcance con el resto de sus dispositivos.\n\nEstable y de gran alcance\n\nCon antenas 4 × distribuidas en diagonal, Archer C24 cubre más direcciones y amplía la cobertura WiFi, lo que permite navegar sin búfer y descargar sin interrupciones.\n\nMultimodo 3 en 1\nModo de enrutador (predeterminado)\n\nConecte un cable Ethernet para crear instantáneamente una red inalámbrica privada y compartir el acceso a Internet con todos sus dispositivos Wi-Fi.\n\nModo de punto de acceso\n\nTransforme su red cableada existente en una inalámbrica.\n\nModo extensor de rango\n\nAumente la cobertura inalámbrica existente en su hogar.\n\nMás funciones a pesar del tamaño\n\nGestión versátil\n\nAdministre fácilmente su red doméstica con herramientas integradas versátiles, que incluyen controles parentales, red de invitados, QoS y más.\n\nControles parentales\n\nBloquear contenido\n\nLimite el tiempo en línea\n\nRed de invitados\n\nUsa una contraseña diferente\n\nRed privada segura\n\nQoS\n\nPriorizar dispositivos\n\nAlta integración, tamaño compacto\n\nLa estructura del sistema de Archer C24 se centra en crear una WiFi óptima. La tecnología de semiconductores avanzada ayuda a integrar unidades que incluyen CPU, memoria y una unidad de procesamiento de 3 flujos en un solo chip para lograr una alta compatibilidad, brindándole la misma potencia con un diseño compacto.\n\nTan estable como uno más grande\n\nArcher C24 pasa por rigurosas pruebas repetidas para garantizar un producto final confiable en varios entornos extenuantes. El resultado final: 8 enrutadores Archer C24 seleccionados al azar probados colectivamente durante 1936 horas.\n\nFácil configuración al alcance de su mano\n\nConfigure Archer C24 en minutos a través de su interfaz web intuitiva o la poderosa aplicación Tether. Tether también le permite administrar su configuración de red desde cualquier dispositivo Android o iOS.', 458, 468, NULL, 0),
(8477, 'B4000HU', 'Access Point TP-Link de Banda Dual EAP620 HD, 1800Mbit/s, 1x RJ-45, 2.4/5GHz, 1 Antena Integrada de 6dBi MONTAJE EN TECHO DE DOBLE BANDA AX1', 0, 'pending', 'hidden', 0, 0.03, 0.03, 0.03, 'Conectividad de alta densidad con capacidad 4 veces mayor\n\nOFDMA y Uplink & Downlink MU-MIMO aumentan la capacidad de la red hasta 4 veces en comparación con Wi-Fi 5 (802.11ac) en entornos de alta densidad para conectar más dispositivos simultáneamente. Aproveche las capacidades multiusuario y actualice su negocio como nunca antes.\n\nHospitalidad\n\nWi-Fi de alta calidad y cobertura total\n\nRestaurante\n\nCobertura completa de Wi-Fi en entornos de alta densidad\n\nCentro comercial\n\nMarketing social para O2O\n\nSala de Reuniones\n\nConexiones inalámbricas y por cable para uso denso\n\nEstación de ferrocarril\n\nWi-F de alta densidad\n\nVelocidad Wi-Fi avanzada con 4 transmisiones espaciales\n\nEl punto de acceso Omada Wi-Fi 6 presenta las últimas tecnologías 802.11ax como 1024 QAM y Long OFDM Symbol, lo que permite que el EAP aumente las velocidades generales hasta 1775 Mbps (1201 Mbps en una banda de 5 GHz y 574 Mbps en una banda de 2.4 GHz ). Con 8 flujos espaciales, el rendimiento multiusuario aumenta increíblemente para impulsar más aplicaciones.\n\nSolución en la nube Omada SDN-Smarter para redes empresariales\n\nLa plataforma Omada Software Defined Networking (SDN) integra dispositivos de red que incluyen puntos de acceso, conmutadores y puertas de enlace, lo que garantiza una red comercial potente con mayor eficiencia, mayor seguridad y mayor confiabilidad.\n\nGestión centralizada en la nube sin complicaciones:\n\nGestión en la nube 100% centralizada de toda la red desde diferentes sitios, todo controlado desde una única interfaz en cualquier lugar y en cualquier momento.\n\nRoaming sin interrupciones\n\nEl roaming 802.11k / v cambia a los clientes automáticamente al AP con la señal óptima con una transición perfecta al moverse. Esto permite que las aplicaciones sensibles como VoIP y videoconferencias no se interrumpan.\n\nAumente la eficiencia de la red en todos los aspectos con funciones avanzadas avanzadas\n\nDirección de banda\n\nMueve automáticamente los dispositivos de doble banda a la banda más amplia de 5 GHz para conexiones más rápidas.\n\nEquilibrio de carga\n\ngarantiza que un gran número de usuarios tengan experiencias de red fluidas en redes comerciales de alta densidad\n\nEquidad de tiempo aire\n\nAumenta el rendimiento medio de la red en entornos muy congestionados.\n\nFácil de montar con un diseño industrial refinado\n\nhacer subir\nsimplemente gire para bloquear\nRed de invitados segura con Facebook Wi-Fi e inicio de sesión por SMS\n\nGuest Network proporciona un acceso elevado y seguro a los invitados que comparten su red Wi-Fi, con un portal cautivo que ayuda a mantener solo a los invitados autorizados para usar la red. La adición de autenticación por SMS y Facebook simplifica aún más el portal cautivo para simplificar la conectividad y potenciar su negocio.', 458, 468, NULL, 0);
