(8478, 'B4000HV', 'Access Point TP-Link de Banda Dual EAP660 HD, 2500 Mbit/s, 1x RJ-45, 2.4/5GHz, Antena Integrada de 5dBi TECHO INALÁMBRICO MULTI-GIGABIT AX3', 0, 'pending', 'hidden', 0, 0.32, 0.32, 0.32, 'Conectividad de alta densidad con capacidad 4 veces mayor\n\nOFDMA y Uplink & Downlink MU-MIMO aumentan la capacidad de la red hasta 4 veces en comparación con Wi-Fi 5 (802.11ac) en entornos de alta densidad para conectar más dispositivos simultáneamente. Aproveche las capacidades multiusuario y actualice su negocio como nunca antes.\n\nHospitalidad\nWi-Fi de alta calidad y cobertura total\n\nRestaurante\nCobertura completa de Wi-Fi en un entorno de alta densidad\n\nCentro comercial\nMarketing social para O2O\n\nSala de Reuniones\nConexiones inalámbricas y por cable para uso denso\n\nEstación de ferrocarril\nWi-F de alta densidad\n\nVelocidad ultrarrápida con 8 flujos espaciales\n\nEl punto de acceso Omada Wi-Fi 6 presenta las últimas tecnologías 802.11ax como 1024 QAM y Long OFDM Symbol, lo que permite que el EAP aumente las velocidades generales hasta 3550 Mbps (2402 Mbps en una banda de 5 GHz y 1148 Mbps en una banda de 2.4 GHz ). Con 8 flujos espaciales, el rendimiento multiusuario aumenta increíblemente para impulsar más aplicaciones.\n\nSolución en la nube Omada SDN-Smarter para redes empresariales\n\nLa plataforma Omada Software Defined Networking (SDN) integra dispositivos de red que incluyen puntos de acceso, conmutadores y puertas de enlace, lo que garantiza una red comercial potente con mayor eficiencia, mayor seguridad y mayor confiabilidad.\n\nGestión centralizada en la nube sin complicaciones:\n\nGestión en la nube 100% centralizada de toda la red desde diferentes sitios, todo controlado desde una única interfaz en cualquier lugar y en cualquier momento.\n\nRendimiento cableado optimizado con puerto PoE + de 2.5 GE\n\nArmado con un puerto Ethernet de 2.5 Gigabit, el EAP660 HD ofrece un rendimiento excepcional de varios gigabits para respaldar la demanda insaciable de una conexión Wi-Fi mejor y más rápida. La compatibilidad con el estándar 802.3at PoE + es ideal para una implementación flexible.\n\nRoaming sin interrupciones\n\nEl roaming 802.11k / v cambia a los clientes automáticamente al AP con la señal óptima con una transición perfecta cuando se mueven. Esto permite que las aplicaciones sensibles como VoIP y videoconferencias no se interrumpan.\n\nAumente la eficiencia de la red en todos los aspectos con funciones avanzadas avanzadas\n\nDirección de banda\nMueve automáticamente los dispositivos de doble banda a la banda más amplia de 5 GHz para conexiones más rápidas.\n\nEquilibrio de carga\ngarantiza que un gran número de usuarios tengan experiencias de red fluidas en redes comerciales de alta densidad\n\nEquidad de tiempo aire\nAumenta el rendimiento medio de la red en entornos muy congestionados.\n\nFácil de montar con un diseño industrial refinado\n\nhacer subir\nsimplemente gire para bloquear\nRed de invitados segura con Facebook Wi-Fi e inicio de sesión por SMS\n\nGuest Network proporciona un acceso elevado y seguro a los invitados que comparten su red Wi-Fi, con un portal cautivo que ayuda a mantener solo a los invitados autorizados para usar la red. La adición de autenticación por SMS y Facebook simplifica aún más el portal cautivo para simplificar la conectividad y potenciar su negocio.', 458, 468, NULL, 0),
(8479, 'B4000HW', 'Smart Plug TP-Link  Tapo P100, WiFi, 1 Conector, 2990W, 10A, Blanco, 2 Piezas NTE 2 PIEZAS', 0, 'pending', 'hidden', 0, 0.19, 0.19, 0.19, 'El socio inteligente superior para pequeños electrodomésticos\n\nMini enchufe Wi-Fi inteligente P100\n\nControl remoto\nProgramación y temporizador\nControl de voz\nDiseño compacto\nModo ausente\nCompartir con la familia\nMúltiples garantías de seguridad\nConfiguración fácil\n\nControl remoto desde cualquier lugar\n\nEncienda / apague instantáneamente los dispositivos conectados donde quiera que esté a través de la aplicación Tapo. Diseñado para facilitar su vida y ayudar a eliminar posibles peligros de seguridad.\n\nViva de forma más inteligente mediante la configuración de la hora\n\nLas funciones de programación y temporizador le permiten crear programas semanales y planes de cuenta regresiva. Todos sus dispositivos electrónicos conectados funcionarán automáticamente a la hora preestablecida, lo que hará que su vida sea inteligente, conveniente y que ahorre energía.\n\nLibera tus manos con el control por voz\n\nCaracterísticas poderosas y tamaño compacto\n\nTapo P100 está construido en tamaño pequeño para dejar abiertos los enchufes adyacentes, lo que lo hace conveniente para el uso diario.\n\nUn elemento disuasorio para su hogar\n\nEl modo Ausente, una función que simula inteligentemente que alguien está en casa al encender y apagar el dispositivo enchufado (como una lámpara), hace que parezca que alguien está en casa cuando estás en viajes largos para mantener alejadas a las personas con malas intenciones.\n\nCompartir con las familias\n\nSin limitarse al control único, los miembros de la familia pueden compartir directamente los permisos de administración entre sí, lo que ahorra tiempo y mejora la facilidad de uso para las personas mayores.\n\nMúltiples garantías de seguridad\n\nBajo estricta inspección de calidad por el laboratorio de TP-Link y certificación por autoridad global.\nLos materiales ignífugos UL94-V0 PC ayudan a minimizar los peligros de quemaduras.\nAlmacenamiento automático después de que se apaga o se pierde la conexión.\nLa cubierta de seguridad deslizante evita descargas eléctricas.\nInspeccion de calidad\nMaterial ignífugo\nAlmacenamiento automático\nCubierta de seguridad deslizante', 458, 468, NULL, 0),
(8480, 'B4000HY', 'Switch TP-Link Fast Ethernet TL-SF1008LP, 8 Puertos 10/100Mbps, 1.6 Gbit/s, 2000 Entradas - No Administrable OS A 10 / 100MBPS CON POE EN 4 PUER', 0, 'pending', 'hidden', 0, 0.22, 0.22, 0.22, 'Conmutador Fast Ethernet profesional con 4 puertos PoE\n\nPlug and Play, con transmisión PoE para vigilancia hasta 250 m\n\nTL-SF1008L\n\nPresupuesto de 41 W PoE\nConecta y reproduce\nDistancia de transmisión hasta 250 m\nModo de prioridad de un clic\nGestión de energía inteligente\nCarcasa de metal duradera\nConmutador PoE dedicado de 4 puertos (presupuesto de 41 W) para numerosas aplicaciones\n\nEl cumplimiento del estándar 802.3af PoE admite hasta 15,4 W en cada puerto PoE. El presupuesto total de energía PoE de 41 W para los 4 puertos PoE abre una amplia gama de aplicaciones, como vigilancia para oficinas, dormitorios y pequeñas empresas. Es totalmente compatible con cámaras IP, puntos de acceso, teléfonos IP, computadoras, impresoras y más.\n\nPlug and Play, no se requiere configuración\n\nIdeal para vigilancia IP: transmisiones de hasta 250 m\n\nCon el modo extendido, la distancia de transmisión PoE alcanza hasta 250 m, ideal para el despliegue de cámaras IP en grandes áreas.\n\nCalidad de video prioritaria garantizada\n\nLa calidad de las aplicaciones sensibles como el monitoreo de video en áreas comerciales críticas está garantizada al ofrecer opciones de mayor prioridad para los puertos 1-2 cuando el modo de prioridad de un toque está activado.\n\nGestión de energía inteligente\n\nCuando el consumo total de energía excede los 41 W, la administración inteligente de energía cortará la energía del puerto de menor prioridad. Esto asegura la fuente de alimentación del puerto de alta prioridad y protege el dispositivo de una sobrecarga de energía. También detecta automáticamente y proporciona la energía requerida para sus dispositivos PoE mientras protege su equipo PoE y no PoE contra daños.\n\nCarcasa de metal duradera\n\nLos componentes interiores de TL-SF1008LP están protegidos por una carcasa de metal de alta calidad para garantizar una larga vida útil del producto. Habiendo pasado una serie de estrictas pruebas de fiabilidad, TL-SF1008LP ofrece un rendimiento de conmutación en el que puede confiar.', 458, 467, NULL, 0),
(8481, 'B4000I0', 'Switch TP-Link Fast Ethernet TL-SF1009P, 9 Puertos 10/100Mbps, 1.8 Gbit/s, 2.000 Entradas - No Administrable OS A 10/100 MBPS CON 4 PUERTOS POE+', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Switch profesional no administrado de 9 puertos con 8 puertos PoE +\n\nPlug and Play, con transmisión PoE para vigilancia hasta 250 m\n\nTL-SF1009P\n\nSwitch profesional de 9 puertos con PoE + de 8 puertos (65 W de presupuesto) para numerosas aplicaciones\n\nEl cumplimiento del estándar 802.3af / at PoE + admite hasta 30 W en cada puerto PoE. El presupuesto total de energía PoE de 65 W para los 8 puertos PoE + abre una amplia gama de aplicaciones, como vigilancia para oficinas, dormitorios y pequeñas empresas. Es totalmente compatible con cámaras IP, puntos de acceso, teléfonos IP, computadoras, impresoras y más.\n\nPlug and Play, no se requiere configuración\n\nIdeal para vigilancia IP: transmisiones de hasta 250 m\n\nCon el modo extendido, la distancia de transmisión PoE alcanza hasta 250 m, ideal para el despliegue de cámaras IP en grandes áreas.\n\nIdeal para vigilancia IP: mayor rendimiento y seguridad\n\nEl modo de prioridad y el modo de aislamiento hacen que la vigilancia sea más fluida y segura.\n\nCalidad de video prioritaria garantizada\n\nLa calidad de las aplicaciones sensibles como el monitoreo de video en áreas comerciales críticas está garantizada al ofrecer opciones de mayor prioridad para los puertos 1-2 cuando el modo de prioridad de un toque está activado.\n\nSeparación de tráfico con un clic para los puertos 1-8\n\nCon un clic, el modo de aislamiento divide fácilmente el tráfico de los puertos 1-8 para evitar espionaje y manipulación. Esto permite que el conmutador aísle la tormenta de difusión, mejorando la seguridad de la LAN y la transmisión de datos.', 458, 467, NULL, 0),
(8482, 'B4000I1', 'Switch TP-Link Fast Ethernet TL-SF1006P, 6 Puertos 10/100Mbps, 1.2 Gbit/s, 2.000 Entradas - No Administrable OS A 10/100 MBPS CON 4 PUERTOS POE+', 0, 'pending', 'hidden', 0, 0.14, 0.14, 0.14, 'Switch profesional de alta potencia con 4 puertos PoE +\n\nPlug and Play, con transmisión PoE para vigilancia hasta 250 m\n\nTL-SF1006P\n\n67 W PoE Presupuesto\nConecta y reproduce\nDistancia de transmisión hasta 250 m\nModo de prioridad de un clic\nGestión de energía inteligente\nCarcasa de metal duradera\nConmutador PoE + de 4 puertos dedicado (67 W de presupuesto) para numerosas aplicaciones\n\nEl cumplimiento del estándar 802.3af / at PoE admite hasta 15,4 W en cada puerto PoE. El presupuesto total de energía PoE de 41 W para los 4 puertos PoE abre una amplia gama de aplicaciones, como vigilancia para oficinas, dormitorios y pequeñas empresas. Es totalmente compatible con cámaras IP, puntos de acceso, teléfonos IP, computadoras, impresoras y más.\n\nPlug and Play, no se requiere configuración\n\nIdeal para vigilancia IP: transmisiones de hasta 250 m\n\nCon el modo extendido, la distancia de transmisión PoE alcanza hasta 250 m, ideal para el despliegue de cámaras IP en grandes áreas.\n\nCalidad de video prioritaria garantizada\n\nLa calidad de las aplicaciones sensibles como el monitoreo de video en áreas comerciales críticas está garantizada al ofrecer opciones de mayor prioridad para los puertos 1-2 cuando el modo de prioridad de un toque está activado.\n\nGestión de energía inteligente\n\nCuando el consumo total de energía excede los 67 W, la administración inteligente de energía cortará la energía del puerto de menor prioridad. Esto asegura la fuente de alimentación del puerto de alta prioridad y protege el dispositivo de una sobrecarga de energía. También detecta automáticamente y proporciona la energía requerida para sus dispositivos PoE mientras protege su equipo PoE y no PoE contra daños.\n\nCarcasa de metal duradera\n\nLos componentes interiores del TL-SF1006P están protegidos por una carcasa de metal de alta calidad para garantizar una larga vida útil del producto. Habiendo pasado una serie de estrictas pruebas de fiabilidad, TL-SF1006P ofrece un rendimiento de conmutación en el que puede confiar.', 458, 467, NULL, 0),
(8483, '16511KS', 'Switch Cisco CBS110-16PP - 16 Puertos - Gigabit - No Gestionado PARTIAL POE', 0, 'pending', 'hidden', 0, 0.46, 0.46, 0.46, 'Switches asequibles plug-and-play para redes de pequeñas empresas\n\nReflejos\n\nVelocidades asequibles de 10/100/1000 Mbps para aplicaciones que requieren mucho ancho de banda\nPlug-and-play, no se requieren conocimientos de TI\nModelos de 5 a 24 puertos que se pueden montar en un escritorio o en un bastidor\nModelos Power over Ethernet para proporcionar energía a puntos de acceso, teléfonos IP y otros dispositivos\nDescripción del producto\n\nSon tiempos de cambios sin precedentes para las pequeñas empresas. Los consumidores son más exigentes que nunca. Las transacciones en línea se han acelerado. Si bien esta nueva promesa promete una mayor recompensa, también requiere que las pequeñas empresas aceleren la transformación digital. Al mismo tiempo, los empleados se distribuyen cada vez más en ubicaciones remotas y de oficinas, y es probable que esta tendencia continúe. Necesita una solución de red que proporcione acceso rápido y confiable a aplicaciones comerciales críticas basadas en la nube a través de una fuerza laboral remota y en la oficina.\n\nAhora puede tener una red de clase empresarial de alto rendimiento con los switches no administrados Cisco® Business de la serie 110. Estos asequibles conmutadores plug-and-play son ideales para oficinas pequeñas, grupos de trabajo, departamentos y oficinas en crecimiento con conocimientos y soporte de TI limitados.\n\nLos switches no administrados Cisco Business de la serie 110, que forman parte del portafolio de redes Cisco Business, son una familia de switches asequibles que brindan conectividad Gigabit Ethernet para la red de su pequeña empresa. Disponibles en modelos de escritorio y de montaje en bastidor, estos conmutadores están diseñados para adaptarse a cualquier pequeña empresa con necesidades básicas de red y están optimizados para la eficiencia energética. Proporcionan una sólida conectividad de red que su empresa demanda, así como una mayor confiabilidad con funciones avanzadas como calidad de servicio (QoS), detección de bucles y diagnóstico de cables, todo en un conmutador que puede configurar usted mismo en minutos. Los switches Cisco Business de la serie 110 brindan a su pequeña empresa la confiabilidad comprobada y la protección de la inversión de las soluciones de red de Cisco.', 422, 467, NULL, 0),
