(8496, 'C6300DI', 'Multifuncional HP LaserJet Enterprise MFP M430f  3 a 10 usuarios .', 0, 'pending', 'hidden', 0, 0.49, 0.49, 0.49, 'Fácil de usar, simple de administrar\nConfigure equipos de trabajo para el éxito sin agregar más a su plato. Ayude a las personas a manejar los negocios donde sea que sucedan mientras brinda a TI el control de toda la flota que necesita, utilizando una impresora compacta o MFP diseñada para un uso y administración simples.\n\nProtección de inversiones\nTrabaje pensando en el futuro. El firmware de HP FutureSmart se puede actualizar con las funciones más recientes para ayudar a proteger y optimizar su inversión en infraestructura de impresión en los próximos años. Obtenga controles de usuario consistentes e intuitivos en todos los dispositivos, incorpore sin problemas contenido digital y en papel para mejorar los flujos de trabajo e instale actualizaciones fácilmente según su horario.\n\nGestión de flotas optimizada\nCentralice el control de su entorno de impresión con HP Web Jetadmin. Agregue fácilmente nuevos dispositivos y soluciones, actualice funciones y aplique políticas corporativas para ayudar a desarrollar la eficiencia empresarial. Configure nuevas impresoras rápidamente, administre la configuración del dispositivo fácilmente y comience a imprimir las páginas que necesita de inmediato.\n\nExperiencias y resultados consistentes\nHabilite los flujos de trabajo en toda su flota con una experiencia uniforme e íconos intuitivos similares a tabletas que los administradores de TI y los usuarios finales reconocen, por lo que las tareas de acabado se sienten familiares en toda la flota. La tecnología de detección de medios ajusta automáticamente la configuración de impresión en una amplia variedad de tipos de papel, incluidos sustratos normales, brillantes y gruesos, para que obtenga resultados uniformes y de alta calidad.\n\nLa impresión más segura de HP\nLas impresoras HP cuentan con la seguridad más sólida de la industria porque siempre están en guardia, deteniendo continuamente las amenazas mientras se adaptan a las nuevas. Y las impresoras HP pueden recuperarse automáticamente de los ataques, por lo que TI no nec\n\nSiempre en guardia\nLas impresoras HP Enterprise ofrecen funciones de seguridad integradas que siempre están en guardia.\nCon HP Sure Start, cada dispositivo comprueba periódicamente su código operativo y se repara a sí mismo de los intentos de piratería.\nLa detección de intrusiones en tiempo de ejecución monitorea continuamente la actividad para detectar y detener ataques, luego se reinicia automáticamente.\nLa lista blanca comprueba el firmware durante el inicio para ayudar a garantizar que sea auténtico, buen código, firmado digitalmente por HP.\nHP Connection Inspector inspecciona las conexiones de red salientes para detener solicitudes sospechosas como malware.\nOpte por una seguridad más estricta\nAyude a proteger esta impresora con más de 100 funciones de seguridad integradas.\nProteja la información en tránsito a través de la red y almacenada en las claves del dispositivo, contraseñas, certificados y más mediante el módulo de plataforma confiable de HP integrado.\n\nEvite posibles ataques al recibir notificaciones instantáneas de posibles problemas de seguridad, de modo que se puedan tomar medidas inmediatas. Funciona con herramientas SIEM líderes como Splunk, ArcSight y McAfee.\n\nAyude a garantizar la seguridad de la información confidencial con PIN / impresión pull para recuperar trabajos de impresión.\n\nToda tu flota, bajo tu control\nCentralice el control de su entorno de impresión con HP Web Jetadmin y ayude a desarrollar la eficiencia empresarial. HP JetAdvantage Security Manager opcional ofrece un enfoque eficaz basado en políticas para ayudar a proteger los dispositivos de impresión e imagen de HP. Establezca fácilmente políticas de configuración de seguridad y valide automáticamente la configuración para cada impresora y multifunción HP habilitada en su flota.\nHP JetAdvantage Secure Print y HP Access Control (HPAC) ayudan a proteger los documentos al requerir autenticación para liberar los trabajos de impresión. Además, amplíe las capacidades y personalice fácilmente con la contabilidad de trabajos integrada con HPAC, administre derechos y establezca cuotas para cosas como el uso del color. Ahorre tiempo de TI y facilite la impresión para toda la empresa utilizando un solo controlador para todos los dispositivos HP.', 430, 474, NULL, 0),
(8497, '08100R2', 'Cinta Brother TZe-S211 Negro sobre Blanco Extra Adhesiva, 6mm x 8m, para PTD600 X 8M ADHESIVO INDUSTRIAL', 0, 'pending', 'hidden', 0, 0.1, 0.1, 0.1, 'Disponemos de una amplia gama de etiquetas para satisfacer cualquier necesidad de etiquetado. Nuestras etiquetas se han diseñado con un revestimiento especial, haciéndolas más duraderas que las de papel normal.\n\n', 421, 478, NULL, 0),
(8498, '1650QSA', 'Cisco Auriculares 522, Alámbrico, USB, Negro/Gris USB HEADSET ADAPTER', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'Cisco Headset 500 Series es una gama profesional de auriculares con cable e inalámbricos optimizados para teléfonos IP de Cisco y clientes de software.\n\nEstos auriculares están diseñados para trabajadores en espacios de trabajo abiertos para que puedan ser más productivos. Cuentan con un audio vibrante, un potente aislamiento de ruido y una comodidad excepcional.\n\nDescripción del producto\n\nLos auriculares Cisco® de la serie 500 ofrecen un sonido sorprendentemente vibrante para espacios de trabajo abiertos. Los usuarios pueden concentrarse en entornos ruidosos con un sonido rico, comodidad excepcional y confiabilidad comprobada. La serie 500 ofrece un factor de forma liviano que es cómodo de usar, incluso durante todo un día de trabajo. Está diseñado para trabajadores que pasan mucho tiempo usando auriculares para comunicaciones de voz y escuchando música.\n\nLa serie Headset 500 ofrece:\nComodidad ligera que es ideal para un uso prolongado\nSonido premium en un factor de forma elegante, ideal para comunicaciones de voz y música\nPotente aislamiento de ruido con micrófonos unidireccionales que están diseñados para concentrarse en la voz del usuario y, al mismo tiempo, minimizar el ruido de fondo.\nExperiencia de configuración de usuario fácil e intuitiva cuando se utiliza con teléfonos IP de Cisco', 423, 495, NULL, 0),
(8499, '7140MEE', 'SSD para Servidor HPE P18420-B21, 240GB, SATA, 2.5\", 127mm SSD', 0, 'pending', 'hidden', 0, 0.18, 0.18, 0.18, '¿Necesita acelerar el rendimiento de sus aplicaciones de uso intensivo de datos?\n\nLas unidades de estado sólido (SSD) de lectura intensiva (RI) de servidor HPE ofrecen alto rendimiento y resistencia para aplicaciones que requieren un alto rendimiento de IOPS de lectura aleatoria.\n\nLas SSD de HPE (RI) están respaldadas por más de 3,35 millones de horas de pruebas y cualificación que garantizan unidades fiables y de alto rendimiento.\n\nLos SSD HPE Value SAS ofrecen un aumento significativo del rendimiento en comparación con los SSD SATA con aproximadamente el doble de IOPS que los SSD SATA, lo que le permite mejorar las cargas de trabajo de bases de datos transaccionales con los SSD Value SAS asequibles.\n\nEl firmware firmado digitalmente de HPE evita el acceso no autorizado a sus datos al proporcionar la seguridad de que el firmware de la unidad proviene de una fuente confiable. Los iconos de HPE Smart Carrier eliminan las conjeturas sobre el estado de una unidad y el botón \"no eliminar\" evita la pérdida de datos por error humano. También puede monitorear la vida útil de su SSD con HPE SmartSSD Wear Gauge, lo que le permite determinar si alguna unidad está en riesgo de fallar.\n\nCaracterísticas\n\nAlto rendimiento, confiabilidad excepcional y eficiencia para resultados comerciales más rápidos\n\nLas unidades de estado sólido HPE son ideales para análisis de big data, computación en la nube, archivado activo, aplicaciones de bases de datos y almacenamiento de datos.\n\nConsiga mayores IOP para mejorar el rendimiento de su centro de datos.\n\nMantenga la precisión de los datos con la detección completa de errores en la ruta de datos.\n\nElija entre una amplia cartera de soluciones mejoradas en una amplia variedad de capacidades.\n\nKits de habilitación SAS de 12 Gb / s, SATA de 6 Gb / s, NVMe, M.2 y M.2.\n\nLos SSD SAS de valor ofrecen el doble de IOPS que los SSD SATA, lo que mejora significativamente el rendimiento de la carga de trabajo\n\nLas unidades de estado sólido (SSD) HPE Value SAS admiten 12 Gbs, en comparación con las SSD SATA de 6 Gbs.\n\nOptimizados para cargas de trabajo de aplicaciones empresariales, los SSD HPE Value SAS le permiten hacer más trabajo con menos servidores al mejorar y consolidar las cargas de trabajo de bases de datos transaccionales.\n\nLos SSD HPE Value SAS le permiten reducir los costos operativos de almacenamiento, alimentación y mantenimiento de servidores, además de reducir la huella de su centro de datos.\n\nDisponibles en una variedad de capacidades de almacenamiento, las SSD HPE Value SAS son la elección perfecta para admitir aplicaciones de uso mixto y de lectura intensiva.\n\nLos SSD de varios proveedores ofrecen ciclos de vida de SKU más prolongados y disponibilidad inmediata en SSD SATA\n\nHPE mejoró su amplia cartera de SSD con una oferta de SSD de múltiples proveedores que permite ciclos de vida de SKU extendidos, suministro disponible de inmediato y SSD SATA de precio preferencial.\n\nLa oferta de SSD de varios proveedores de HPE garantiza que la SSD SATA seleccionada proporcione el nivel mínimo de rendimiento publicado o mejor.', 431, 483, NULL, 0),
(8500, '7140MEF', 'SSD para Servidor HPE P19974-B21, 480GB, SATA III, 3.5\" 5300P SSD', 0, 'pending', 'hidden', 0, 0.27, 0.27, 0.27, 'Características clave\nAlto rendimiento, confiabilidad excepcional y eficiencia para resultados comerciales más rápidos\n\nLas unidades de estado sólido HPE son ideales para análisis de big data, computación en la nube, archivado activo, aplicaciones de bases de datos y almacenamiento de datos.\n\nLos SSD de HPE logran IOP más altos para mejorar el rendimiento de su centro de datos.\n\nLos SSD de HPE mantienen la precisión de los datos con una detección completa de errores en la ruta de datos.\n\nElija entre una amplia cartera de soluciones mejoradas en una amplia variedad de capacidades.\n\nKits de habilitación SAS de 12 Gb / s, SATA de 6 Gb / s, NVMe, M.2 y M.2.\n\nLas SSD HPE Value SAS ofrecen el doble de velocidad de interfaz que las SSD SATA, lo que mejora el rendimiento de la carga de trabajo\n\nLas unidades de estado sólido (SSD) HPE Value SAS admiten 12 Gb / s, en comparación con las SSD SATA a 6 Gb / s.\n\nOptimizados para cargas de trabajo de aplicaciones empresariales, los SSD HPE Value SAS le permiten hacer más trabajo con menos servidores al mejorar y consolidar las cargas de trabajo de bases de datos transaccionales.\n\nLos SSD HPE Value SAS le permiten reducir los costos operativos de almacenamiento, alimentación y mantenimiento de servidores, además de reducir la huella de su centro de datos.\n\nDisponibles en una variedad de capacidades de almacenamiento, los SSD HPE Value SAS son la elección perfecta para admitir aplicaciones de uso mixto y de lectura intensiva.\n\nLos SSD de varios proveedores de HPE ofrecen ciclos de vida de SKU más prolongados y disponibilidad inmediata en SSD SATA\n\nHPE mejoró su amplia cartera de SSD con una oferta de SKU de SSD de múltiples proveedores que permite ciclos de vida de SKU extendidos, suministro disponible de inmediato y SSD SATA de precio preferencial.\n\nLa oferta de SKU de SSD de varios proveedores de HPE garantiza que la SSD SATA seleccionada proporcione el nivel mínimo de rendimiento publicado o mejor.', 431, 483, NULL, 0),
(8501, '7140MEG', 'SSD para Servidor HPE P19980-B21, 960GB, SATA, 3.5\", 6Gbit/s 5300M SSD', 0, 'pending', 'hidden', 0, 0.26, 0.26, 0.26, 'Las unidades de estado sólido (SSD) HPE SATA de uso mixto (MU) ofrecen funciones empresariales a un precio asequible. Los SSD HPE SATA MU están diseñados para un mayor rendimiento y resistencia para aplicaciones que requieren una combinación más equilibrada de alto rendimiento de IOPS de lectura y escritura aleatoria, como bases de datos, virtualización, computación en la nube y aplicaciones transaccionales.\n\nLos SSD HPE Value SAS 12G ofrecen mayor rendimiento que los SSD SATA 6G a un costo menor que los SSD SAS 12G tradicionales, lo que le permite mejorar el costo total de propiedad (TCO) con SSD HPE Value SAS asequibles.\n\nLas SSD de HPE están respaldadas por más de 3,35 millones de horas de pruebas y calificaciones que garantizan unidades confiables y de alto rendimiento. El firmware firmado digitalmente de HPE evita el acceso no autorizado a sus datos al proporcionar la seguridad de que el firmware de la unidad proviene de una fuente confiable. También puede monitorear la vida útil de su SSD con HPE SmartSSD Wear Gauge para determinar si alguna unidad está en riesgo de fallar.', 431, 483, NULL, 0),
(8502, 'C3700IX', 'Laptop HP Chromebook 11 G8 EE, Intel® Celeron® N4020,Chrome OS?, No, WLAN I 9560 ac 2x2 MU-MIMO nvP +BT 5 WW, No WWAN, 4 GB, 4 GB (1x4GB) LPDDR4 3733, 32 GB eMMC, No, No, BATT 2C 47 WHr Long Life, LCD 11, LCD 11.6 HD AG LED SVA 220 slim, No, No, No DIB, 1 4GB 32GB', 0, 'pending', 'hidden', 0, 0.43, 0.43, 0.43, '\nUna Chromebook resistente para uso escolar\nProporcione a los estudiantes una Chromebook que soportará una caída del escritorio, una salpicadura de\nrefresco o un cable de alimentación tironeado. Es resistente a salpicaduras e intentos de quitar teclas y tiene\nesquinas reforzadas con metal. Además, está probado para resistir caídas desde 122 cm , una altura que es\nsuperior a la mayoría de los escritorios.\nLista para trabajar en el salón de clases\nAcceda y transmita con rapidez libros, exámenes y mucho más con procesadores Intel® y Chrome OS. Trabaje sin\nparar con una batería de larga duración y carga rápida. Controle y administre con facilidad las interacciones de los\nestudiantes con HP Classroom Manager .\n', 434, 464, NULL, 0),
