(8508, 'A040860', 'Beats Flex - Audífonos IN-EAR Inalámbrico Amarillo Círtrico INALAMBRICOS AMARILLO CITRICO', 0, 'pending', 'hidden', 0, 0.08, 0.08, 0.08, 'Flexibilidad todo el día\nEn los oídos o alrededor del cuello, los audífonos Beats Flex son tan versátiles como tu vida. Ya sea que estés escuchando música, hablando por teléfono o navegando por tus redes sociales, siempre estarás alerta para lo que venga. Los audífonos magnéticos hacen que escuchar sea mucho más fácil, ya que reproducen automáticamente la música cuando están en tus oídos y hacen una pausa cuando los dejas alrededor del cuello¹. El cable Flex-Form brinda comodidad durante todo el día con tecnología Nitinol duradera, mientras que las cuatro opciones de almohadillas ofrecen un ajuste personalizado. Y cuando no los usas, los audífonos magnéticos mantienen a los audífonos Beats Flex libres de enredos, ya que se enrollan fácilmente para guardarlos en el bolsillo o la bolsa.', 419, 495, NULL, 0);
