(8511, 'A0201WJ', 'Diadema Manhattan 179843 - Alámbrico - USB - Micrófono - Negro MICROFONO ALAMBRICO CONTROL INTEGRA', 0, 'pending', 'hidden', 0, 0.2, 0.2, 0.2, 'Auriculares USB para colocar sobre la oreja: sonido estéreo de calidad y asequible para el hogar y la oficina\nEl auricular USB estéreo de Manhattan es su herramienta de audio versátil para aplicaciones de llamadas comunes, como Skype, Teams o Zoom, en todas las plataformas y sistemas operativos. Ya sea que esté participando en una llamada de conferencia, escuchando un seminario web o disfrutando de su lista de reproducción favorita, obtendrá una calidad de sonido estéreo digital clara y confiable de controladores de 40 mm de tamaño generoso en todo momento.\n\nPlug and play, fácil de usar y cableado para empresas\n\nListo para salir de la caja, este auricular USB le permite comenzar a hablar y escuchar tan pronto como conecte su único conector USB-A en su dispositivo. Funciona independientemente del sistema operativo que admita su dispositivo, y nunca tendrá que preocuparse por las baterías vacías, ya que se alimenta mediante USB.\n\nCómodo uso durante todo el día\n\nLa diadema acolchada, ajustable y liviana de los auriculares USB cuenta con almohadillas ultra suaves para colocar sobre las orejas que brindan horas de comodidad. Puede reposicionar fácilmente el micrófono boom flexible del lado izquierdo para una mejor captura de voz y luego apartarlo cuando haya terminado de hacer llamadas.', 446, 495, NULL, 0),
(8513, 'A0201WK', 'Manhattan Cable DisplayPort Macho - DisplayPort Macho 2 Metros, Negro MACHO COLOR NEGRO', 0, 'pending', 'hidden', 0, 0.24, 0.24, 0.24, 'Los cables DisplayPort de Manhattan proporcionan una solución de un solo cable que entrega señales de video y audio digital de alta definición entre computadoras de escritorio y portátiles y un dispositivo de salida. Con un ancho de banda de 10,8 Gbps (1080 Mbps), color profundo y capacidad de audio sin comprimir de 24 bits y 8 canales, el conector de 20 clavijas es pequeño, compacto e ideal para usar con computadoras equipadas con DisplayPort, pantallas de panel plano y perfil delgado. dispositivos y muchos productos electrónicos de consumo, incluidos reproductores de Blu-ray y consolas de juegos. El blindaje trenzado y de aluminio completo, las botas moldeadas con alivio de tensión, las cubiertas protectoras de PVC y las conexiones enchapadas en oro ayudan a que los cables DisplayPort de Manhattan proporcionen la máxima conductividad y transmisiones de señales claras y nítidas con menos interferencia y distorsión EMI.', 446, 494, NULL, 0),
