(8515, 'A0201WM', 'Manhattan Hub USB A 3.0 de Supervelocidad, 4 Puertos, 5000 Mbit/s, con Fuente CON FUENTE COLOR NEGRO', 0, 'pending', 'hidden', 0, 0.16, 0.16, 0.16, 'Rendimiento potente y rápido SuperSpeed ??USB 3.0 en un concentrador multipuerto.\nEl concentrador USB 3.0 SuperSpeed ??de Manhattan expande fácilmente el acceso USB para escritorio y uso móvil para conectar más periféricos y dispositivos móviles. Cree más conexiones para dispositivos SuperSpeed ??USB 3.0, como dispositivos de almacenamiento y cámaras web. Es retrocompatible con los estándares USB anteriores, lo que brinda versatilidad para los dispositivos conectados. Plug and play con capacidades de intercambio en caliente, compatibilidad con Windows y Mac y velocidades de transferencia de datos de hasta 5 Gbps ayudan al concentrador Manhattan SuperSpeed ??USB 3.0 a consolidar numerosos concentradores menos capaces en una sola solución USB.', 446, 467, NULL, 0),
(8516, 'A0201WN', 'Mouse Manhattan Óptico MH3, Alámbrico, 1000DPI, USB, Diseño Clásico NERO-PLATA', 0, 'pending', 'hidden', 0, 0.13, 0.13, 0.13, 'Un diseño básico y práctico que permite una operación y desempeño total. El Ratón Óptico Clásico de MANHATTAN con resolución de 1000 ppp ofrece un buen desempeño con un diseño resistente y práctico. Su tamaño compacto y diseño ambidiestro de tres botones con rueda de desplazamiento es ideal para las necesidades de uso en equipo de cómputo diarias. De fácil instalación y bajo mantenimiento Su instalación Plug and Play y compatibilidad con Windows 98SE/ Me/ 2000/ XP/ Vista ofrece una operación rápida y sencilla. Sin partes mecánicas o rodantes que puedan desgastarse o fallar, El Ratón Óptico Clásico de MANHATTAN requiere un mínimo mantenimiento para para conservar su buen desempeño.\n\nTecnología: Óptico\nResolución de movimiento : 1000 DPI\nTecnología de conectividad: Alámbrico\nLongitud de cable: 1,4 m\nCantidad de botones: 3\nColor del producto: Negro', 446, 472, NULL, 0),
