(8531, 'A6400LS', 'Targus NEWPORT ULTRA SLIM BACKPACK B ULTRA SLIM BACKPACK  BLACK', 0, 'pending', 'hidden', 0, 0.41, 0.41, 0.41, 'Ya sea que esté buscando un compañero de viaje o de trabajo, la mochila Newport ultradelgada de 15 \"se ajusta a la factura. No estaría fuera de lugar paseando por calles bordeadas de piedra rojiza o vecindarios de playa, y funciona como una pequeña mochila para su trabajo accesorios.\n\nDiseñado para adaptarse a computadoras portátiles o tabletas delgadas, ofrece suficiente espacio para sus elementos esenciales de todos los días. Con sus bolsillos delanteros y traseros de acceso rápido, las correas de los hombros que convierten la mochila en un bolso de mano, este estuche delgado y elegante es el paquete perfecto para quienes están constantemente en movimiento.\n\nPara adaptarse a las diferentes preferencias de transporte, también se han agregado correas de hombro ajustables acolchadas y un asa superior para mayor comodidad en los viajes diarios al trabajo o en escapadas cortas sin lujos. Para aquellos que viajan con frecuencia por trabajo o simplemente necesitan una bolsa práctica para una escapada de ocio, se puede sujetar fácilmente al equipaje con ruedas con una correa para equipaje para un transporte sin peso.', 456, 502, NULL, 0),
