(8543, '16511PA', ' Cisco CBS250 Managed 24-port GE 4x1 SFP', 0, 'pending', 'hidden', 0, 0.58, 0.58, 0.58, 'En el mundo hiperconectado de hoy, el acceso confiable a los recursos de la red es fundamental para todas las empresas. Sin embargo, también debe invertir sabiamente para mantenerse competitivo, sabiendo cómo separar lo esencial de lo extraño y obtener el máximo valor por su dólar. Si bien es esencial construir una base sólida para la infraestructura de red de su empresa, no significa que necesite el conjunto de funciones más avanzadas del mercado.\n\nPara las empresas que requieren alto rendimiento, seguridad avanzada y una gran capacidad de administración de la red, los conmutadores completamente administrados son una excelente opción. Sin embargo, también suelen tener etiquetas de precio elevado. Los conmutadores inteligentes proporcionan el nivel adecuado de funciones y capacidades de red para empresas en crecimiento a un precio asequible, por lo que tendrá más dólares para invertir en el crecimiento de su empresa.\n\nCon los conmutadores inteligentes Cisco Business 250 Series, puede lograr un rendimiento y seguridad de red de nivel empresarial sin tener que pagar por funciones de red avanzadas que no utilizará. Cuando necesita una solución confiable para compartir recursos en línea y conectar computadoras, teléfonos y puntos de acceso inalámbricos, los conmutadores inteligentes Cisco Business 250 Series brindan la solución ideal a un precio asequible.\n\nCisco Business 250 Series es la próxima generación de conmutadores inteligentes asequibles que combinan un potente rendimiento y fiabilidad de la red con un conjunto completo de funciones de red que necesita para una red empresarial sólida. Estos potentes conmutadores Gigabit Ethernet, con enlaces ascendentes Gigabit o 10 Gigabit Ethernet, brindan múltiples opciones de administración, capacidades de seguridad sofisticadas y características de calidad de servicio (QoS) ajustadas y enrutamiento estático de capa 3 mucho más allá de las de un conmutador no administrado o de nivel de consumidor , a un costo menor que para los conmutadores completamente administrados. Y con una interfaz de usuario web fácil de usar y capacidad Power over Ethernet Plus (PoE +), puede implementar y configurar una red empresarial completa en minutos.', 423, 467, NULL, 0),
(8544, '16511PB', 'Cisco CBS250 Managed 48-port GE SFP', 0, 'pending', 'hidden', 0, 0.58, 0.58, 0.58, '', 423, 467, NULL, 0),
(8545, '7140MF0', 'HPE Unidad de Cinta StoreEver LTO-7 Ultrium 15000 External SAS, 6TB TAPE DRIVE', 0, 'pending', 'hidden', 0, 0.3, 0.3, 0.3, 'Las unidades de cinta HPE StoreEver LTO Ultrium representan ocho generaciones de tecnología LTO, capaces de almacenar hasta 30 TB1 por cartucho, con cifrado de datos de hardware y HPE StoreOpen con LTFS para facilitar el uso y conseguir un rendimiento sin precedentes. Mediante el uso del cifrado del hardware de datos AES de 256 bits se ofrece una seguridad fácil de activar para proteger los datos más confidenciales y evitar el acceso no autorizado a los cartuchos de cintas. Linear Tape File System (LTFS) es un formato abierto para el almacenamiento de datos en cinta que hace que las cintas LTO de 5.ª generación y posteriores sean autodescriptivas y basadas en archivos. Con velocidades de transferencia de datos de hasta 300 MB/s nativos, Data Rate Matching optimiza aún más el rendimiento, al hacer coincidir la velocidad del sistema host para mantener las unidades en transmisión, lo que permite un rendimiento de cinta más rápido.', 431, 481, NULL, 0),
