(8668, '195052Q', 'Impresora Lexmark MS331dn, Blanco y Negro, Láser, Print 40PPM', 0, 'pending', 'hidden', 0, 0.45, 0.45, 0.45, 'Salida que se adapta Con solo 8,7 pulgadas de alto x 14,5 pulgadas de ancho x 14,3 pulgadas de profundidad (222 mm de alto x 368 mm de ancho x 363 mm de profundidad), la MS331dn de clase empresarial cabe en casi cualquier lugar. Su tamaño compacto y peso ligero hacen que sea fácil de instalar y mover. Imprima más, pare menos El tóner Unison ? de alto rendimiento disponible proporciona hasta 15.000 páginas ** de salida, mientras que una bandeja de papel opcional aumenta la capacidad de entrada total hasta 900 hojas para obtener más impresiones y menos tiempo de inactividad. Rendimiento sólido, conectividad flexible Obtenga su primera página en tan solo 6.2 segundos y realice trabajos desafiantes con un procesador de doble núcleo de 1 GHz y 256 MB de memoria. Conéctese a través de USB o Ethernet para dar acceso a todo su equipo. Seguridad de espectro completo El enfoque integral de Lexmark para la seguridad del producto es un mandato de diseño e ingeniería en toda nuestra cartera de productos. Nuestras funciones de seguridad ayudan a mantener su información segura: en el documento, en el dispositivo, en la red y en todos los puntos intermedios. Durabilidad sin intervención Con su estructura de acero y su fusor de por vida, la MS331dn está diseñada para durar. Ahorre papel, ahorre energía La impresión automática a dos caras es estándar, junto con los modos de ahorro de energía incorporados que ayudan a respaldar las clasificaciones de certificación EPEAT® Silver y ENERGY STAR®. El Programa de recolección de cartuchos de Lexmark (LCCP) y el Programa de recolección de equipos de Lexmark (LECP) minimizan los desechos y respaldan el reciclaje (la disponibilidad varía según el país).', 441, 476, NULL, 0),
